const PRISM_CUSTOMER_MANAGER = {
    version: '1.0.0',
    authority: 'PRISM_CUSTOMER_MANAGER',
    
    // Customer database
    customers: {},
    
    // Customer schema
    createCustomer: function(params) {
        const { name, company = '', email = '', phone = '', address = {}, industry = '', notes = '' } = params;
        
        if (!name) throw new Error('Customer name required');
        
        const id = 'CUST-' + Date.now().toString(36).toUpperCase();
        
        this.customers[id] = {
            id, name, company, email, phone, address, industry, notes,
            created: Date.now(),
            modified: Date.now(),
            status: 'active',
            creditLimit: 0,
            paymentTerms: 'NET30',
            taxExempt: false,
            contacts: [],
            tags: [],
            customFields: {},
            // Analytics
            analytics: {
                totalOrders: 0,
                totalRevenue: 0,
                avgOrderValue: 0,
                lastOrderDate: null,
                firstOrderDate: null,
                lifetimeValue: 0,
                onTimePaymentRate: 1.0,
                avgPaymentDays: 0
            },
            // Communication history
            communications: [],
            // Order history (references)
            orderHistory: []
        };
        
        this._persistData();
        return this.customers[id];
    },
    
    updateCustomer: function(customerId, updates) {
        if (!this.customers[customerId]) throw new Error('Customer not found: ' + customerId);
        
        const customer = this.customers[customerId];
        const allowed = ['name', 'company', 'email', 'phone', 'address', 'industry', 'notes', 
                         'status', 'creditLimit', 'paymentTerms', 'taxExempt', 'tags', 'customFields'];
        
        for (const key of allowed) {
            if (updates[key] !== undefined) customer[key] = updates[key];
        }
        
        customer.modified = Date.now();
        this._persistData();
        return customer;
    },
    
    getCustomer: function(customerId) {
        return this.customers[customerId] || null;
    },
    
    searchCustomers: function(query, options = {}) {
        const { status = null, industry = null, minOrders = 0, minRevenue = 0, tags = [] } = options;
        const queryLower = query.toLowerCase();
        
        return Object.values(this.customers).filter(c => {
            // Text search
            const textMatch = !query || 
                c.name.toLowerCase().includes(queryLower) ||
                c.company.toLowerCase().includes(queryLower) ||
                c.email.toLowerCase().includes(queryLower);
            
            // Filters
            const statusMatch = !status || c.status === status;
            const industryMatch = !industry || c.industry === industry;
            const ordersMatch = c.analytics.totalOrders >= minOrders;
            const revenueMatch = c.analytics.totalRevenue >= minRevenue;
            const tagsMatch = tags.length === 0 || tags.some(t => c.tags.includes(t));
            
            return textMatch && statusMatch && industryMatch && ordersMatch && revenueMatch && tagsMatch;
        });
    },
    
    addContact: function(customerId, contact) {
        const customer = this.customers[customerId];
        if (!customer) throw new Error('Customer not found');
        
        const contactId = 'CONT-' + Date.now().toString(36).toUpperCase();
        customer.contacts.push({
            id: contactId,
            name: contact.name || '',
            title: contact.title || '',
            email: contact.email || '',
            phone: contact.phone || '',
            isPrimary: contact.isPrimary || customer.contacts.length === 0,
            created: Date.now()
        });
        
        this._persistData();
        return customer.contacts[customer.contacts.length - 1];
    },
    
    recordOrder: function(customerId, orderData) {
        const customer = this.customers[customerId];
        if (!customer) throw new Error('Customer not found');
        
        const { orderId, amount, date = Date.now() } = orderData;
        
        customer.orderHistory.push({ orderId, amount, date });
        customer.analytics.totalOrders++;
        customer.analytics.totalRevenue += amount;
        customer.analytics.avgOrderValue = customer.analytics.totalRevenue / customer.analytics.totalOrders;
        customer.analytics.lastOrderDate = date;
        if (!customer.analytics.firstOrderDate) customer.analytics.firstOrderDate = date;
        
        // Simplified LTV calculation (could use more sophisticated models)
        const monthsActive = (Date.now() - customer.analytics.firstOrderDate) / (30 * 24 * 60 * 60 * 1000);
        const ordersPerMonth = monthsActive > 0 ? customer.analytics.totalOrders / monthsActive : 1;
        customer.analytics.lifetimeValue = customer.analytics.avgOrderValue * ordersPerMonth * 24; // 2-year projection
        
        this._persistData();
        return customer.analytics;
    },
    
    recordPayment: function(customerId, paymentData) {
        const customer = this.customers[customerId];
        if (!customer) throw new Error('Customer not found');
        
        const { invoiceDate, paymentDate, amount, onTime } = paymentData;
        const paymentDays = (paymentDate - invoiceDate) / (24 * 60 * 60 * 1000);
        
        // Update payment analytics
        const n = customer.analytics.totalOrders || 1;
        customer.analytics.avgPaymentDays = ((customer.analytics.avgPaymentDays * (n - 1)) + paymentDays) / n;
        customer.analytics.onTimePaymentRate = ((customer.analytics.onTimePaymentRate * (n - 1)) + (onTime ? 1 : 0)) / n;
        
        this._persistData();
        return customer.analytics;
    },
    
    logCommunication: function(customerId, commData) {
        const customer = this.customers[customerId];
        if (!customer) throw new Error('Customer not found');
        
        customer.communications.push({
            id: 'COMM-' + Date.now().toString(36).toUpperCase(),
            type: commData.type || 'note', // email, call, meeting, note
            subject: commData.subject || '',
            content: commData.content || '',
            date: commData.date || Date.now(),
            user: commData.user || 'system'
        });
        
        this._persistData();
        return customer.communications[customer.communications.length - 1];
    },
    
    getCustomerSegments: function() {
        const customers = Object.values(this.customers);
        
        // RFM Segmentation (Recency, Frequency, Monetary)
        const now = Date.now();
        const thirtyDays = 30 * 24 * 60 * 60 * 1000;
        const ninetyDays = 90 * 24 * 60 * 60 * 1000;
        
        const segments = {
            champions: [],     // High value, recent, frequent
            loyal: [],         // Regular customers
            potential: [],     // Growing customers
            atRisk: [],        // Haven't ordered recently
            inactive: [],      // No orders in 90+ days
            new: []            // Recent first order
        };
        
        for (const c of customers) {
            if (c.status !== 'active') continue;
            
            const daysSinceOrder = c.analytics.lastOrderDate ? 
                (now - c.analytics.lastOrderDate) / (24 * 60 * 60 * 1000) : 999;
            
            const isHigh = c.analytics.totalRevenue > 10000;
            const isFrequent = c.analytics.totalOrders >= 5;
            const isRecent = daysSinceOrder < 30;
            const isNew = c.analytics.totalOrders === 1 && daysSinceOrder < 60;
            
            if (isNew) segments.new.push(c);
            else if (isHigh && isFrequent && isRecent) segments.champions.push(c);
            else if (isFrequent && isRecent) segments.loyal.push(c);
            else if (daysSinceOrder > 90) segments.inactive.push(c);
            else if (daysSinceOrder > 30) segments.atRisk.push(c);
            else segments.potential.push(c);
        }
        
        return segments;
    },
    
    getTopCustomers: function(limit = 10, sortBy = 'revenue') {
        const customers = Object.values(this.customers).filter(c => c.status === 'active');
        
        const sorters = {
            revenue: (a, b) => b.analytics.totalRevenue - a.analytics.totalRevenue,
            orders: (a, b) => b.analytics.totalOrders - a.analytics.totalOrders,
            ltv: (a, b) => b.analytics.lifetimeValue - a.analytics.lifetimeValue,
            recent: (a, b) => (b.analytics.lastOrderDate || 0) - (a.analytics.lastOrderDate || 0)
        };
        
        return customers.sort(sorters[sortBy] || sorters.revenue).slice(0, limit);
    },
    
    _persistData: function() {
        try {
            localStorage.setItem('prism_customers', JSON.stringify(this.customers));
        } catch (e) { /* Storage unavailable */ }
    },
    
    loadPersistedData: function() {
        try {
            const saved = localStorage.getItem('prism_customers');
            if (saved) this.customers = JSON.parse(saved);
        } catch (e) { /* Storage unavailable */ }
    },
    
    runSelfTests: function() {
        console.log('[CUSTOMER_MANAGER] Running self-tests...');
        const results = { passed: 0, failed: 0, tests: [] };
        
        try {
            const c = this.createCustomer({ name: 'Test Corp', company: 'Test Industries', email: 'test@test.com' });
            if (c.id && c.name === 'Test Corp') { results.passed++; results.tests.push({ name: 'Create Customer', status: 'PASS' }); }
            else throw new Error('Invalid customer');
            
            // Cleanup
            delete this.customers[c.id];
        } catch (e) { results.failed++; results.tests.push({ name: 'Create Customer', status: 'FAIL', error: e.message }); }
        
        try {
            const c = this.createCustomer({ name: 'Test2' });
            this.recordOrder(c.id, { orderId: 'O1', amount: 5000 });
            if (c.analytics.totalOrders === 1 && c.analytics.totalRevenue === 5000) { 
                results.passed++; results.tests.push({ name: 'Record Order', status: 'PASS' }); 
            }
            else throw new Error('Invalid analytics');
            delete this.customers[c.id];
        } catch (e) { results.failed++; results.tests.push({ name: 'Record Order', status: 'FAIL', error: e.message }); }
        
        try {
            const s = this.getCustomerSegments();
            if (s.champions && s.loyal && s.atRisk) { results.passed++; results.tests.push({ name: 'Segments', status: 'PASS' }); }
            else throw new Error('Invalid segments');
        } catch (e) { results.failed++; results.tests.push({ name: 'Segments', status: 'FAIL', error: e.message }); }
        
        console.log('[CUSTOMER_MANAGER] Tests: ' + results.passed + '/' + (results.passed + results.failed) + ' passed');
        return results;
    }
};

if (typeof PRISM_GATEWAY !== 'undefined') {
    PRISM_GATEWAY.register('customer.create', 'PRISM_CUSTOMER_MANAGER.createCustomer');
    PRISM_GATEWAY.register('customer.update', 'PRISM_CUSTOMER_MANAGER.updateCustomer');
    PRISM_GATEWAY.register('customer.get', 'PRISM_CUSTOMER_MANAGER.getCustomer');
    PRISM_GATEWAY.register('customer.search', 'PRISM_CUSTOMER_MANAGER.searchCustomers');
    PRISM_GATEWAY.register('customer.recordOrder', 'PRISM_CUSTOMER_MANAGER.recordOrder');
    PRISM_GATEWAY.register('customer.segments', 'PRISM_CUSTOMER_MANAGER.getCustomerSegments');
    PRISM_GATEWAY.register('customer.top', 'PRISM_CUSTOMER_MANAGER.getTopCustomers');
}

console.log('[PRISM_CUSTOMER_MANAGER] Loaded v1.0.0');

// ═══════════════════════════════════════════════════════════════════════════════
// PRODUCT 3: BUSINESS/SHOP/ERP SYSTEM - ORDER MANAGER
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_ORDER_MANAGER = {
    version: '1.0.0',
    authority: 'PRISM_ORDER_MANAGER',
    
    // Order database
    orders: {},
    workOrders: {},
    
    // Order statuses
    ORDER_STATUSES: ['quote', 'pending', 'confirmed', 'in_progress', 'complete', 'shipped', 'invoiced', 'closed', 'cancelled'],
    WO_STATUSES: ['created', 'released', 'in_progress', 'complete', 'on_hold', 'cancelled'],
    
    createOrder: function(params) {
        const { customerId, items = [], notes = '', dueDate = null, priority = 'normal' } = params;
        
        if (!customerId) throw new Error('Customer ID required');
        if (items.length === 0) throw new Error('Order must have items');
        
        const orderId = 'ORD-' + Date.now().toString(36).toUpperCase();
        
        // Calculate totals
        let subtotal = 0;
        const processedItems = items.map((item, idx) => {
            const lineTotal = (item.quantity || 1) * (item.unitPrice || 0);
            subtotal += lineTotal;
            return {
                lineNumber: idx + 1,
                partNumber: item.partNumber || '',
                description: item.description || '',
                quantity: item.quantity || 1,
                unitPrice: item.unitPrice || 0,
                lineTotal,
                material: item.material || '',
                operations: item.operations || [],
                estimatedHours: item.estimatedHours || 0
            };
        });
        
        const taxRate = 0; // Would come from customer/location
        const tax = subtotal * taxRate;
        const total = subtotal + tax;
        
        this.orders[orderId] = {
            id: orderId,
            customerId,
            status: 'quote',
            items: processedItems,
            notes,
            dueDate,
            priority,
            subtotal, tax, total,
            created: Date.now(),
            modified: Date.now(),
            statusHistory: [{ status: 'quote', timestamp: Date.now(), user: 'system' }],
            workOrders: [],
            shipments: [],
            invoices: [],
            attachments: []
        };
        
        this._persistData();
        return this.orders[orderId];
    },
    
    updateOrderStatus: function(orderId, newStatus, user = 'system', notes = '') {
        const order = this.orders[orderId];
        if (!order) throw new Error('Order not found');
        if (!this.ORDER_STATUSES.includes(newStatus)) throw new Error('Invalid status');
        
        const oldStatus = order.status;
        order.status = newStatus;
        order.modified = Date.now();
        order.statusHistory.push({ status: newStatus, from: oldStatus, timestamp: Date.now(), user, notes });
        
        // Auto-update customer analytics when complete
        if (newStatus === 'complete' || newStatus === 'shipped') {
            if (typeof PRISM_CUSTOMER_MANAGER !== 'undefined') {
                PRISM_CUSTOMER_MANAGER.recordOrder(order.customerId, { orderId, amount: order.total });
            }
        }
        
        this._persistData();
        return order;
    },
    
    createWorkOrder: function(orderId, params = {}) {
        const order = this.orders[orderId];
        if (!order) throw new Error('Order not found');
        
        const { lineNumbers = [], machineId = null, operatorId = null, scheduledStart = null } = params;
        
        const woId = 'WO-' + Date.now().toString(36).toUpperCase();
        
        // Get items for this work order
        const items = lineNumbers.length > 0 ?
            order.items.filter(i => lineNumbers.includes(i.lineNumber)) :
            order.items;
        
        const workOrder = {
            id: woId,
            orderId,
            customerId: order.customerId,
            status: 'created',
            items: items.map(i => ({ ...i, completedQty: 0, scrapQty: 0 })),
            machineId,
            operatorId,
            scheduledStart,
            actualStart: null,
            completedDate: null,
            totalEstimatedHours: items.reduce((a, i) => a + (i.estimatedHours || 0), 0),
            actualHours: 0,
            notes: '',
            created: Date.now(),
            modified: Date.now(),
            statusHistory: [{ status: 'created', timestamp: Date.now() }],
            timeEntries: [],
            qualityRecords: []
        };
        
        this.workOrders[woId] = workOrder;
        order.workOrders.push(woId);
        
        this._persistData();
        return workOrder;
    },
    
    updateWorkOrderStatus: function(woId, newStatus, details = {}) {
        const wo = this.workOrders[woId];
        if (!wo) throw new Error('Work order not found');
        if (!this.WO_STATUSES.includes(newStatus)) throw new Error('Invalid status');
        
        const oldStatus = wo.status;
        wo.status = newStatus;
        wo.modified = Date.now();
        wo.statusHistory.push({ status: newStatus, from: oldStatus, timestamp: Date.now(), ...details });
        
        if (newStatus === 'in_progress' && !wo.actualStart) wo.actualStart = Date.now();
        if (newStatus === 'complete') wo.completedDate = Date.now();
        
        this._persistData();
        return wo;
    },
    
    recordTimeEntry: function(woId, entry) {
        const wo = this.workOrders[woId];
        if (!wo) throw new Error('Work order not found');
        
        const { operatorId, hours, operation = '', notes = '' } = entry;
        
        wo.timeEntries.push({
            id: 'TE-' + Date.now().toString(36),
            operatorId, hours, operation, notes,
            timestamp: Date.now()
        });
        
        wo.actualHours += hours;
        wo.modified = Date.now();
        
        this._persistData();
        return wo;
    },
    
    recordProduction: function(woId, production) {
        const wo = this.workOrders[woId];
        if (!wo) throw new Error('Work order not found');
        
        const { lineNumber, completedQty, scrapQty = 0, notes = '' } = production;
        
        const item = wo.items.find(i => i.lineNumber === lineNumber);
        if (!item) throw new Error('Line not found');
        
        item.completedQty += completedQty;
        item.scrapQty += scrapQty;
        wo.modified = Date.now();
        
        // Check if all items complete
        const allComplete = wo.items.every(i => i.completedQty >= i.quantity);
        if (allComplete && wo.status === 'in_progress') {
            this.updateWorkOrderStatus(woId, 'complete');
        }
        
        this._persistData();
        return item;
    },
    
    getOrder: function(orderId) {
        return this.orders[orderId] || null;
    },
    
    getWorkOrder: function(woId) {
        return this.workOrders[woId] || null;
    },
    
    searchOrders: function(query = '', filters = {}) {
        const { status = null, customerId = null, fromDate = null, toDate = null, priority = null } = filters;
        const queryLower = query.toLowerCase();
        
        return Object.values(this.orders).filter(o => {
            const textMatch = !query || 
                o.id.toLowerCase().includes(queryLower) ||
                o.items.some(i => i.partNumber.toLowerCase().includes(queryLower) || i.description.toLowerCase().includes(queryLower));
            
            const statusMatch = !status || o.status === status;
            const customerMatch = !customerId || o.customerId === customerId;
            const dateMatch = (!fromDate || o.created >= fromDate) && (!toDate || o.created <= toDate);
            const priorityMatch = !priority || o.priority === priority;
            
            return textMatch && statusMatch && customerMatch && dateMatch && priorityMatch;
        });
    },
    
    getOrdersByStatus: function() {
        const byStatus = {};
        for (const status of this.ORDER_STATUSES) byStatus[status] = [];
        
        for (const order of Object.values(this.orders)) {
            if (byStatus[order.status]) byStatus[order.status].push(order);
        }
        
        return byStatus;
    },
    
    getWorkOrderQueue: function(machineId = null) {
        let wos = Object.values(this.workOrders).filter(wo => 
            wo.status === 'released' || wo.status === 'in_progress'
        );
        
        if (machineId) wos = wos.filter(wo => wo.machineId === machineId);
        
        // Sort by priority (from parent order) and scheduled start
        return wos.sort((a, b) => {
            const orderA = this.orders[a.orderId];
            const orderB = this.orders[b.orderId];
            const priorityOrder = { urgent: 0, high: 1, normal: 2, low: 3 };
            
            const pA = priorityOrder[orderA?.priority] ?? 2;
            const pB = priorityOrder[orderB?.priority] ?? 2;
            
            if (pA !== pB) return pA - pB;
            return (a.scheduledStart || a.created) - (b.scheduledStart || b.created);
        });
    },
    
    getMetrics: function(dateRange = null) {
        const orders = Object.values(this.orders);
        const workOrders = Object.values(this.workOrders);
        
        const active = orders.filter(o => !['closed', 'cancelled'].includes(o.status));
        const completed = orders.filter(o => o.status === 'closed');
        
        const completedWOs = workOrders.filter(wo => wo.status === 'complete');
        const avgEfficiency = completedWOs.length > 0 ?
            completedWOs.reduce((a, wo) => a + (wo.totalEstimatedHours / Math.max(0.1, wo.actualHours)), 0) / completedWOs.length : 1;
        
        return {
            totalOrders: orders.length,
            activeOrders: active.length,
            completedOrders: completed.length,
            totalValue: active.reduce((a, o) => a + o.total, 0),
            totalWorkOrders: workOrders.length,
            activeWorkOrders: workOrders.filter(wo => ['released', 'in_progress'].includes(wo.status)).length,
            avgEfficiency: (avgEfficiency * 100).toFixed(1) + '%',
            onTimeRate: 'N/A' // Would need due date tracking
        };
    },
    
    _persistData: function() {
        try {
            localStorage.setItem('prism_orders', JSON.stringify({ orders: this.orders, workOrders: this.workOrders }));
        } catch (e) { /* Storage unavailable */ }
    },
    
    loadPersistedData: function() {
        try {
            const saved = localStorage.getItem('prism_orders');
            if (saved) {
                const data = JSON.parse(saved);
                this.orders = data.orders || {};
                this.workOrders = data.workOrders || {};
            }
        } catch (e) { /* Storage unavailable */ }
    },
    
    runSelfTests: function() {
        console.log('[ORDER_MANAGER] Running self-tests...');
        const results = { passed: 0, failed: 0, tests: [] };
        
        try {
            const o = this.createOrder({ 
                customerId: 'C1', 
                items: [{ partNumber: 'P1', quantity: 10, unitPrice: 50 }] 
            });
            if (o.id && o.total === 500) { results.passed++; results.tests.push({ name: 'Create Order', status: 'PASS' }); }
            else throw new Error('Invalid order');
            
            // Test status update
            this.updateOrderStatus(o.id, 'confirmed');
            if (o.status === 'confirmed') { results.passed++; results.tests.push({ name: 'Update Status', status: 'PASS' }); }
            else throw new Error('Status not updated');
            
            // Test work order
            const wo = this.createWorkOrder(o.id);
            if (wo.id && wo.orderId === o.id) { results.passed++; results.tests.push({ name: 'Create WO', status: 'PASS' }); }
            else throw new Error('Invalid WO');
            
            // Cleanup
            delete this.orders[o.id];
            delete this.workOrders[wo.id];
        } catch (e) { 
            results.failed++; 
            results.tests.push({ name: 'Order Tests', status: 'FAIL', error: e.message }); 
        }
        
        try {
            const m = this.getMetrics();
            if (typeof m.totalOrders === 'number') { results.passed++; results.tests.push({ name: 'Metrics', status: 'PASS' }); }
            else throw new Error('Invalid metrics');
        } catch (e) { results.failed++; results.tests.push({ name: 'Metrics', status: 'FAIL', error: e.message }); }
        
        console.log('[ORDER_MANAGER] Tests: ' + results.passed + '/' + (results.passed + results.failed) + ' passed');
        return results;
    }
};

if (typeof PRISM_GATEWAY !== 'undefined') {
    PRISM_GATEWAY.register('order.create', 'PRISM_ORDER_MANAGER.createOrder');
    PRISM_GATEWAY.register('order.get', 'PRISM_ORDER_MANAGER.getOrder');
    PRISM_GATEWAY.register('order.updateStatus', 'PRISM_ORDER_MANAGER.updateOrderStatus');
    PRISM_GATEWAY.register('order.search', 'PRISM_ORDER_MANAGER.searchOrders');
    PRISM_GATEWAY.register('order.byStatus', 'PRISM_ORDER_MANAGER.getOrdersByStatus');
    PRISM_GATEWAY.register('workorder.create', 'PRISM_ORDER_MANAGER.createWorkOrder');
    PRISM_GATEWAY.register('workorder.get', 'PRISM_ORDER_MANAGER.getWorkOrder');
    PRISM_GATEWAY.register('workorder.updateStatus', 'PRISM_ORDER_MANAGER.updateWorkOrderStatus');
    PRISM_GATEWAY.register('workorder.queue', 'PRISM_ORDER_MANAGER.getWorkOrderQueue');
    PRISM_GATEWAY.register('workorder.time', 'PRISM_ORDER_MANAGER.recordTimeEntry');
    PRISM_GATEWAY.register('workorder.production', 'PRISM_ORDER_MANAGER.recordProduction');
    PRISM_GATEWAY.register('shop.metrics', 'PRISM_ORDER_MANAGER.getMetrics');
}

console.log('[PRISM_ORDER_MANAGER] Loaded v1.0.0');

// ═══════════════════════════════════════════════════════════════════════════════
// PRODUCT 3: BUSINESS/SHOP/ERP SYSTEM - QUALITY MANAGER
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_QUALITY_MANAGER = {
    version: '1.0.0',
    authority: 'PRISM_QUALITY_MANAGER',
    
    // Quality records
    inspections: {},
    ncrs: {},           // Non-Conformance Reports
    cars: {},           // Corrective Action Reports
    spcData: {},        // SPC control data by characteristic
    
    // Inspection types
    INSPECTION_TYPES: ['first_article', 'in_process', 'final', 'receiving', 'periodic'],
    NCR_STATUSES: ['open', 'under_review', 'disposition', 'closed'],
    DISPOSITIONS: ['use_as_is', 'rework', 'repair', 'scrap', 'return_to_vendor'],
    
    createInspection: function(params) {
        const { workOrderId, type = 'in_process', partNumber, quantity, inspector, characteristics = [] } = params;
        
        const id = 'INS-' + Date.now().toString(36).toUpperCase();
        
        this.inspections[id] = {
            id,
            workOrderId,
            type,
            partNumber,
            quantity,
            inspector,
            status: 'pending',
            created: Date.now(),
            completed: null,
            characteristics: characteristics.map((c, idx) => ({
                id: idx + 1,
                name: c.name || 'Characteristic ' + (idx + 1),
                nominal: c.nominal,
                upperLimit: c.upperLimit,
                lowerLimit: c.lowerLimit,
                unit: c.unit || 'mm',
                measurements: [],
                result: null  // pass, fail, pending
            })),
            overallResult: 'pending',
            notes: '',
            attachments: []
        };
        
        this._persistData();
        return this.inspections[id];
    },
    
    recordMeasurement: function(inspectionId, characteristicId, values) {
        const inspection = this.inspections[inspectionId];
        if (!inspection) throw new Error('Inspection not found');
        
        const char = inspection.characteristics.find(c => c.id === characteristicId);
        if (!char) throw new Error('Characteristic not found');
        
        // values can be a single number or array
        const measurements = Array.isArray(values) ? values : [values];
        char.measurements.push(...measurements.map(v => ({ value: v, timestamp: Date.now() })));
        
        // Check against limits
        const allPass = char.measurements.every(m => 
            m.value >= char.lowerLimit && m.value <= char.upperLimit
        );
        char.result = allPass ? 'pass' : 'fail';
        
        // Add to SPC data
        const spcKey = `${inspection.partNumber}_${char.name}`;
        if (!this.spcData[spcKey]) {
            this.spcData[spcKey] = {
                partNumber: inspection.partNumber,
                characteristic: char.name,
                nominal: char.nominal,
                upperLimit: char.upperLimit,
                lowerLimit: char.lowerLimit,
                measurements: []
            };
        }
        this.spcData[spcKey].measurements.push(...measurements.map(v => ({
            value: v,
            timestamp: Date.now(),
            inspectionId
        })));
        
        // Update overall inspection result
        this._updateInspectionResult(inspection);
        
        this._persistData();
        return char;
    },
    
    completeInspection: function(inspectionId, notes = '') {
        const inspection = this.inspections[inspectionId];
        if (!inspection) throw new Error('Inspection not found');
        
        inspection.status = 'complete';
        inspection.completed = Date.now();
        inspection.notes = notes;
        
        // Verify all characteristics have results
        for (const char of inspection.characteristics) {
            if (char.result === null || char.result === 'pending') {
                char.result = char.measurements.length > 0 ? 'pass' : 'incomplete';
            }
        }
        
        this._updateInspectionResult(inspection);
        
        // Auto-create NCR if failed
        if (inspection.overallResult === 'fail') {
            this.createNCR({
                inspectionId,
                partNumber: inspection.partNumber,
                workOrderId: inspection.workOrderId,
                description: 'Failed inspection: ' + inspection.characteristics.filter(c => c.result === 'fail').map(c => c.name).join(', '),
                quantity: inspection.quantity
            });
        }
        
        this._persistData();
        return inspection;
    },
    
    createNCR: function(params) {
        const { inspectionId = null, workOrderId = null, partNumber, description, quantity, defectType = 'dimensional' } = params;
        
        const id = 'NCR-' + Date.now().toString(36).toUpperCase();
        
        this.ncrs[id] = {
            id,
            inspectionId,
            workOrderId,
            partNumber,
            description,
            quantity,
            defectType,
            status: 'open',
            disposition: null,
            dispositionNotes: '',
            rootCause: '',
            created: Date.now(),
            closed: null,
            cost: 0,
            carId: null,  // linked Corrective Action
            history: [{ status: 'open', timestamp: Date.now() }]
        };
        
        this._persistData();
        return this.ncrs[id];
    },
    
    updateNCRDisposition: function(ncrId, disposition, notes = '', cost = 0) {
        const ncr = this.ncrs[ncrId];
        if (!ncr) throw new Error('NCR not found');
        if (!this.DISPOSITIONS.includes(disposition)) throw new Error('Invalid disposition');
        
        ncr.status = 'disposition';
        ncr.disposition = disposition;
        ncr.dispositionNotes = notes;
        ncr.cost = cost;
        ncr.history.push({ status: 'disposition', disposition, timestamp: Date.now() });
        
        this._persistData();
        return ncr;
    },
    
    closeNCR: function(ncrId, rootCause = '') {
        const ncr = this.ncrs[ncrId];
        if (!ncr) throw new Error('NCR not found');
        
        ncr.status = 'closed';
        ncr.closed = Date.now();
        ncr.rootCause = rootCause;
        ncr.history.push({ status: 'closed', timestamp: Date.now() });
        
        this._persistData();
        return ncr;
    },
    
    createCAR: function(params) {
        const { ncrId = null, title, description, assignedTo, dueDate } = params;
        
        const id = 'CAR-' + Date.now().toString(36).toUpperCase();
        
        // Link to NCR if provided
        if (ncrId && this.ncrs[ncrId]) {
            this.ncrs[ncrId].carId = id;
        }
        
        this.cars[id] = {
            id,
            ncrId,
            title,
            description,
            assignedTo,
            dueDate,
            status: 'open',
            rootCauseAnalysis: '',
            correctiveActions: [],
            preventiveActions: [],
            verificationDate: null,
            verificationNotes: '',
            effectiveness: null,  // effective, ineffective, partial
            created: Date.now(),
            closed: null
        };
        
        this._persistData();
        return this.cars[id];
    },
    
    getSPCAnalysis: function(partNumber, characteristicName) {
        const spcKey = `${partNumber}_${characteristicName}`;
        const spc = this.spcData[spcKey];
        if (!spc || spc.measurements.length < 2) return null;
        
        const values = spc.measurements.map(m => m.value);
        const n = values.length;
        
        // Calculate statistics
        const mean = values.reduce((a, b) => a + b, 0) / n;
        const variance = values.reduce((a, v) => a + Math.pow(v - mean, 2), 0) / (n - 1);
        const stdDev = Math.sqrt(variance);
        
        // Control limits (3-sigma)
        const ucl = mean + 3 * stdDev;
        const lcl = mean - 3 * stdDev;
        
        // Cp and Cpk (process capability)
        const usl = spc.upperLimit;
        const lsl = spc.lowerLimit;
        const cp = (usl - lsl) / (6 * stdDev);
        const cpk = Math.min((usl - mean) / (3 * stdDev), (mean - lsl) / (3 * stdDev));
        
        // Out of control points
        const outOfControl = values.filter(v => v > ucl || v < lcl).length;
        const outOfSpec = values.filter(v => v > usl || v < lsl).length;
        
        return {
            partNumber,
            characteristic: characteristicName,
            sampleSize: n,
            mean: mean.toFixed(4),
            stdDev: stdDev.toFixed(4),
            controlLimits: { ucl: ucl.toFixed(4), lcl: lcl.toFixed(4) },
            specLimits: { usl, lsl },
            cp: cp.toFixed(3),
            cpk: cpk.toFixed(3),
            processCapable: cpk >= 1.33,
            outOfControl,
            outOfSpec,
            trend: this._calculateTrend(values)
        };
    },
    
    getQualityMetrics: function(dateRange = null) {
        const inspections = Object.values(this.inspections);
        const ncrs = Object.values(this.ncrs);
        
        const completed = inspections.filter(i => i.status === 'complete');
        const passed = completed.filter(i => i.overallResult === 'pass');
        const failed = completed.filter(i => i.overallResult === 'fail');
        
        const openNCRs = ncrs.filter(n => n.status !== 'closed');
        const scrapNCRs = ncrs.filter(n => n.disposition === 'scrap');
        const totalNCRCost = ncrs.reduce((a, n) => a + (n.cost || 0), 0);
        
        return {
            totalInspections: inspections.length,
            completedInspections: completed.length,
            passRate: completed.length > 0 ? (passed.length / completed.length * 100).toFixed(1) + '%' : 'N/A',
            failRate: completed.length > 0 ? (failed.length / completed.length * 100).toFixed(1) + '%' : 'N/A',
            totalNCRs: ncrs.length,
            openNCRs: openNCRs.length,
            scrapRate: ncrs.length > 0 ? (scrapNCRs.length / ncrs.length * 100).toFixed(1) + '%' : 'N/A',
            totalNCRCost,
            avgNCRCost: ncrs.length > 0 ? (totalNCRCost / ncrs.length).toFixed(2) : 0,
            openCARs: Object.values(this.cars).filter(c => c.status === 'open').length
        };
    },
    
    _updateInspectionResult: function(inspection) {
        const results = inspection.characteristics.map(c => c.result);
        if (results.some(r => r === 'fail')) {
            inspection.overallResult = 'fail';
        } else if (results.every(r => r === 'pass')) {
            inspection.overallResult = 'pass';
        } else {
            inspection.overallResult = 'pending';
        }
    },
    
    _calculateTrend: function(values) {
        if (values.length < 5) return 'insufficient_data';
        
        const recent = values.slice(-5);
        const older = values.slice(-10, -5);
        
        if (older.length < 5) return 'insufficient_data';
        
        const recentMean = recent.reduce((a, b) => a + b, 0) / recent.length;
        const olderMean = older.reduce((a, b) => a + b, 0) / older.length;
        
        const diff = (recentMean - olderMean) / olderMean;
        
        if (diff > 0.05) return 'increasing';
        if (diff < -0.05) return 'decreasing';
        return 'stable';
    },
    
    _persistData: function() {
        try {
            localStorage.setItem('prism_quality', JSON.stringify({
                inspections: this.inspections,
                ncrs: this.ncrs,
                cars: this.cars,
                spcData: this.spcData
            }));
        } catch (e) { /* Storage unavailable */ }
    },
    
    loadPersistedData: function() {
        try {
            const saved = localStorage.getItem('prism_quality');
            if (saved) {
                const data = JSON.parse(saved);
                this.inspections = data.inspections || {};
                this.ncrs = data.ncrs || {};
                this.cars = data.cars || {};
                this.spcData = data.spcData || {};
            }
        } catch (e) { /* Storage unavailable */ }
    },
    
    runSelfTests: function() {
        console.log('[QUALITY_MANAGER] Running self-tests...');
        const results = { passed: 0, failed: 0, tests: [] };
        
        try {
            const ins = this.createInspection({
                workOrderId: 'WO1', type: 'first_article', partNumber: 'P1', quantity: 1, inspector: 'QC1',
                characteristics: [{ name: 'Diameter', nominal: 25.0, upperLimit: 25.05, lowerLimit: 24.95, unit: 'mm' }]
            });
            if (ins.id && ins.characteristics.length === 1) { results.passed++; results.tests.push({ name: 'Create Inspection', status: 'PASS' }); }
            else throw new Error('Invalid');
            
            this.recordMeasurement(ins.id, 1, [25.02, 25.01, 25.03]);
            const char = ins.characteristics[0];
            if (char.result === 'pass' && char.measurements.length === 3) { results.passed++; results.tests.push({ name: 'Record Measurement', status: 'PASS' }); }
            else throw new Error('Invalid measurement');
            
            delete this.inspections[ins.id];
        } catch (e) { results.failed++; results.tests.push({ name: 'Inspection Tests', status: 'FAIL', error: e.message }); }
        
        try {
            const ncr = this.createNCR({ partNumber: 'P1', description: 'Test NCR', quantity: 5 });
            if (ncr.id && ncr.status === 'open') { results.passed++; results.tests.push({ name: 'Create NCR', status: 'PASS' }); }
            else throw new Error('Invalid NCR');
            delete this.ncrs[ncr.id];
        } catch (e) { results.failed++; results.tests.push({ name: 'Create NCR', status: 'FAIL', error: e.message }); }
        
        try {
            const m = this.getQualityMetrics();
            if (typeof m.totalInspections === 'number') { results.passed++; results.tests.push({ name: 'Quality Metrics', status: 'PASS' }); }
            else throw new Error('Invalid metrics');
        } catch (e) { results.failed++; results.tests.push({ name: 'Quality Metrics', status: 'FAIL', error: e.message }); }
        
        console.log('[QUALITY_MANAGER] Tests: ' + results.passed + '/' + (results.passed + results.failed) + ' passed');
        return results;
    }
};

if (typeof PRISM_GATEWAY !== 'undefined') {
    PRISM_GATEWAY.register('quality.inspection.create', 'PRISM_QUALITY_MANAGER.createInspection');
    PRISM_GATEWAY.register('quality.inspection.measure', 'PRISM_QUALITY_MANAGER.recordMeasurement');
    PRISM_GATEWAY.register('quality.inspection.complete', 'PRISM_QUALITY_MANAGER.completeInspection');
    PRISM_GATEWAY.register('quality.ncr.create', 'PRISM_QUALITY_MANAGER.createNCR');
    PRISM_GATEWAY.register('quality.ncr.disposition', 'PRISM_QUALITY_MANAGER.updateNCRDisposition');
    PRISM_GATEWAY.register('quality.ncr.close', 'PRISM_QUALITY_MANAGER.closeNCR');
    PRISM_GATEWAY.register('quality.car.create', 'PRISM_QUALITY_MANAGER.createCAR');
    PRISM_GATEWAY.register('quality.spc', 'PRISM_QUALITY_MANAGER.getSPCAnalysis');
    PRISM_GATEWAY.register('quality.metrics', 'PRISM_QUALITY_MANAGER.getQualityMetrics');
}

console.log('[PRISM_QUALITY_MANAGER] Loaded v1.0.0');

