// ═══════════════════════════════════════════════════════════════════════════════════════════
// SECTION 1: REINFORCEMENT LEARNING COMPLETE
// Source: Stanford CS 229, MIT 6.036
// ═══════════════════════════════════════════════════════════════════════════════════════════

const PRISM_RL_COMPLETE = {
    name: 'PRISM Reinforcement Learning Complete',
    version: '1.0.0',
    source: 'Stanford CS 229, MIT 6.036, MIT 6.867',
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // Q-LEARNING: Off-Policy TD Control
    // Q(s,a) ← Q(s,a) + α[r + γ max_a' Q(s',a') - Q(s,a)]
    // ─────────────────────────────────────────────────────────────────────────────────────────
    QLearning: {
        /**
         * Initialize Q-table for Q-Learning
         * @param {Array} states - List of state identifiers
         * @param {Array} actions - List of action identifiers
         * @param {number} initValue - Initial Q-value (default 0)
         * @returns {Map} Q-table as Map for efficient lookup
         */
        createAgent: function(states, actions, initValue = 0) {
            const Q = new Map();
            for (const s of states) {
                const actionValues = new Map();
                for (const a of actions) {
                    actionValues.set(a, initValue);
                }
                Q.set(s, actionValues);
            }
            return {
                Q,
                actions,
                episodeRewards: [],
                totalSteps: 0
            };
        },
        
        /**
         * Get Q-value for state-action pair
         */
        getQ: function(agent, state, action) {
            if (!agent.Q.has(state)) {
                agent.Q.set(state, new Map());
            }
            if (!agent.Q.get(state).has(action)) {
                agent.Q.get(state).set(action, 0);
            }
            return agent.Q.get(state).get(action);
        },
        
        /**
         * Set Q-value for state-action pair
         */
        setQ: function(agent, state, action, value) {
            if (!agent.Q.has(state)) {
                agent.Q.set(state, new Map());
            }
            agent.Q.get(state).set(action, value);
        },
        
        /**
         * Select action using epsilon-greedy policy
         */
        selectAction: function(agent, state, epsilon = 0.1) {
            if (Math.random() < epsilon) {
                // Explore: random action
                return agent.actions[Math.floor(Math.random() * agent.actions.length)];
            } else {
                // Exploit: best known action
                return this.getBestAction(agent, state);
            }
        },
        
        /**
         * Get best action for a state
         */
        getBestAction: function(agent, state) {
            let bestAction = agent.actions[0];
            let bestValue = this.getQ(agent, state, agent.actions[0]);
            
            for (const action of agent.actions) {
                const value = this.getQ(agent, state, action);
                if (value > bestValue) {
                    bestValue = value;
                    bestAction = action;
                }
            }
            return bestAction;
        },
        
        /**
         * Q-Learning update step (off-policy)
         * @param {Object} agent - Q-learning agent
         * @param {*} state - Current state
         * @param {*} action - Action taken
         * @param {number} reward - Reward received
         * @param {*} nextState - Next state
         * @param {boolean} done - Episode terminal flag
         * @param {number} alpha - Learning rate
         * @param {number} gamma - Discount factor
         */
        update: function(agent, state, action, reward, nextState, done, alpha = 0.1, gamma = 0.99) {
            const currentQ = this.getQ(agent, state, action);
            
            // Find max Q-value for next state (off-policy: use max, not actual next action)
            let maxNextQ = 0;
            if (!done) {
                maxNextQ = Math.max(...agent.actions.map(a => this.getQ(agent, nextState, a)));
            }
            
            // Q-learning update: Q(s,a) ← Q(s,a) + α[r + γ max_a' Q(s',a') - Q(s,a)]
            const target = reward + gamma * maxNextQ;
            const tdError = target - currentQ;
            const newQ = currentQ + alpha * tdError;
            
            this.setQ(agent, state, action, newQ);
            agent.totalSteps++;
            
            return { newQ, tdError, target };
        },
        
        /**
         * Run full Q-Learning episode
         */
        episode: function(agent, env, params = {}) {
            const { alpha = 0.1, gamma = 0.99, epsilon = 0.1, maxSteps = 1000 } = params;
            
            let state = env.reset();
            let totalReward = 0;
            let steps = 0;
            
            while (steps < maxSteps) {
                const action = this.selectAction(agent, state, epsilon);
                const { nextState, reward, done } = env.step(action);
                
                this.update(agent, state, action, reward, nextState, done, alpha, gamma);
                
                totalReward += reward;
                state = nextState;
                steps++;
                
                if (done) break;
            }
            
            agent.episodeRewards.push(totalReward);
            return { totalReward, steps };
        },
        
        /**
         * Get policy from Q-table
         */
        extractPolicy: function(agent) {
            const policy = {};
            for (const [state, _] of agent.Q) {
                policy[state] = this.getBestAction(agent, state);
            }
            return policy;
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // VALUE ITERATION: Dynamic Programming for Known MDPs
    // V(s) = max_a [R(s,a) + γ Σ P(s'|s,a)V(s')]
    // ─────────────────────────────────────────────────────────────────────────────────────────
    ValueIteration: {
        /**
         * Value Iteration algorithm for known MDP
         * @param {Object} mdp - {states, actions, transitions, rewards, gamma}
         * @param {number} epsilon - Convergence threshold
         * @param {number} maxIter - Maximum iterations
         * @returns {Object} {V, policy, iterations}
         */
        solve: function(mdp, epsilon = 1e-6, maxIter = 1000) {
            const { states, actions, transitions, rewards, gamma = 0.99 } = mdp;
            
            // Initialize value function
            const V = new Map();
            for (const s of states) {
                V.set(s, 0);
            }
            
            let iterations = 0;
            
            // Iterate until convergence
            for (let iter = 0; iter < maxIter; iter++) {
                let maxDelta = 0;
                iterations++;
                
                for (const s of states) {
                    const oldV = V.get(s);
                    
                    // V(s) = max_a [R(s,a) + γ Σ P(s'|s,a)V(s')]
                    let maxValue = -Infinity;
                    
                    for (const a of actions) {
                        // Get reward for (s,a)
                        let value = this._getReward(rewards, s, a);
                        
                        // Sum over all possible next states
                        for (const s_next of states) {
                            const prob = this._getTransitionProb(transitions, s, a, s_next);
                            value += gamma * prob * V.get(s_next);
                        }
                        
                        maxValue = Math.max(maxValue, value);
                    }
                    
                    V.set(s, maxValue === -Infinity ? 0 : maxValue);
                    maxDelta = Math.max(maxDelta, Math.abs(oldV - V.get(s)));
                }
                
                if (maxDelta < epsilon) {
                    console.log(`[ValueIteration] Converged in ${iter + 1} iterations (delta=${maxDelta.toExponential(2)})`);
                    break;
                }
            }
            
            // Extract optimal policy
            const policy = this.extractPolicy(mdp, V);
            
            return { V: Object.fromEntries(V), policy, iterations };
        },
        
        /**
         * Extract optimal policy from value function
         */
        extractPolicy: function(mdp, V) {
            const { states, actions, transitions, rewards, gamma = 0.99 } = mdp;
            const policy = {};
            
            for (const s of states) {
                let bestAction = null;
                let bestValue = -Infinity;
                
                for (const a of actions) {
                    let value = this._getReward(rewards, s, a);
                    
                    for (const s_next of states) {
                        const prob = this._getTransitionProb(transitions, s, a, s_next);
                        value += gamma * prob * V.get(s_next);
                    }
                    
                    if (value > bestValue) {
                        bestValue = value;
                        bestAction = a;
                    }
                }
                
                policy[s] = bestAction;
            }
            
            return policy;
        },
        
        _getReward: function(rewards, s, a) {
            if (typeof rewards === 'function') return rewards(s, a);
            if (rewards[s]?.[a] !== undefined) return rewards[s][a];
            if (rewards[s] !== undefined) return rewards[s];
            return 0;
        },
        
        _getTransitionProb: function(transitions, s, a, s_next) {
            if (typeof transitions === 'function') return transitions(s, a, s_next);
            return transitions[s]?.[a]?.[s_next] || 0;
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // POLICY GRADIENT: REINFORCE with Baseline
    // ∇J(θ) = E[∇log(π(a|s,θ)) * (G_t - b(s))]
    // ─────────────────────────────────────────────────────────────────────────────────────────
    PolicyGradient: {
        /**
         * Initialize policy network (softmax linear policy)
         */
        createAgent: function(inputDim, outputDim) {
            const he = (fanIn) => Math.sqrt(2 / fanIn);
            return {
                // Policy weights
                W: Array(inputDim).fill(0).map(() => 
                    Array(outputDim).fill(0).map(() => (Math.random() - 0.5) * 2 * he(inputDim))
                ),
                b: Array(outputDim).fill(0),
                // Baseline (value function approximation)
                V_w: Array(inputDim).fill(0).map(() => (Math.random() - 0.5) * 0.1),
                V_b: 0,
                // Statistics
                episodeRewards: []
            };
        },
        
        /**
         * Softmax probabilities
         */
        softmax: function(logits) {
            const maxLogit = Math.max(...logits);
            const expLogits = logits.map(l => Math.exp(l - maxLogit));
            const sumExp = expLogits.reduce((a, b) => a + b, 0);
            return expLogits.map(e => e / sumExp);
        },
        
        /**
         * Forward pass: state → action probabilities
         */
        forward: function(agent, state) {
            const logits = agent.b.map((b, j) => 
                b + state.reduce((sum, s_i, i) => sum + s_i * agent.W[i][j], 0)
            );
            return this.softmax(logits);
        },
        
        /**
         * Estimate baseline value V(s)
         */
        baseline: function(agent, state) {
            return agent.V_b + state.reduce((sum, s, i) => sum + s * agent.V_w[i], 0);
        },
        
        /**
         * Sample action from policy
         */
        sampleAction: function(probs) {
            const r = Math.random();
            let cumProb = 0;
            for (let i = 0; i < probs.length; i++) {
                cumProb += probs[i];
                if (r < cumProb) return i;
            }
            return probs.length - 1;
        },
        
        /**
         * REINFORCE update with baseline
         * @param {Object} agent - Policy gradient agent
         * @param {Array} trajectory - [{state, action, reward}, ...]
         * @param {Object} params - {alphaPolicy, alphaBaseline, gamma}
         */
        update: function(agent, trajectory, params = {}) {
            const { alphaPolicy = 0.01, alphaBaseline = 0.1, gamma = 0.99 } = params;
            
            const T = trajectory.length;
            if (T === 0) return agent;
            
            // Compute returns G_t
            const returns = new Array(T);
            returns[T - 1] = trajectory[T - 1].reward;
            for (let t = T - 2; t >= 0; t--) {
                returns[t] = trajectory[t].reward + gamma * returns[t + 1];
            }
            
            // Update policy and baseline
            for (let t = 0; t < T; t++) {
                const { state, action } = trajectory[t];
                const G_t = returns[t];
                const b_t = this.baseline(agent, state);
                const advantage = G_t - b_t;
                
                // Update baseline (value function)
                const baselineError = G_t - b_t;
                for (let i = 0; i < agent.V_w.length; i++) {
                    agent.V_w[i] += alphaBaseline * baselineError * state[i];
                }
                agent.V_b += alphaBaseline * baselineError;
                
                // Update policy: θ ← θ + α * advantage * ∇log(π(a|s,θ))
                const probs = this.forward(agent, state);
                for (let i = 0; i < agent.W.length; i++) {
                    for (let j = 0; j < agent.W[i].length; j++) {
                        const gradLog = state[i] * ((j === action ? 1 : 0) - probs[j]);
                        agent.W[i][j] += alphaPolicy * advantage * gradLog;
                    }
                }
                for (let j = 0; j < agent.b.length; j++) {
                    agent.b[j] += alphaPolicy * advantage * ((j === action ? 1 : 0) - probs[j]);
                }
            }
            
            return agent;
        },
        
        /**
         * Run episode with REINFORCE
         */
        episode: function(agent, env, params = {}) {
            const { alphaPolicy = 0.01, alphaBaseline = 0.1, gamma = 0.99, maxSteps = 1000 } = params;
            
            const trajectory = [];
            let state = env.reset();
            let totalReward = 0;
            
            for (let step = 0; step < maxSteps; step++) {
                const probs = this.forward(agent, state);
                const action = this.sampleAction(probs);
                const { nextState, reward, done } = env.step(action);
                
                trajectory.push({ state: [...state], action, reward });
                totalReward += reward;
                state = nextState;
                
                if (done) break;
            }
            
            this.update(agent, trajectory, { alphaPolicy, alphaBaseline, gamma });
            agent.episodeRewards.push(totalReward);
            
            return { totalReward, steps: trajectory.length };
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // ACTOR-CRITIC: Advantage Actor-Critic (A2C)
    // Actor: π(a|s,θ), Critic: V(s,w)
    // ─────────────────────────────────────────────────────────────────────────────────────────
    ActorCritic: {
        /**
         * Initialize actor-critic agent
         */
        createAgent: function(stateDim, actionDim) {
            const he = (fanIn) => Math.sqrt(2 / fanIn);
            return {
                // Actor (policy network)
                actor: {
                    W: Array(stateDim).fill(0).map(() => 
                        Array(actionDim).fill(0).map(() => (Math.random() - 0.5) * 2 * he(stateDim))
                    ),
                    b: Array(actionDim).fill(0)
                },
                // Critic (value network)
                critic: {
                    w: Array(stateDim).fill(0).map(() => (Math.random() - 0.5) * 0.1),
                    b: 0
                },
                // Statistics
                episodeRewards: [],
                tdErrors: []
            };
        },
        
        /**
         * Get action probabilities from actor
         */
        getActionProbs: function(agent, state) {
            const logits = agent.actor.b.map((b, j) => 
                b + state.reduce((sum, s_i, i) => sum + s_i * agent.actor.W[i][j], 0)
            );
            return PRISM_RL_COMPLETE.PolicyGradient.softmax(logits);
        },
        
        /**
         * Get state value from critic
         */
        getValue: function(agent, state) {
            return agent.critic.b + state.reduce((sum, s, i) => sum + s * agent.critic.w[i], 0);
        },
        
        /**
         * Select action stochastically
         */
        selectAction: function(agent, state) {
            const probs = this.getActionProbs(agent, state);
            return PRISM_RL_COMPLETE.PolicyGradient.sampleAction(probs);
        },
        
        /**
         * Actor-Critic update (single step)
         * @param {Object} agent - Actor-critic agent
         * @param {Array} state - Current state
         * @param {number} action - Action taken
         * @param {number} reward - Reward received
         * @param {Array} nextState - Next state
         * @param {boolean} done - Terminal flag
         * @param {Object} params - Learning parameters
         */
        update: function(agent, state, action, reward, nextState, done, params = {}) {
            const { alphaActor = 0.001, alphaCritic = 0.01, gamma = 0.99 } = params;
            
            // Compute TD error (advantage estimate)
            const V_s = this.getValue(agent, state);
            const V_next = done ? 0 : this.getValue(agent, nextState);
            const tdError = reward + gamma * V_next - V_s;
            
            // Update Critic: w ← w + α_c * δ * ∇V(s)
            for (let i = 0; i < agent.critic.w.length; i++) {
                agent.critic.w[i] += alphaCritic * tdError * state[i];
            }
            agent.critic.b += alphaCritic * tdError;
            
            // Update Actor: θ ← θ + α_a * δ * ∇log(π(a|s))
            const probs = this.getActionProbs(agent, state);
            for (let i = 0; i < agent.actor.W.length; i++) {
                for (let j = 0; j < agent.actor.W[i].length; j++) {
                    const gradLog = state[i] * ((j === action ? 1 : 0) - probs[j]);
                    agent.actor.W[i][j] += alphaActor * tdError * gradLog;
                }
            }
            for (let j = 0; j < agent.actor.b.length; j++) {
                agent.actor.b[j] += alphaActor * tdError * ((j === action ? 1 : 0) - probs[j]);
            }
            
            agent.tdErrors.push(tdError);
            
            return { tdError, V_s, V_next };
        },
        
        /**
         * Run episode with Actor-Critic
         */
        episode: function(agent, env, params = {}) {
            const { alphaActor = 0.001, alphaCritic = 0.01, gamma = 0.99, maxSteps = 1000 } = params;
            
            let state = env.reset();
            let totalReward = 0;
            let steps = 0;
            
            while (steps < maxSteps) {
                const action = this.selectAction(agent, state);
                const { nextState, reward, done } = env.step(action);
                
                this.update(agent, state, action, reward, nextState, done, 
                    { alphaActor, alphaCritic, gamma });
                
                totalReward += reward;
                state = nextState;
                steps++;
                
                if (done) break;
            }
            
            agent.episodeRewards.push(totalReward);
            return { totalReward, steps };
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // MONTE CARLO TREE SEARCH (MCTS)
    // ─────────────────────────────────────────────────────────────────────────────────────────
    MCTS: {
        /**
         * Create MCTS node
         */
        createNode: function(state, parent = null, action = null) {
            return {
                state,
                parent,
                action,
                children: new Map(),
                visits: 0,
                totalValue: 0,
                untriedActions: null
            };
        },
        
        /**
         * UCB1 selection formula
         */
        ucb1: function(node, child, explorationConstant = Math.sqrt(2)) {
            if (child.visits === 0) return Infinity;
            return (child.totalValue / child.visits) + 
                   explorationConstant * Math.sqrt(Math.log(node.visits) / child.visits);
        },
        
        /**
         * Select best child using UCB1
         */
        selectChild: function(node, explorationConstant = Math.sqrt(2)) {
            let bestChild = null;
            let bestValue = -Infinity;
            
            for (const [_, child] of node.children) {
                const value = this.ucb1(node, child, explorationConstant);
                if (value > bestValue) {
                    bestValue = value;
                    bestChild = child;
                }
            }
            
            return bestChild;
        },
        
        /**
         * Run MCTS search
         * @param {Object} env - Environment with clone(), getActions(), step(), isTerminal()
         * @param {*} rootState - Starting state
         * @param {number} iterations - Number of iterations
         * @param {number} explorationConstant - UCB1 exploration parameter
         */
        search: function(env, rootState, iterations = 1000, explorationConstant = Math.sqrt(2)) {
            const root = this.createNode(rootState);
            root.untriedActions = [...env.getActions(rootState)];
            
            for (let i = 0; i < iterations; i++) {
                let node = root;
                const envCopy = env.clone(rootState);
                
                // Selection: traverse to leaf
                while (node.untriedActions.length === 0 && node.children.size > 0) {
                    node = this.selectChild(node, explorationConstant);
                    envCopy.step(node.action);
                }
                
                // Expansion: add one child
                if (node.untriedActions.length > 0) {
                    const action = node.untriedActions.pop();
                    const { nextState } = envCopy.step(action);
                    const childNode = this.createNode(nextState, node, action);
                    childNode.untriedActions = [...env.getActions(nextState)];
                    node.children.set(action, childNode);
                    node = childNode;
                }
                
                // Simulation: random rollout
                let rolloutEnv = envCopy;
                while (!rolloutEnv.isTerminal()) {
                    const actions = rolloutEnv.getActions();
                    if (actions.length === 0) break;
                    const randomAction = actions[Math.floor(Math.random() * actions.length)];
                    rolloutEnv.step(randomAction);
                }
                const value = rolloutEnv.getReward();
                
                // Backpropagation
                while (node !== null) {
                    node.visits++;
                    node.totalValue += value;
                    node = node.parent;
                }
            }
            
            // Return best action (most visited)
            let bestAction = null;
            let bestVisits = -1;
            for (const [action, child] of root.children) {
                if (child.visits > bestVisits) {
                    bestVisits = child.visits;
                    bestAction = action;
                }
            }
            
            return {
                bestAction,
                rootVisits: root.visits,
                actionStats: Array.from(root.children.entries()).map(([action, child]) => ({
                    action,
                    visits: child.visits,
                    avgValue: child.totalValue / child.visits
                }))
            };
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // MANUFACTURING RL APPLICATIONS
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Manufacturing: {
        /**
         * Create RL agent for feed rate optimization
         * State: [current_force, target_force, current_feed, tool_wear]
         * Actions: [decrease_feed, maintain, increase_feed]
         */
        createFeedOptimizer: function() {
            // Discretize continuous state space
            const states = [];
            const forceRatios = [0.5, 0.7, 0.9, 1.0, 1.1, 1.3, 1.5];
            const feedRatios = [0.5, 0.75, 1.0, 1.25, 1.5];
            const wearLevels = ['low', 'medium', 'high'];
            
            for (const fr of forceRatios) {
                for (const fd of feedRatios) {
                    for (const w of wearLevels) {
                        states.push(`${fr}_${fd}_${w}`);
                    }
                }
            }
            
            const actions = ['decrease', 'maintain', 'increase'];
            
            return PRISM_RL_COMPLETE.QLearning.createAgent(states, actions);
        },
        
        /**
         * Discretize continuous state for RL
         */
        discretizeState: function(forceRatio, feedRatio, wearLevel) {
            const forceRatios = [0.5, 0.7, 0.9, 1.0, 1.1, 1.3, 1.5];
            const feedRatios = [0.5, 0.75, 1.0, 1.25, 1.5];
            
            const closestForce = forceRatios.reduce((a, b) => 
                Math.abs(b - forceRatio) < Math.abs(a - forceRatio) ? b : a);
            const closestFeed = feedRatios.reduce((a, b) => 
                Math.abs(b - feedRatio) < Math.abs(a - feedRatio) ? b : a);
            
            let wear = 'low';
            if (wearLevel > 0.6) wear = 'high';
            else if (wearLevel > 0.3) wear = 'medium';
            
            return `${closestForce}_${closestFeed}_${wear}`;
        },
        
        /**
         * Compute reward for feed optimization
         */
        computeReward: function(forceError, feedChange, toolWear, surfaceFinish) {
            // Reward function balancing multiple objectives
            let reward = 0;
            
            // Penalize force deviation from target
            reward -= Math.abs(forceError) * 10;
            
            // Small penalty for feed changes (stability)
            reward -= Math.abs(feedChange) * 0.5;
            
            // Bonus for good surface finish
            if (surfaceFinish < 1.6) reward += 5;
            else if (surfaceFinish < 3.2) reward += 2;
            
            // Penalty for high tool wear rate
            reward -= toolWear * 3;
            
            return reward;
        }
    }
};


// ═══════════════════════════════════════════════════════════════════════════════════════════
// SECTION 2: ADVANCED CLUSTERING ALGORITHMS
// Source: MIT 6.036, Stanford CS 229
// ═══════════════════════════════════════════════════════════════════════════════════════════

const PRISM_CLUSTERING_COMPLETE = {
    name: 'PRISM Clustering Complete',
    version: '1.0.0',
    source: 'MIT 6.036, Stanford CS 229',
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // K-MEDOIDS (PAM Algorithm)
    // More robust to outliers than K-Means
    // ─────────────────────────────────────────────────────────────────────────────────────────
    KMedoids: {
        /**
         * K-Medoids clustering using PAM (Partitioning Around Medoids)
         * @param {Array} data - Array of data points (each point is an array)
         * @param {number} k - Number of clusters
         * @param {Function} distanceFn - Distance function (default: Euclidean)
         * @param {number} maxIter - Maximum iterations
         * @returns {Object} {medoids, labels, cost}
         */
        cluster: function(data, k, distanceFn = null, maxIter = 100) {
            const n = data.length;
            if (k > n) throw new Error('k cannot exceed number of data points');
            
            distanceFn = distanceFn || this._euclideanDistance;
            
            // Precompute distance matrix
            const distMatrix = Array(n).fill(0).map(() => Array(n).fill(0));
            for (let i = 0; i < n; i++) {
                for (let j = i + 1; j < n; j++) {
                    const d = distanceFn(data[i], data[j]);
                    distMatrix[i][j] = d;
                    distMatrix[j][i] = d;
                }
            }
            
            // Initialize medoids randomly
            let medoids = this._randomSample(n, k);
            let labels = this._assignLabels(distMatrix, medoids);
            let cost = this._computeCost(distMatrix, medoids, labels);
            
            // PAM swap phase
            for (let iter = 0; iter < maxIter; iter++) {
                let improved = false;
                
                // Try swapping each medoid with each non-medoid
                for (let m = 0; m < k; m++) {
                    for (let i = 0; i < n; i++) {
                        if (medoids.includes(i)) continue;
                        
                        // Try swap
                        const newMedoids = [...medoids];
                        newMedoids[m] = i;
                        const newLabels = this._assignLabels(distMatrix, newMedoids);
                        const newCost = this._computeCost(distMatrix, newMedoids, newLabels);
                        
                        if (newCost < cost) {
                            medoids = newMedoids;
                            labels = newLabels;
                            cost = newCost;
                            improved = true;
                        }
                    }
                }
                
                if (!improved) {
                    console.log(`[K-Medoids] Converged after ${iter + 1} iterations`);
                    break;
                }
            }
            
            return {
                medoids: medoids.map(i => data[i]),
                medoidIndices: medoids,
                labels,
                cost,
                clusterCenters: medoids.map(i => data[i])
            };
        },
        
        _randomSample: function(n, k) {
            const indices = [];
            while (indices.length < k) {
                const i = Math.floor(Math.random() * n);
                if (!indices.includes(i)) indices.push(i);
            }
            return indices;
        },
        
        _assignLabels: function(distMatrix, medoids) {
            const n = distMatrix.length;
            const labels = Array(n);
            
            for (let i = 0; i < n; i++) {
                let minDist = Infinity;
                let label = 0;
                for (let m = 0; m < medoids.length; m++) {
                    const d = distMatrix[i][medoids[m]];
                    if (d < minDist) {
                        minDist = d;
                        label = m;
                    }
                }
                labels[i] = label;
            }
            
            return labels;
        },
        
        _computeCost: function(distMatrix, medoids, labels) {
            let cost = 0;
            for (let i = 0; i < labels.length; i++) {
                cost += distMatrix[i][medoids[labels[i]]];
            }
            return cost;
        },
        
        _euclideanDistance: function(a, b) {
            return Math.sqrt(a.reduce((sum, v, i) => sum + (v - b[i]) ** 2, 0));
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // MEAN SHIFT CLUSTERING
    // Non-parametric, finds modes of density
    // ─────────────────────────────────────────────────────────────────────────────────────────
    MeanShift: {
        /**
         * Mean Shift clustering
         * @param {Array} data - Array of data points
         * @param {number} bandwidth - Kernel bandwidth (auto-estimated if null)
         * @param {number} maxIter - Maximum iterations
         * @param {number} tolerance - Convergence tolerance
         * @returns {Object} {labels, clusterCenters, numClusters}
         */
        cluster: function(data, bandwidth = null, maxIter = 300, tolerance = 1e-4) {
            const n = data.length;
            const dim = data[0].length;
            
            // Auto-estimate bandwidth if not provided
            if (bandwidth === null) {
                bandwidth = this._estimateBandwidth(data);
            }
            
            // Initialize points at their data locations
            let points = data.map(p => [...p]);
            
            // Iterate mean shift for each point
            for (let iter = 0; iter < maxIter; iter++) {
                let maxShift = 0;
                
                for (let i = 0; i < n; i++) {
                    const newPoint = this._meanShiftPoint(points[i], data, bandwidth);
                    const shift = Math.sqrt(points[i].reduce((sum, v, d) => 
                        sum + (v - newPoint[d]) ** 2, 0));
                    maxShift = Math.max(maxShift, shift);
                    points[i] = newPoint;
                }
                
                if (maxShift < tolerance) {
                    console.log(`[MeanShift] Converged after ${iter + 1} iterations`);
                    break;
                }
            }
            
            // Merge nearby points into cluster centers
            const { centers, labels } = this._mergeModes(points, data, bandwidth / 2);
            
            return {
                labels,
                clusterCenters: centers,
                numClusters: centers.length,
                bandwidth
            };
        },
        
        /**
         * Mean shift for single point
         */
        _meanShiftPoint: function(point, data, bandwidth) {
            const dim = point.length;
            const numerator = Array(dim).fill(0);
            let denominator = 0;
            
            for (const x of data) {
                const dist = Math.sqrt(point.reduce((sum, v, i) => sum + (v - x[i]) ** 2, 0));
                const weight = this._gaussianKernel(dist / bandwidth);
                
                for (let d = 0; d < dim; d++) {
                    numerator[d] += weight * x[d];
                }
                denominator += weight;
            }
            
            return numerator.map(v => v / denominator);
        },
        
        /**
         * Gaussian kernel
         */
        _gaussianKernel: function(x) {
            return Math.exp(-0.5 * x * x);
        },
        
        /**
         * Estimate bandwidth using Scott's rule
         */
        _estimateBandwidth: function(data) {
            const n = data.length;
            const dim = data[0].length;
            
            // Compute standard deviation for each dimension
            const stds = [];
            for (let d = 0; d < dim; d++) {
                const values = data.map(p => p[d]);
                const mean = values.reduce((a, b) => a + b, 0) / n;
                const variance = values.reduce((sum, v) => sum + (v - mean) ** 2, 0) / n;
                stds.push(Math.sqrt(variance));
            }
            
            // Scott's rule
            const avgStd = stds.reduce((a, b) => a + b, 0) / dim;
            return avgStd * Math.pow(n, -1 / (dim + 4));
        },
        
        /**
         * Merge nearby modes into cluster centers
         */
        _mergeModes: function(modes, data, mergeDistance) {
            const centers = [];
            const labels = Array(data.length).fill(-1);
            
            // Find unique modes
            for (let i = 0; i < modes.length; i++) {
                let merged = false;
                for (let c = 0; c < centers.length; c++) {
                    const dist = Math.sqrt(modes[i].reduce((sum, v, d) => 
                        sum + (v - centers[c][d]) ** 2, 0));
                    if (dist < mergeDistance) {
                        labels[i] = c;
                        merged = true;
                        break;
                    }
                }
                if (!merged) {
                    labels[i] = centers.length;
                    centers.push(modes[i]);
                }
            }
            
            return { centers, labels };
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // SPECTRAL CLUSTERING
    // Graph-based clustering using eigenvectors
    // ─────────────────────────────────────────────────────────────────────────────────────────
    SpectralClustering: {
        /**
         * Spectral Clustering
         * @param {Array} data - Array of data points
         * @param {number} k - Number of clusters
         * @param {number} sigma - RBF kernel bandwidth
         * @returns {Object} {labels, eigenvalues}
         */
        cluster: function(data, k, sigma = null) {
            const n = data.length;
            
            // Auto-estimate sigma if not provided
            if (sigma === null) {
                sigma = this._estimateSigma(data);
            }
            
            // Build affinity matrix (RBF kernel)
            const W = this._buildAffinityMatrix(data, sigma);
            
            // Compute degree matrix
            const D = Array(n).fill(0).map((_, i) => 
                W[i].reduce((sum, w) => sum + w, 0)
            );
            
            // Compute normalized Laplacian: L = I - D^(-1/2) W D^(-1/2)
            const L = this._normalizedLaplacian(W, D);
            
            // Find k smallest eigenvectors (using power iteration for simplicity)
            const eigenvectors = this._findSmallestEigenvectors(L, k);
            
            // Normalize rows
            for (let i = 0; i < n; i++) {
                const norm = Math.sqrt(eigenvectors[i].reduce((sum, v) => sum + v * v, 0));
                if (norm > 1e-10) {
                    for (let j = 0; j < k; j++) {
                        eigenvectors[i][j] /= norm;
                    }
                }
            }
            
            // K-means on eigenvector representation
            const labels = this._kmeansSimple(eigenvectors, k);
            
            return {
                labels,
                numClusters: k,
                sigma
            };
        },
        
        _buildAffinityMatrix: function(data, sigma) {
            const n = data.length;
            const W = Array(n).fill(0).map(() => Array(n).fill(0));
            
            for (let i = 0; i < n; i++) {
                for (let j = i + 1; j < n; j++) {
                    const dist = Math.sqrt(data[i].reduce((sum, v, d) => 
                        sum + (v - data[j][d]) ** 2, 0));
                    const w = Math.exp(-dist * dist / (2 * sigma * sigma));
                    W[i][j] = w;
                    W[j][i] = w;
                }
            }
            
            return W;
        },
        
        _normalizedLaplacian: function(W, D) {
            const n = W.length;
            const L = Array(n).fill(0).map(() => Array(n).fill(0));
            
            for (let i = 0; i < n; i++) {
                for (let j = 0; j < n; j++) {
                    if (i === j) {
                        L[i][j] = 1;
                    } else if (D[i] > 0 && D[j] > 0) {
                        L[i][j] = -W[i][j] / Math.sqrt(D[i] * D[j]);
                    }
                }
            }
            
            return L;
        },
        
        _estimateSigma: function(data) {
            // Use median of pairwise distances
            const distances = [];
            for (let i = 0; i < Math.min(data.length, 100); i++) {
                for (let j = i + 1; j < Math.min(data.length, 100); j++) {
                    const dist = Math.sqrt(data[i].reduce((sum, v, d) => 
                        sum + (v - data[j][d]) ** 2, 0));
                    distances.push(dist);
                }
            }
            distances.sort((a, b) => a - b);
            return distances[Math.floor(distances.length / 2)];
        },
        
        _findSmallestEigenvectors: function(L, k) {
            const n = L.length;
            const eigenvectors = Array(n).fill(0).map(() => Array(k).fill(0));
            
            // Simplified: use random initialization and power iteration
            // In production, use proper eigendecomposition library
            for (let e = 0; e < k; e++) {
                // Initialize random vector
                let v = Array(n).fill(0).map(() => Math.random() - 0.5);
                
                // Power iteration on (I - L) to find eigenvector of smallest eigenvalue
                // This is a simplification - real implementation would use Lanczos
                for (let iter = 0; iter < 50; iter++) {
                    // Multiply by (I - L)
                    const newV = Array(n).fill(0);
                    for (let i = 0; i < n; i++) {
                        newV[i] = v[i];
                        for (let j = 0; j < n; j++) {
                            newV[i] -= L[i][j] * v[j];
                        }
                    }
                    
                    // Orthogonalize against previous eigenvectors
                    for (let prev = 0; prev < e; prev++) {
                        const dot = eigenvectors.reduce((sum, row, i) => 
                            sum + row[prev] * newV[i], 0);
                        for (let i = 0; i < n; i++) {
                            newV[i] -= dot * eigenvectors[i][prev];
                        }
                    }
                    
                    // Normalize
                    const norm = Math.sqrt(newV.reduce((sum, val) => sum + val * val, 0));
                    v = newV.map(val => val / norm);
                }
                
                for (let i = 0; i < n; i++) {
                    eigenvectors[i][e] = v[i];
                }
            }
            
            return eigenvectors;
        },
        
        _kmeansSimple: function(data, k, maxIter = 50) {
            const n = data.length;
            const dim = data[0].length;
            
            // Initialize centroids
            let centroids = data.slice(0, k).map(p => [...p]);
            let labels = Array(n).fill(0);
            
            for (let iter = 0; iter < maxIter; iter++) {
                // Assign labels
                for (let i = 0; i < n; i++) {
                    let minDist = Infinity;
                    for (let c = 0; c < k; c++) {
                        const dist = data[i].reduce((sum, v, d) => 
                            sum + (v - centroids[c][d]) ** 2, 0);
                        if (dist < minDist) {
                            minDist = dist;
                            labels[i] = c;
                        }
                    }
                }
                
                // Update centroids
                const newCentroids = Array(k).fill(0).map(() => Array(dim).fill(0));
                const counts = Array(k).fill(0);
                
                for (let i = 0; i < n; i++) {
                    const c = labels[i];
                    counts[c]++;
                    for (let d = 0; d < dim; d++) {
                        newCentroids[c][d] += data[i][d];
                    }
                }
                
                for (let c = 0; c < k; c++) {
                    if (counts[c] > 0) {
                        for (let d = 0; d < dim; d++) {
                            newCentroids[c][d] /= counts[c];
                        }
                    }
                }
                
                centroids = newCentroids;
            }
            
            return labels;
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // HIERARCHICAL CLUSTERING
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Hierarchical: {
        /**
         * Agglomerative hierarchical clustering
         * @param {Array} data - Array of data points
         * @param {number} k - Number of clusters (or null to return full dendrogram)
         * @param {string} linkage - 'single', 'complete', 'average'
         * @returns {Object} {labels, dendrogram}
         */
        cluster: function(data, k = null, linkage = 'average') {
            const n = data.length;
            
            // Initialize: each point is its own cluster
            let clusters = data.map((_, i) => [i]);
            const dendrogram = [];
            
            // Precompute distance matrix
            const distMatrix = Array(n).fill(0).map(() => Array(n).fill(0));
            for (let i = 0; i < n; i++) {
                for (let j = i + 1; j < n; j++) {
                    const d = Math.sqrt(data[i].reduce((sum, v, idx) => 
                        sum + (v - data[j][idx]) ** 2, 0));
                    distMatrix[i][j] = d;
                    distMatrix[j][i] = d;
                }
            }
            
            // Agglomerate
            while (clusters.length > 1) {
                // Find closest pair of clusters
                let minDist = Infinity;
                let merge_i = 0, merge_j = 1;
                
                for (let i = 0; i < clusters.length; i++) {
                    for (let j = i + 1; j < clusters.length; j++) {
                        const d = this._clusterDistance(clusters[i], clusters[j], distMatrix, linkage);
                        if (d < minDist) {
                            minDist = d;
                            merge_i = i;
                            merge_j = j;
                        }
                    }
                }
                
                // Merge clusters
                dendrogram.push({
                    merged: [clusters[merge_i], clusters[merge_j]],
                    distance: minDist,
                    newCluster: [...clusters[merge_i], ...clusters[merge_j]]
                });
                
                clusters[merge_i] = [...clusters[merge_i], ...clusters[merge_j]];
                clusters.splice(merge_j, 1);
                
                // Stop if we've reached desired number of clusters
                if (k !== null && clusters.length === k) break;
            }
            
            // Assign labels
            const labels = Array(n).fill(0);
            for (let c = 0; c < clusters.length; c++) {
                for (const i of clusters[c]) {
                    labels[i] = c;
                }
            }
            
            return { labels, dendrogram, numClusters: clusters.length };
        },
        
        _clusterDistance: function(c1, c2, distMatrix, linkage) {
            const distances = [];
            for (const i of c1) {
                for (const j of c2) {
                    distances.push(distMatrix[i][j]);
                }
            }
            
            switch (linkage) {
                case 'single':
                    return Math.min(...distances);
                case 'complete':
                    return Math.max(...distances);
                case 'average':
                default:
                    return distances.reduce((a, b) => a + b, 0) / distances.length;
            }
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // MANUFACTURING CLUSTERING APPLICATIONS
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Manufacturing: {
        /**
         * Cluster machining operations by similarity
         */
        clusterOperations: function(operations, k = 5) {
            // Extract features: [depth, width, length, material_hardness, tool_diameter]
            const features = operations.map(op => [
                op.depth || 0,
                op.width || 0,
                op.length || 0,
                op.materialHardness || 30,
                op.toolDiameter || 10
            ]);
            
            // Normalize features
            const normalized = this._normalizeFeatures(features);
            
            // Use K-Medoids for robustness
            return PRISM_CLUSTERING_COMPLETE.KMedoids.cluster(normalized, k);
        },
        
        /**
         * Cluster parts by geometric similarity
         */
        clusterParts: function(parts, k = 10) {
            // Extract features: [volume, surface_area, hole_count, pocket_count, complexity]
            const features = parts.map(part => [
                Math.log(part.volume + 1),
                Math.log(part.surfaceArea + 1),
                part.holeCount || 0,
                part.pocketCount || 0,
                part.complexity || 1
            ]);
            
            const normalized = this._normalizeFeatures(features);
            
            return PRISM_CLUSTERING_COMPLETE.SpectralClustering.cluster(normalized, k);
        },
        
        _normalizeFeatures: function(features) {
            const n = features.length;
            const dim = features[0].length;
            
            // Compute mean and std
            const means = Array(dim).fill(0);
            const stds = Array(dim).fill(0);
            
            for (let d = 0; d < dim; d++) {
                for (let i = 0; i < n; i++) {
                    means[d] += features[i][d];
                }
                means[d] /= n;
                
                for (let i = 0; i < n; i++) {
                    stds[d] += (features[i][d] - means[d]) ** 2;
                }
                stds[d] = Math.sqrt(stds[d] / n) || 1;
            }
            
            // Normalize
            return features.map(f => f.map((v, d) => (v - means[d]) / stds[d]));
        }
    }
};


// ═══════════════════════════════════════════════════════════════════════════════════════════
// SECTION 3: MODEL COMPRESSION
// Source: MIT 6.867, Stanford CS 229
// ═══════════════════════════════════════════════════════════════════════════════════════════

const PRISM_MODEL_COMPRESSION = {
    name: 'PRISM Model Compression',
    version: '1.0.0',
    source: 'MIT 6.867, Stanford Deep Learning',
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // WEIGHT QUANTIZATION
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Quantization: {
        /**
         * Quantize weights to n-bit integers
         * @param {Array} weights - Weight matrix (2D array)
         * @param {number} bits - Number of bits (default 8)
         * @returns {Object} {quantized, scale, zeroPoint, original}
         */
        quantizeWeights: function(weights, bits = 8) {
            const numLevels = Math.pow(2, bits);
            
            // Find min and max
            let min = Infinity, max = -Infinity;
            for (const row of weights) {
                for (const w of row) {
                    min = Math.min(min, w);
                    max = Math.max(max, w);
                }
            }
            
            // Compute scale and zero point
            const scale = (max - min) / (numLevels - 1);
            const zeroPoint = Math.round(-min / scale);
            
            // Quantize
            const quantized = weights.map(row => 
                row.map(w => Math.round(w / scale + zeroPoint))
            );
            
            return {
                quantized,
                scale,
                zeroPoint,
                bits,
                original: weights,
                compressionRatio: 32 / bits
            };
        },
        
        /**
         * Dequantize weights
         */
        dequantizeWeights: function(quantized, scale, zeroPoint) {
            return quantized.map(row => 
                row.map(q => (q - zeroPoint) * scale)
            );
        },
        
        /**
         * Compute quantization error
         */
        quantizationError: function(original, dequantized) {
            let mse = 0;
            let count = 0;
            
            for (let i = 0; i < original.length; i++) {
                for (let j = 0; j < original[i].length; j++) {
                    mse += Math.pow(original[i][j] - dequantized[i][j], 2);
                    count++;
                }
            }
            
            return {
                mse: mse / count,
                rmse: Math.sqrt(mse / count)
            };
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // WEIGHT PRUNING
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Pruning: {
        /**
         * Magnitude-based pruning
         * @param {Array} weights - Weight matrix
         * @param {number} sparsity - Target sparsity (0-1)
         * @returns {Object} {pruned, mask, actualSparsity}
         */
        magnitudePrune: function(weights, sparsity = 0.5) {
            // Flatten and sort by magnitude
            const flatWeights = [];
            for (let i = 0; i < weights.length; i++) {
                for (let j = 0; j < weights[i].length; j++) {
                    flatWeights.push({ value: weights[i][j], i, j });
                }
            }
            
            flatWeights.sort((a, b) => Math.abs(a.value) - Math.abs(b.value));
            
            // Determine threshold
            const numToPrune = Math.floor(flatWeights.length * sparsity);
            const threshold = numToPrune > 0 ? 
                Math.abs(flatWeights[numToPrune - 1].value) : 0;
            
            // Create mask and pruned weights
            const mask = weights.map(row => row.map(() => 1));
            const pruned = weights.map(row => [...row]);
            
            for (let k = 0; k < numToPrune; k++) {
                const { i, j } = flatWeights[k];
                mask[i][j] = 0;
                pruned[i][j] = 0;
            }
            
            // Calculate actual sparsity
            const actualSparsity = numToPrune / flatWeights.length;
            
            return { pruned, mask, threshold, actualSparsity };
        },
        
        /**
         * Structured pruning (prune entire rows/columns)
         * @param {Array} weights - Weight matrix
         * @param {number} ratio - Ratio of rows/cols to prune
         * @param {string} mode - 'row' or 'column'
         */
        structuredPrune: function(weights, ratio = 0.25, mode = 'row') {
            const numRows = weights.length;
            const numCols = weights[0].length;
            
            if (mode === 'row') {
                // Compute L2 norm of each row
                const rowNorms = weights.map(row => 
                    Math.sqrt(row.reduce((sum, w) => sum + w * w, 0))
                );
                
                // Sort row indices by norm
                const indices = rowNorms.map((_, i) => i).sort((a, b) => 
                    rowNorms[a] - rowNorms[b]
                );
                
                // Prune lowest-norm rows
                const numToPrune = Math.floor(numRows * ratio);
                const prunedIndices = new Set(indices.slice(0, numToPrune));
                
                const pruned = weights.map((row, i) => 
                    prunedIndices.has(i) ? row.map(() => 0) : [...row]
                );
                
                return { pruned, prunedIndices: [...prunedIndices], mode };
            } else {
                // Column pruning
                const colNorms = Array(numCols).fill(0);
                for (let j = 0; j < numCols; j++) {
                    for (let i = 0; i < numRows; i++) {
                        colNorms[j] += weights[i][j] * weights[i][j];
                    }
                    colNorms[j] = Math.sqrt(colNorms[j]);
                }
                
                const indices = colNorms.map((_, j) => j).sort((a, b) => 
                    colNorms[a] - colNorms[b]
                );
                
                const numToPrune = Math.floor(numCols * ratio);
                const prunedIndices = new Set(indices.slice(0, numToPrune));
                
                const pruned = weights.map(row => 
                    row.map((w, j) => prunedIndices.has(j) ? 0 : w)
                );
                
                return { pruned, prunedIndices: [...prunedIndices], mode };
            }
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // KNOWLEDGE DISTILLATION
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Distillation: {
        /**
         * Generate soft targets from teacher model
         * @param {Array} logits - Raw output logits from teacher
         * @param {number} temperature - Softening temperature (default 3)
         * @returns {Array} Soft probability distribution
         */
        softmax: function(logits, temperature = 1) {
            const maxLogit = Math.max(...logits);
            const expLogits = logits.map(l => Math.exp((l - maxLogit) / temperature));
            const sumExp = expLogits.reduce((a, b) => a + b, 0);
            return expLogits.map(e => e / sumExp);
        },
        
        /**
         * Compute distillation loss
         * @param {Array} studentLogits - Student model raw outputs
         * @param {Array} teacherLogits - Teacher model raw outputs
         * @param {Array} hardLabels - Ground truth one-hot labels (optional)
         * @param {number} temperature - Distillation temperature
         * @param {number} alpha - Weight of soft vs hard loss
         */
        distillationLoss: function(studentLogits, teacherLogits, hardLabels = null, temperature = 3, alpha = 0.7) {
            // Soft targets from teacher
            const teacherSoft = this.softmax(teacherLogits, temperature);
            const studentSoft = this.softmax(studentLogits, temperature);
            
            // KL divergence for soft targets
            let softLoss = 0;
            for (let i = 0; i < teacherSoft.length; i++) {
                if (teacherSoft[i] > 1e-10) {
                    softLoss -= teacherSoft[i] * Math.log(studentSoft[i] / teacherSoft[i]);
                }
            }
            
            // Scale by T^2 (to balance gradients)
            softLoss *= temperature * temperature;
            
            if (hardLabels === null) {
                return softLoss;
            }
            
            // Cross-entropy for hard labels
            const studentHard = this.softmax(studentLogits, 1);
            let hardLoss = 0;
            for (let i = 0; i < hardLabels.length; i++) {
                if (hardLabels[i] > 0) {
                    hardLoss -= hardLabels[i] * Math.log(studentHard[i] + 1e-10);
                }
            }
            
            // Combined loss
            return alpha * softLoss + (1 - alpha) * hardLoss;
        },
        
        /**
         * Train student model with distillation
         * @param {Object} student - Student model with forward(), backward()
         * @param {Object} teacher - Teacher model with forward()
         * @param {Array} data - Training data [{input, label}]
         * @param {Object} params - Training parameters
         */
        trainWithDistillation: function(student, teacher, data, params = {}) {
            const { 
                epochs = 10, 
                learningRate = 0.01, 
                temperature = 3, 
                alpha = 0.7,
                batchSize = 32
            } = params;
            
            const losses = [];
            
            for (let epoch = 0; epoch < epochs; epoch++) {
                let epochLoss = 0;
                
                for (let i = 0; i < data.length; i += batchSize) {
                    const batch = data.slice(i, i + batchSize);
                    let batchLoss = 0;
                    
                    for (const { input, label } of batch) {
                        // Get teacher predictions (no gradients needed)
                        const teacherLogits = teacher.forward(input);
                        
                        // Get student predictions
                        const studentLogits = student.forward(input);
                        
                        // Compute loss
                        const loss = this.distillationLoss(
                            studentLogits, 
                            teacherLogits, 
                            label, 
                            temperature, 
                            alpha
                        );
                        
                        batchLoss += loss;
                        
                        // Backprop on student (simplified)
                        if (typeof student.backward === 'function') {
                            const teacherSoft = this.softmax(teacherLogits, temperature);
                            student.backward(teacherSoft, learningRate);
                        }
                    }
                    
                    epochLoss += batchLoss / batch.length;
                }
                
                losses.push(epochLoss / Math.ceil(data.length / batchSize));
                console.log(`[Distillation] Epoch ${epoch + 1}: Loss = ${losses[losses.length - 1].toFixed(4)}`);
            }
            
            return { losses, student };
        }
    }
};


// ═══════════════════════════════════════════════════════════════════════════════════════════
// SECTION 4: EXPLAINABLE AI COMPLETE
// Source: MIT 6.867, LIME/SHAP papers
// ═══════════════════════════════════════════════════════════════════════════════════════════

const PRISM_XAI_COMPLETE = {
    name: 'PRISM Explainable AI Complete',
    version: '1.0.0',
    source: 'MIT 6.867, Ribeiro et al. (LIME), Lundberg & Lee (SHAP)',
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // LIME: Local Interpretable Model-agnostic Explanations
    // ─────────────────────────────────────────────────────────────────────────────────────────
    LIME: {
        /**
         * Explain a prediction using LIME
         * @param {Function} predictFn - Model prediction function
         * @param {Array} instance - Input to explain
         * @param {number} numSamples - Number of perturbed samples
         * @param {number} numFeatures - Top features to return
         * @returns {Object} {explanation, weights, intercept}
         */
        explain: function(predictFn, instance, numSamples = 1000, numFeatures = 10) {
            const dim = instance.length;
            
            // Generate perturbed samples
            const samples = [];
            const labels = [];
            const weights = [];
            
            // Original instance prediction
            const originalPred = predictFn(instance);
            
            for (let i = 0; i < numSamples; i++) {
                // Perturb instance
                const perturbed = instance.map((v, j) => {
                    if (Math.random() < 0.5) {
                        return v + (Math.random() - 0.5) * Math.abs(v) * 0.5;
                    }
                    return v;
                });
                
                samples.push(perturbed);
                labels.push(predictFn(perturbed));
                
                // Weight by distance to original
                const distance = Math.sqrt(instance.reduce((sum, v, j) => 
                    sum + (v - perturbed[j]) ** 2, 0));
                weights.push(Math.exp(-distance * distance / 2));
            }
            
            // Fit weighted linear model
            const coefficients = this._weightedLinearRegression(samples, labels, weights);
            
            // Return top features
            const explanation = coefficients
                .map((c, i) => ({ feature: i, importance: c, absImportance: Math.abs(c) }))
                .sort((a, b) => b.absImportance - a.absImportance)
                .slice(0, numFeatures);
            
            return {
                explanation,
                allCoefficients: coefficients,
                originalPrediction: originalPred,
                numSamples
            };
        },
        
        _weightedLinearRegression: function(X, y, weights) {
            const n = X.length;
            const d = X[0].length;
            
            // Add bias term
            const Xb = X.map(row => [1, ...row]);
            const db = d + 1;
            
            // XtWX and XtWy
            const XtWX = Array(db).fill(0).map(() => Array(db).fill(0));
            const XtWy = Array(db).fill(0);
            
            for (let i = 0; i < n; i++) {
                const w = weights[i];
                for (let j = 0; j < db; j++) {
                    XtWy[j] += w * Xb[i][j] * y[i];
                    for (let k = 0; k < db; k++) {
                        XtWX[j][k] += w * Xb[i][j] * Xb[i][k];
                    }
                }
            }
            
            // Regularization
            for (let j = 0; j < db; j++) {
                XtWX[j][j] += 0.001;
            }
            
            // Solve
            const coeffs = this._solveLinear(XtWX, XtWy);
            return coeffs.slice(1); // Remove bias
        },
        
        _solveLinear: function(A, b) {
            const n = A.length;
            const aug = A.map((row, i) => [...row, b[i]]);
            
            // Gaussian elimination
            for (let col = 0; col < n; col++) {
                let maxRow = col;
                for (let row = col + 1; row < n; row++) {
                    if (Math.abs(aug[row][col]) > Math.abs(aug[maxRow][col])) {
                        maxRow = row;
                    }
                }
                [aug[col], aug[maxRow]] = [aug[maxRow], aug[col]];
                
                if (Math.abs(aug[col][col]) < 1e-10) continue;
                
                for (let row = col + 1; row < n; row++) {
                    const factor = aug[row][col] / aug[col][col];
                    for (let j = col; j <= n; j++) {
                        aug[row][j] -= factor * aug[col][j];
                    }
                }
            }
            
            // Back substitution
            const x = Array(n).fill(0);
            for (let i = n - 1; i >= 0; i--) {
                x[i] = aug[i][n];
                for (let j = i + 1; j < n; j++) {
                    x[i] -= aug[i][j] * x[j];
                }
                x[i] /= aug[i][i] || 1;
            }
            
            return x;
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // SHAP: Shapley Additive Explanations (Kernel SHAP approximation)
    // ─────────────────────────────────────────────────────────────────────────────────────────
    SHAP: {
        /**
         * Compute SHAP values using Kernel SHAP
         * @param {Function} predictFn - Model prediction function
         * @param {Array} instance - Input to explain
         * @param {Array} background - Background dataset for expected value
         * @param {number} numSamples - Number of coalition samples
         * @returns {Object} {shapValues, expectedValue}
         */
        explain: function(predictFn, instance, background, numSamples = 2000) {
            const dim = instance.length;
            
            // Compute expected value (average prediction on background)
            const expectedValue = background.reduce((sum, bg) => 
                sum + predictFn(bg), 0) / background.length;
            
            // Sample coalitions and compute SHAP kernel weights
            const coalitions = [];
            const predictions = [];
            const kernelWeights = [];
            
            // Always include empty and full coalitions
            coalitions.push(Array(dim).fill(0));
            coalitions.push(Array(dim).fill(1));
            
            // Sample random coalitions
            for (let i = 0; i < numSamples - 2; i++) {
                const coalition = Array(dim).fill(0).map(() => Math.random() < 0.5 ? 1 : 0);
                coalitions.push(coalition);
            }
            
            // Evaluate each coalition
            for (const coalition of coalitions) {
                const numOnes = coalition.reduce((a, b) => a + b, 0);
                
                // Kernel weight (SHAP kernel)
                const weight = this._shapleyKernelWeight(dim, numOnes);
                kernelWeights.push(weight);
                
                // Create masked instance (average over background for excluded features)
                let pred = 0;
                const numBg = Math.min(10, background.length); // Limit for efficiency
                
                for (let b = 0; b < numBg; b++) {
                    const bg = background[Math.floor(Math.random() * background.length)];
                    const masked = instance.map((v, j) => coalition[j] ? v : bg[j]);
                    pred += predictFn(masked);
                }
                pred /= numBg;
                
                predictions.push(pred);
            }
            
            // Fit weighted linear model to get SHAP values
            const shapValues = this._fitShapValues(coalitions, predictions, kernelWeights, dim);
            
            return {
                shapValues,
                expectedValue,
                instancePrediction: predictFn(instance),
                // Verify: sum of SHAP values + expected ≈ prediction
                sumCheck: shapValues.reduce((a, b) => a + b, 0) + expectedValue
            };
        },
        
        _shapleyKernelWeight: function(M, s) {
            // Shapley kernel: (M-1) / (C(M,s) * s * (M-s))
            if (s === 0 || s === M) return 1e6; // Large weight for empty/full
            
            const binomial = this._binomial(M, s);
            return (M - 1) / (binomial * s * (M - s));
        },
        
        _binomial: function(n, k) {
            if (k < 0 || k > n) return 0;
            if (k === 0 || k === n) return 1;
            
            let result = 1;
            for (let i = 0; i < k; i++) {
                result = result * (n - i) / (i + 1);
            }
            return result;
        },
        
        _fitShapValues: function(coalitions, predictions, weights, dim) {
            // Weighted least squares: find φ such that Σ φ_i * z_i ≈ f(x|z) - E[f]
            // Using coalition z as feature, predictions as targets
            
            const n = coalitions.length;
            
            // Build weighted normal equations
            const XtWX = Array(dim).fill(0).map(() => Array(dim).fill(0));
            const XtWy = Array(dim).fill(0);
            
            for (let i = 0; i < n; i++) {
                const w = weights[i];
                const z = coalitions[i];
                const y = predictions[i];
                
                for (let j = 0; j < dim; j++) {
                    XtWy[j] += w * z[j] * y;
                    for (let k = 0; k < dim; k++) {
                        XtWX[j][k] += w * z[j] * z[k];
                    }
                }
            }
            
            // Add regularization
            for (let j = 0; j < dim; j++) {
                XtWX[j][j] += 0.001;
            }
            
            // Solve
            return PRISM_XAI_COMPLETE.LIME._solveLinear(XtWX, XtWy);
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // GRADIENT-BASED EXPLANATIONS
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Gradients: {
        /**
         * Compute gradient saliency map
         * @param {Function} gradFn - Function returning gradients: gradFn(input) -> gradients
         * @param {Array} input - Input to explain
         * @returns {Array} Saliency scores for each input feature
         */
        saliency: function(gradFn, input) {
            const gradients = gradFn(input);
            
            // Saliency = |gradient|
            return gradients.map(g => Math.abs(g));
        },
        
        /**
         * Integrated Gradients
         * @param {Function} predictFn - Model prediction function
         * @param {Function} gradFn - Gradient function
         * @param {Array} input - Input to explain
         * @param {Array} baseline - Baseline input (default: zeros)
         * @param {number} steps - Number of integration steps
         */
        integratedGradients: function(predictFn, gradFn, input, baseline = null, steps = 50) {
            baseline = baseline || Array(input.length).fill(0);
            
            // Integrate gradients along path from baseline to input
            const integratedGrads = Array(input.length).fill(0);
            
            for (let i = 0; i <= steps; i++) {
                const alpha = i / steps;
                
                // Interpolated input
                const interpolated = input.map((v, j) => 
                    baseline[j] + alpha * (v - baseline[j])
                );
                
                // Get gradients at this point
                const grads = gradFn(interpolated);
                
                // Accumulate (trapezoidal rule)
                const weight = (i === 0 || i === steps) ? 0.5 : 1;
                for (let j = 0; j < input.length; j++) {
                    integratedGrads[j] += weight * grads[j] / steps;
                }
            }
            
            // Scale by (input - baseline)
            return integratedGrads.map((g, j) => g * (input[j] - baseline[j]));
        },
        
        /**
         * SmoothGrad: Reduce noise by averaging gradients over noisy inputs
         * @param {Function} gradFn - Gradient function
         * @param {Array} input - Input to explain
         * @param {number} numSamples - Number of noisy samples
         * @param {number} noise - Standard deviation of noise
         */
        smoothGrad: function(gradFn, input, numSamples = 50, noise = 0.1) {
            const smoothGrads = Array(input.length).fill(0);
            
            for (let i = 0; i < numSamples; i++) {
                // Add noise to input
                const noisyInput = input.map(v => v + noise * this._randn());
                
                // Get gradients
                const grads = gradFn(noisyInput);
                
                // Accumulate
                for (let j = 0; j < input.length; j++) {
                    smoothGrads[j] += Math.abs(grads[j]) / numSamples;
                }
            }
            
            return smoothGrads;
        },
        
        _randn: function() {
            const u1 = Math.random();
            const u2 = Math.random();
            return Math.sqrt(-2 * Math.log(u1)) * Math.cos(2 * Math.PI * u2);
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // MANUFACTURING XAI APPLICATIONS
    // ─────────────────────────────────────────────────────────────────────────────────────────
    Manufacturing: {
        /**
         * Explain speed/feed recommendation
         * @param {Function} recommendFn - Function that produces recommendation
         * @param {Object} params - {material, tool, machine, ...}
         * @returns {Object} Explanation of recommendation
         */
        explainSpeedFeed: function(recommendFn, params) {
            // Convert params to feature array
            const features = this._paramsToFeatures(params);
            const featureNames = Object.keys(params);
            
            // Get LIME explanation
            const predictFn = (f) => {
                const p = this._featuresToParams(f, featureNames);
                const result = recommendFn(p);
                return result.speed || result.vc || 0;
            };
            
            const explanation = PRISM_XAI_COMPLETE.LIME.explain(
                predictFn, features, 500, 5
            );
            
            // Format explanation
            return {
                recommendation: recommendFn(params),
                topFactors: explanation.explanation.map(e => ({
                    factor: featureNames[e.feature],
                    influence: e.importance,
                    direction: e.importance > 0 ? 'increases' : 'decreases'
                })),
                confidence: 0.85 // Placeholder
            };
        },
        
        _paramsToFeatures: function(params) {
            return Object.values(params).map(v => 
                typeof v === 'number' ? v : 0
            );
        },
        
        _featuresToParams: function(features, names) {
            const params = {};
            names.forEach((name, i) => {
                params[name] = features[i];
            });
            return params;
        }
    }
};


// ═══════════════════════════════════════════════════════════════════════════════════════════
// SECTION 5: ATTENTION MECHANISMS COMPLETE
// Source: Vaswani et al. (Attention Is All You Need), MIT 15.773
// ═══════════════════════════════════════════════════════════════════════════════════════════

const PRISM_ATTENTION_COMPLETE = {
    name: 'PRISM Attention Mechanisms Complete',
    version: '1.0.0',
    source: 'Vaswani et al., MIT 15.773',
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // SCALED DOT-PRODUCT ATTENTION
    // Attention(Q, K, V) = softmax(QK^T / sqrt(d_k))V
    // ─────────────────────────────────────────────────────────────────────────────────────────
    ScaledDotProduct: {
        /**
         * Compute scaled dot-product attention
         * @param {Array} Q - Query matrix [seq_len, d_k]
         * @param {Array} K - Key matrix [seq_len, d_k]
         * @param {Array} V - Value matrix [seq_len, d_v]
         * @param {Array} mask - Optional attention mask
         * @returns {Object} {output, attentionWeights}
         */
        attention: function(Q, K, V, mask = null) {
            const seqLen = Q.length;
            const d_k = Q[0].length;
            const scale = Math.sqrt(d_k);
            
            // Compute QK^T / sqrt(d_k)
            const scores = Array(seqLen).fill(0).map(() => Array(seqLen).fill(0));
            
            for (let i = 0; i < seqLen; i++) {
                for (let j = 0; j < seqLen; j++) {
                    let dot = 0;
                    for (let k = 0; k < d_k; k++) {
                        dot += Q[i][k] * K[j][k];
                    }
                    scores[i][j] = dot / scale;
                    
                    // Apply mask if provided
                    if (mask && !mask[i][j]) {
                        scores[i][j] = -1e9;
                    }
                }
            }
            
            // Softmax
            const attentionWeights = scores.map(row => {
                const maxScore = Math.max(...row);
                const expScores = row.map(s => Math.exp(s - maxScore));
                const sumExp = expScores.reduce((a, b) => a + b, 0);
                return expScores.map(e => e / sumExp);
            });
            
            // Weighted sum of values
            const d_v = V[0].length;
            const output = Array(seqLen).fill(0).map(() => Array(d_v).fill(0));
            
            for (let i = 0; i < seqLen; i++) {
                for (let j = 0; j < seqLen; j++) {
                    for (let k = 0; k < d_v; k++) {
                        output[i][k] += attentionWeights[i][j] * V[j][k];
                    }
                }
            }
            
            return { output, attentionWeights };
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // MULTI-HEAD ATTENTION
    // ─────────────────────────────────────────────────────────────────────────────────────────
    MultiHead: {
        /**
         * Initialize multi-head attention weights
         * @param {number} d_model - Model dimension
         * @param {number} numHeads - Number of attention heads
         */
        init: function(d_model, numHeads) {
            const d_k = Math.floor(d_model / numHeads);
            const d_v = d_k;
            
            const xavier = (fanIn, fanOut) => Math.sqrt(6 / (fanIn + fanOut));
            
            return {
                numHeads,
                d_k,
                d_v,
                d_model,
                // Projection weights for each head
                W_Q: Array(numHeads).fill(0).map(() => 
                    this._randomMatrix(d_model, d_k, xavier(d_model, d_k))
                ),
                W_K: Array(numHeads).fill(0).map(() => 
                    this._randomMatrix(d_model, d_k, xavier(d_model, d_k))
                ),
                W_V: Array(numHeads).fill(0).map(() => 
                    this._randomMatrix(d_model, d_v, xavier(d_model, d_v))
                ),
                W_O: this._randomMatrix(numHeads * d_v, d_model, xavier(numHeads * d_v, d_model))
            };
        },
        
        _randomMatrix: function(rows, cols, scale) {
            return Array(rows).fill(0).map(() => 
                Array(cols).fill(0).map(() => (Math.random() - 0.5) * 2 * scale)
            );
        },
        
        /**
         * Compute multi-head attention
         * @param {Object} weights - Attention weights from init()
         * @param {Array} X - Input [seq_len, d_model]
         * @param {Array} mask - Optional attention mask
         */
        forward: function(weights, X, mask = null) {
            const { numHeads, d_k, d_v, W_Q, W_K, W_V, W_O } = weights;
            const seqLen = X.length;
            
            const headsOutput = [];
            const headsAttention = [];
            
            // Compute attention for each head
            for (let h = 0; h < numHeads; h++) {
                // Project to Q, K, V
                const Q = this._matmul(X, W_Q[h]);
                const K = this._matmul(X, W_K[h]);
                const V = this._matmul(X, W_V[h]);
                
                // Scaled dot-product attention
                const { output, attentionWeights } = PRISM_ATTENTION_COMPLETE.ScaledDotProduct.attention(Q, K, V, mask);
                
                headsOutput.push(output);
                headsAttention.push(attentionWeights);
            }
            
            // Concatenate heads
            const concat = Array(seqLen).fill(0).map((_, i) => {
                const row = [];
                for (let h = 0; h < numHeads; h++) {
                    row.push(...headsOutput[h][i]);
                }
                return row;
            });
            
            // Final linear projection
            const output = this._matmul(concat, W_O);
            
            return { output, attentionWeights: headsAttention };
        },
        
        _matmul: function(A, B) {
            const m = A.length;
            const n = B[0].length;
            const k = A[0].length;
            
            const result = Array(m).fill(0).map(() => Array(n).fill(0));
            
            for (let i = 0; i < m; i++) {
                for (let j = 0; j < n; j++) {
                    for (let l = 0; l < k; l++) {
                        result[i][j] += A[i][l] * B[l][j];
                    }
                }
            }
            
            return result;
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // TRANSFORMER ENCODER LAYER
    // ─────────────────────────────────────────────────────────────────────────────────────────
    TransformerEncoder: {
        /**
         * Initialize transformer encoder layer
         */
        init: function(d_model, numHeads, d_ff) {
            const xavier = (fanIn, fanOut) => Math.sqrt(6 / (fanIn + fanOut));
            
            return {
                attention: PRISM_ATTENTION_COMPLETE.MultiHead.init(d_model, numHeads),
                // Feed-forward network
                ff_W1: PRISM_ATTENTION_COMPLETE.MultiHead._randomMatrix(d_model, d_ff, xavier(d_model, d_ff)),
                ff_b1: Array(d_ff).fill(0),
                ff_W2: PRISM_ATTENTION_COMPLETE.MultiHead._randomMatrix(d_ff, d_model, xavier(d_ff, d_model)),
                ff_b2: Array(d_model).fill(0),
                // Layer normalization parameters
                ln1_gamma: Array(d_model).fill(1),
                ln1_beta: Array(d_model).fill(0),
                ln2_gamma: Array(d_model).fill(1),
                ln2_beta: Array(d_model).fill(0),
                d_model
            };
        },
        
        /**
         * Forward pass through encoder layer
         */
        forward: function(weights, X, mask = null) {
            const seqLen = X.length;
            
            // Multi-head self-attention
            const { output: attnOutput } = PRISM_ATTENTION_COMPLETE.MultiHead.forward(
                weights.attention, X, mask
            );
            
            // Add & Norm
            let residual = X.map((row, i) => row.map((v, j) => v + attnOutput[i][j]));
            residual = this._layerNorm(residual, weights.ln1_gamma, weights.ln1_beta);
            
            // Feed-forward
            const ffOutput = this._feedForward(
                residual, 
                weights.ff_W1, weights.ff_b1,
                weights.ff_W2, weights.ff_b2
            );
            
            // Add & Norm
            let output = residual.map((row, i) => row.map((v, j) => v + ffOutput[i][j]));
            output = this._layerNorm(output, weights.ln2_gamma, weights.ln2_beta);
            
            return output;
        },
        
        _feedForward: function(X, W1, b1, W2, b2) {
            const seqLen = X.length;
            const d_ff = W1[0].length;
            const d_model = W2[0].length;
            
            // First linear + GELU
            const hidden = Array(seqLen).fill(0).map((_, i) => {
                const row = Array(d_ff).fill(0);
                for (let j = 0; j < d_ff; j++) {
                    row[j] = b1[j];
                    for (let k = 0; k < X[i].length; k++) {
                        row[j] += X[i][k] * W1[k][j];
                    }
                    // GELU activation
                    row[j] = row[j] * 0.5 * (1 + Math.tanh(
                        Math.sqrt(2 / Math.PI) * (row[j] + 0.044715 * row[j] * row[j] * row[j])
                    ));
                }
                return row;
            });
            
            // Second linear
            const output = Array(seqLen).fill(0).map((_, i) => {
                const row = Array(d_model).fill(0);
                for (let j = 0; j < d_model; j++) {
                    row[j] = b2[j];
                    for (let k = 0; k < d_ff; k++) {
                        row[j] += hidden[i][k] * W2[k][j];
                    }
                }
                return row;
            });
            
            return output;
        },
        
        _layerNorm: function(X, gamma, beta, eps = 1e-5) {
            return X.map(row => {
                const mean = row.reduce((a, b) => a + b, 0) / row.length;
                const variance = row.reduce((sum, v) => sum + (v - mean) ** 2, 0) / row.length;
                const std = Math.sqrt(variance + eps);
                
                return row.map((v, j) => gamma[j] * (v - mean) / std + beta[j]);
            });
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────────────────────
    // POSITIONAL ENCODING
    // ─────────────────────────────────────────────────────────────────────────────────────────
    PositionalEncoding: {
        /**
         * Generate sinusoidal positional encoding
         * @param {number} maxLen - Maximum sequence length
         * @param {number} d_model - Model dimension
         */
        sinusoidal: function(maxLen, d_model) {
            const PE = Array(maxLen).fill(0).map(() => Array(d_model).fill(0));
            
            for (let pos = 0; pos < maxLen; pos++) {
                for (let i = 0; i < d_model; i++) {
                    const angle = pos / Math.pow(10000, (2 * Math.floor(i / 2)) / d_model);
                    PE[pos][i] = i % 2 === 0 ? Math.sin(angle) : Math.cos(angle);
                }
            }
            
            return PE;
        },
        
        /**
         * Add positional encoding to embeddings
         */
        add: function(embeddings, PE) {
            return embeddings.map((row, i) => 
                row.map((v, j) => v + PE[i][j])
            );
        }
    }
};


