// COMPONENT 1: PRISM_TIME_SERIES_COMPLETE
// Time series forecasting, anomaly detection, and remaining useful life prediction
// Source: MIT 18.065, 6.867
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_TIME_SERIES_COMPLETE = {
    name: 'PRISM Time Series Complete',
    version: '1.0.0',
    
    // ─────────────────────────────────────────────────────────────────────────
    // EXPONENTIAL SMOOTHING
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Simple Exponential Smoothing (SES)
     * S_t = α * Y_t + (1 - α) * S_{t-1}
     */
    simpleExponentialSmoothing: function(data, alpha = 0.3) {
        if (data.length === 0) return [];
        
        const smoothed = [data[0]];
        for (let i = 1; i < data.length; i++) {
            smoothed.push(alpha * data[i] + (1 - alpha) * smoothed[i - 1]);
        }
        return smoothed;
    },
    
    /**
     * Double Exponential Smoothing (Holt's method)
     * For data with trend
     * Level: L_t = α * Y_t + (1 - α) * (L_{t-1} + T_{t-1})
     * Trend: T_t = β * (L_t - L_{t-1}) + (1 - β) * T_{t-1}
     */
    holtSmoothing: function(data, alpha = 0.3, beta = 0.1) {
        if (data.length < 2) return { smoothed: data, level: data, trend: [0] };
        
        // Initialize
        let L = data[0];
        let T = data[1] - data[0];
        
        const level = [L];
        const trend = [T];
        const smoothed = [L];
        
        for (let i = 1; i < data.length; i++) {
            const prevL = L;
            L = alpha * data[i] + (1 - alpha) * (L + T);
            T = beta * (L - prevL) + (1 - beta) * T;
            
            level.push(L);
            trend.push(T);
            smoothed.push(L);
        }
        
        return { smoothed, level, trend };
    },
    
    /**
     * Triple Exponential Smoothing (Holt-Winters)
     * For data with trend and seasonality
     */
    holtWinters: function(data, params = {}) {
        const {
            alpha = 0.3,      // Level smoothing
            beta = 0.1,       // Trend smoothing
            gamma = 0.1,      // Seasonal smoothing
            seasonLength = 12, // Period of seasonality
            multiplicative = true
        } = params;
        
        if (data.length < seasonLength * 2) {
            return { error: 'Insufficient data for Holt-Winters' };
        }
        
        // Initialize seasonal indices from first season
        const seasonal = [];
        const firstSeasonAvg = data.slice(0, seasonLength).reduce((a, b) => a + b, 0) / seasonLength;
        
        for (let i = 0; i < seasonLength; i++) {
            seasonal.push(multiplicative ? data[i] / firstSeasonAvg : data[i] - firstSeasonAvg);
        }
        
        // Initialize level and trend
        let L = firstSeasonAvg;
        let T = (data.slice(seasonLength, 2 * seasonLength).reduce((a, b) => a + b, 0) / seasonLength - firstSeasonAvg) / seasonLength;
        
        const level = [L];
        const trend = [T];
        const fitted = [];
        
        for (let i = 0; i < data.length; i++) {
            const seasonIdx = i % seasonLength;
            
            if (i === 0) {
                fitted.push(multiplicative ? L * seasonal[seasonIdx] : L + seasonal[seasonIdx]);
                continue;
            }
            
            const prevL = L;
            const prevS = seasonal[seasonIdx];
            
            // Update level
            if (multiplicative) {
                L = alpha * (data[i] / prevS) + (1 - alpha) * (prevL + T);
            } else {
                L = alpha * (data[i] - prevS) + (1 - alpha) * (prevL + T);
            }
            
            // Update trend
            T = beta * (L - prevL) + (1 - beta) * T;
            
            // Update seasonal
            if (multiplicative) {
                seasonal[seasonIdx] = gamma * (data[i] / L) + (1 - gamma) * prevS;
            } else {
                seasonal[seasonIdx] = gamma * (data[i] - L) + (1 - gamma) * prevS;
            }
            
            level.push(L);
            trend.push(T);
            fitted.push(multiplicative ? L * seasonal[seasonIdx] : L + seasonal[seasonIdx]);
        }
        
        return {
            fitted,
            level,
            trend,
            seasonal: [...seasonal],
            
            // Forecast h steps ahead
            forecast: function(h) {
                const forecasts = [];
                for (let i = 1; i <= h; i++) {
                    const seasonIdx = (data.length + i - 1) % seasonLength;
                    const fL = L + i * T;
                    forecasts.push(multiplicative ? fL * seasonal[seasonIdx] : fL + seasonal[seasonIdx]);
                }
                return forecasts;
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // SEASONALITY DETECTION
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Detect seasonality using autocorrelation
     */
    detectSeasonality: function(data, maxPeriod = null) {
        maxPeriod = maxPeriod || Math.floor(data.length / 2);
        
        if (data.length < maxPeriod * 2) {
            return { seasonal: false, message: 'Insufficient data' };
        }
        
        // Compute autocorrelation for each lag
        const mean = data.reduce((a, b) => a + b, 0) / data.length;
        const variance = data.reduce((sum, x) => sum + Math.pow(x - mean, 2), 0);
        
        const autocorrelations = [];
        for (let lag = 1; lag <= maxPeriod; lag++) {
            let correlation = 0;
            for (let i = lag; i < data.length; i++) {
                correlation += (data[i] - mean) * (data[i - lag] - mean);
            }
            autocorrelations.push({
                lag,
                correlation: correlation / variance
            });
        }
        
        // Find peaks in autocorrelation
        const peaks = [];
        for (let i = 1; i < autocorrelations.length - 1; i++) {
            if (autocorrelations[i].correlation > autocorrelations[i - 1].correlation &&
                autocorrelations[i].correlation > autocorrelations[i + 1].correlation &&
                autocorrelations[i].correlation > 0.2) {
                peaks.push(autocorrelations[i]);
            }
        }
        
        if (peaks.length === 0) {
            return { seasonal: false, autocorrelations };
        }
        
        // Find strongest peak
        const strongest = peaks.reduce((a, b) => a.correlation > b.correlation ? a : b);
        
        return {
            seasonal: strongest.correlation > 0.3,
            period: strongest.lag,
            strength: strongest.correlation,
            allPeaks: peaks,
            autocorrelations
        };
    },
    
    /**
     * Seasonal Decomposition (STL-like)
     * Decompose into: Trend + Seasonal + Residual
     */
    decompose: function(data, period, multiplicative = false) {
        const n = data.length;
        
        // Compute trend using centered moving average
        const trend = [];
        const halfPeriod = Math.floor(period / 2);
        
        for (let i = 0; i < n; i++) {
            if (i < halfPeriod || i >= n - halfPeriod) {
                trend.push(null);
            } else {
                let sum = 0;
                for (let j = -halfPeriod; j <= halfPeriod; j++) {
                    sum += data[i + j];
                }
                trend.push(sum / period);
            }
        }
        
        // Detrend
        const detrended = data.map((d, i) => {
            if (trend[i] === null) return null;
            return multiplicative ? d / trend[i] : d - trend[i];
        });
        
        // Average seasonal pattern
        const seasonalAvg = new Array(period).fill(0);
        const seasonalCount = new Array(period).fill(0);
        
        for (let i = 0; i < n; i++) {
            if (detrended[i] !== null) {
                seasonalAvg[i % period] += detrended[i];
                seasonalCount[i % period]++;
            }
        }
        
        for (let i = 0; i < period; i++) {
            seasonalAvg[i] = seasonalCount[i] > 0 ? seasonalAvg[i] / seasonalCount[i] : (multiplicative ? 1 : 0);
        }
        
        // Normalize seasonal component
        const seasonalMean = seasonalAvg.reduce((a, b) => a + b, 0) / period;
        const seasonal = data.map((_, i) => {
            return multiplicative ? seasonalAvg[i % period] / seasonalMean : seasonalAvg[i % period] - seasonalMean;
        });
        
        // Compute residual
        const residual = data.map((d, i) => {
            if (trend[i] === null) return null;
            if (multiplicative) {
                return d / (trend[i] * seasonal[i]);
            } else {
                return d - trend[i] - seasonal[i];
            }
        });
        
        return { trend, seasonal, residual, seasonalPattern: seasonalAvg };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // ANOMALY DETECTION
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Detect anomalies using multiple methods
     */
    detectAnomalies: function(data, options = {}) {
        const {
            method = 'zscore',    // 'zscore', 'iqr', 'mad', 'isolation'
            threshold = 3,
            windowSize = null,
            contamination = 0.1
        } = options;
        
        const anomalies = [];
        
        switch (method) {
            case 'zscore':
                return this._zscoreAnomalies(data, threshold, windowSize);
            
            case 'iqr':
                return this._iqrAnomalies(data, threshold);
            
            case 'mad':
                return this._madAnomalies(data, threshold);
            
            case 'isolation':
                return this._isolationForestAnomalies(data, contamination);
            
            default:
                return this._zscoreAnomalies(data, threshold);
        }
    },
    
    _zscoreAnomalies: function(data, threshold, windowSize = null) {
        const anomalies = [];
        
        if (windowSize) {
            // Rolling z-score
            for (let i = windowSize; i < data.length; i++) {
                const window = data.slice(i - windowSize, i);
                const mean = window.reduce((a, b) => a + b, 0) / windowSize;
                const std = Math.sqrt(window.reduce((s, x) => s + Math.pow(x - mean, 2), 0) / windowSize);
                
                const zscore = std > 0 ? Math.abs(data[i] - mean) / std : 0;
                if (zscore > threshold) {
                    anomalies.push({ index: i, value: data[i], score: zscore, method: 'zscore_rolling' });
                }
            }
        } else {
            // Global z-score
            const mean = data.reduce((a, b) => a + b, 0) / data.length;
            const std = Math.sqrt(data.reduce((s, x) => s + Math.pow(x - mean, 2), 0) / data.length);
            
            data.forEach((value, index) => {
                const zscore = std > 0 ? Math.abs(value - mean) / std : 0;
                if (zscore > threshold) {
                    anomalies.push({ index, value, score: zscore, method: 'zscore_global' });
                }
            });
        }
        
        return { anomalies, method: 'zscore', threshold };
    },
    
    _iqrAnomalies: function(data, multiplier = 1.5) {
        const sorted = [...data].sort((a, b) => a - b);
        const q1 = sorted[Math.floor(data.length * 0.25)];
        const q3 = sorted[Math.floor(data.length * 0.75)];
        const iqr = q3 - q1;
        
        const lower = q1 - multiplier * iqr;
        const upper = q3 + multiplier * iqr;
        
        const anomalies = [];
        data.forEach((value, index) => {
            if (value < lower || value > upper) {
                anomalies.push({
                    index,
                    value,
                    score: value < lower ? (lower - value) / iqr : (value - upper) / iqr,
                    method: 'iqr'
                });
            }
        });
        
        return { anomalies, method: 'iqr', bounds: { lower, upper }, q1, q3, iqr };
    },
    
    _madAnomalies: function(data, threshold = 3.5) {
        const median = this._median(data);
        const deviations = data.map(x => Math.abs(x - median));
        const mad = this._median(deviations);
        
        // Modified z-score using MAD
        const k = 1.4826; // Consistency constant for normal distribution
        
        const anomalies = [];
        data.forEach((value, index) => {
            const modifiedZscore = mad > 0 ? 0.6745 * (value - median) / mad : 0;
            if (Math.abs(modifiedZscore) > threshold) {
                anomalies.push({ index, value, score: Math.abs(modifiedZscore), method: 'mad' });
            }
        });
        
        return { anomalies, method: 'mad', median, mad };
    },
    
    _isolationForestAnomalies: function(data, contamination = 0.1) {
        // Simplified isolation forest
        const numTrees = 100;
        const sampleSize = Math.min(256, data.length);
        
        // Build trees and compute average path lengths
        const pathLengths = data.map(() => 0);
        
        for (let t = 0; t < numTrees; t++) {
            // Sample indices
            const sampleIndices = this._sample(data.length, sampleSize);
            const sampleData = sampleIndices.map(i => data[i]);
            
            // Build isolation tree
            const tree = this._buildIsolationTree(sampleData, 0, Math.ceil(Math.log2(sampleSize)));
            
            // Compute path length for each point
            data.forEach((value, i) => {
                pathLengths[i] += this._pathLength(tree, value, 0);
            });
        }
        
        // Average and normalize
        const avgPathLengths = pathLengths.map(p => p / numTrees);
        const c = this._avgPathLength(sampleSize);
        const anomalyScores = avgPathLengths.map(p => Math.pow(2, -p / c));
        
        // Find threshold based on contamination
        const sortedScores = [...anomalyScores].sort((a, b) => b - a);
        const threshold = sortedScores[Math.floor(data.length * contamination)];
        
        const anomalies = [];
        anomalyScores.forEach((score, index) => {
            if (score >= threshold) {
                anomalies.push({ index, value: data[index], score, method: 'isolation_forest' });
            }
        });
        
        return { anomalies, method: 'isolation_forest', scores: anomalyScores, threshold };
    },
    
    _buildIsolationTree: function(data, depth, maxDepth) {
        if (depth >= maxDepth || data.length <= 1) {
            return { type: 'leaf', size: data.length };
        }
        
        const min = Math.min(...data);
        const max = Math.max(...data);
        
        if (min === max) {
            return { type: 'leaf', size: data.length };
        }
        
        const splitValue = min + Math.random() * (max - min);
        const left = data.filter(x => x < splitValue);
        const right = data.filter(x => x >= splitValue);
        
        return {
            type: 'node',
            splitValue,
            left: this._buildIsolationTree(left, depth + 1, maxDepth),
            right: this._buildIsolationTree(right, depth + 1, maxDepth)
        };
    },
    
    _pathLength: function(tree, value, depth) {
        if (tree.type === 'leaf') {
            return depth + this._avgPathLength(tree.size);
        }
        
        if (value < tree.splitValue) {
            return this._pathLength(tree.left, value, depth + 1);
        } else {
            return this._pathLength(tree.right, value, depth + 1);
        }
    },
    
    _avgPathLength: function(n) {
        if (n <= 1) return 0;
        if (n === 2) return 1;
        return 2 * (Math.log(n - 1) + 0.5772156649) - 2 * (n - 1) / n;
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // REMAINING USEFUL LIFE (RUL) PREDICTION
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Predict Remaining Useful Life for tool wear
     */
    predictRUL: function(degradationData, failureThreshold, options = {}) {
        const {
            model = 'linear',    // 'linear', 'exponential', 'polynomial'
            confidenceLevel = 0.95
        } = options;
        
        if (degradationData.length < 3) {
            return { rul: null, confidence: 0, message: 'Insufficient data' };
        }
        
        const n = degradationData.length;
        const times = degradationData.map((_, i) => i);
        const values = degradationData;
        
        let predictedRUL, modelParams, r2;
        
        switch (model) {
            case 'exponential':
                const expResult = this._fitExponential(times, values);
                modelParams = expResult;
                const tExp = Math.log(failureThreshold / expResult.a) / expResult.b;
                predictedRUL = Math.max(0, tExp - (n - 1));
                r2 = expResult.r2;
                break;
                
            case 'polynomial':
                const polyResult = this._fitPolynomial(times, values, 2);
                modelParams = polyResult;
                // Solve quadratic: a*t^2 + b*t + c = threshold
                const roots = this._solveQuadratic(
                    polyResult.coeffs[2],
                    polyResult.coeffs[1],
                    polyResult.coeffs[0] - failureThreshold
                );
                const futureRoot = roots.filter(r => r > n - 1)[0];
                predictedRUL = futureRoot ? Math.max(0, futureRoot - (n - 1)) : Infinity;
                r2 = polyResult.r2;
                break;
                
            case 'linear':
            default:
                const linResult = this._fitLinear(times, values);
                modelParams = linResult;
                const tLin = (failureThreshold - linResult.intercept) / linResult.slope;
                predictedRUL = linResult.slope > 0 ? Math.max(0, tLin - (n - 1)) : Infinity;
                r2 = linResult.r2;
        }
        
        // Confidence interval based on model fit
        const confidence = Math.max(0, Math.min(1, r2));
        const zScore = 1.96; // 95% confidence
        const stdError = Math.sqrt((1 - r2) * predictedRUL * predictedRUL / n);
        
        return {
            rul: isFinite(predictedRUL) ? Math.round(predictedRUL) : null,
            confidence,
            model,
            modelParams,
            r2,
            prediction: {
                lower: Math.max(0, Math.round(predictedRUL - zScore * stdError)),
                expected: isFinite(predictedRUL) ? Math.round(predictedRUL) : null,
                upper: Math.round(predictedRUL + zScore * stdError)
            },
            currentValue: values[n - 1],
            failureThreshold
        };
    },
    
    _fitLinear: function(x, y) {
        const n = x.length;
        const xMean = x.reduce((a, b) => a + b, 0) / n;
        const yMean = y.reduce((a, b) => a + b, 0) / n;
        
        let num = 0, den = 0;
        for (let i = 0; i < n; i++) {
            num += (x[i] - xMean) * (y[i] - yMean);
            den += Math.pow(x[i] - xMean, 2);
        }
        
        const slope = den !== 0 ? num / den : 0;
        const intercept = yMean - slope * xMean;
        
        // R-squared
        let ssTot = 0, ssRes = 0;
        for (let i = 0; i < n; i++) {
            const predicted = intercept + slope * x[i];
            ssTot += Math.pow(y[i] - yMean, 2);
            ssRes += Math.pow(y[i] - predicted, 2);
        }
        const r2 = ssTot > 0 ? 1 - ssRes / ssTot : 0;
        
        return { slope, intercept, r2 };
    },
    
    _fitExponential: function(x, y) {
        // y = a * e^(b*x) => ln(y) = ln(a) + b*x
        const logY = y.map(v => Math.log(Math.max(v, 1e-10)));
        const linFit = this._fitLinear(x, logY);
        
        return {
            a: Math.exp(linFit.intercept),
            b: linFit.slope,
            r2: linFit.r2
        };
    },
    
    _fitPolynomial: function(x, y, degree) {
        // Simple least squares for polynomial
        const n = x.length;
        
        // Build Vandermonde matrix
        const X = [];
        for (let i = 0; i < n; i++) {
            const row = [];
            for (let j = 0; j <= degree; j++) {
                row.push(Math.pow(x[i], j));
            }
            X.push(row);
        }
        
        // Solve normal equations: (X'X)^-1 X'y
        const coeffs = this._solveLeastSquares(X, y);
        
        // Calculate R-squared
        const yMean = y.reduce((a, b) => a + b, 0) / n;
        let ssTot = 0, ssRes = 0;
        for (let i = 0; i < n; i++) {
            let predicted = 0;
            for (let j = 0; j <= degree; j++) {
                predicted += coeffs[j] * Math.pow(x[i], j);
            }
            ssTot += Math.pow(y[i] - yMean, 2);
            ssRes += Math.pow(y[i] - predicted, 2);
        }
        
        return { coeffs, r2: ssTot > 0 ? 1 - ssRes / ssTot : 0 };
    },
    
    _solveLeastSquares: function(X, y) {
        // Simple implementation using normal equations
        const m = X[0].length;
        const n = X.length;
        
        // X'X
        const XtX = Array(m).fill(null).map(() => Array(m).fill(0));
        for (let i = 0; i < m; i++) {
            for (let j = 0; j < m; j++) {
                for (let k = 0; k < n; k++) {
                    XtX[i][j] += X[k][i] * X[k][j];
                }
            }
        }
        
        // X'y
        const Xty = Array(m).fill(0);
        for (let i = 0; i < m; i++) {
            for (let k = 0; k < n; k++) {
                Xty[i] += X[k][i] * y[k];
            }
        }
        
        // Solve using Gaussian elimination
        return this._gaussianElimination(XtX, Xty);
    },
    
    _gaussianElimination: function(A, b) {
        const n = A.length;
        const aug = A.map((row, i) => [...row, b[i]]);
        
        // Forward elimination
        for (let i = 0; i < n; i++) {
            // Find pivot
            let maxRow = i;
            for (let k = i + 1; k < n; k++) {
                if (Math.abs(aug[k][i]) > Math.abs(aug[maxRow][i])) {
                    maxRow = k;
                }
            }
            [aug[i], aug[maxRow]] = [aug[maxRow], aug[i]];
            
            // Eliminate column
            for (let k = i + 1; k < n; k++) {
                const c = aug[k][i] / aug[i][i];
                for (let j = i; j <= n; j++) {
                    aug[k][j] -= c * aug[i][j];
                }
            }
        }
        
        // Back substitution
        const x = Array(n).fill(0);
        for (let i = n - 1; i >= 0; i--) {
            x[i] = aug[i][n];
            for (let j = i + 1; j < n; j++) {
                x[i] -= aug[i][j] * x[j];
            }
            x[i] /= aug[i][i];
        }
        
        return x;
    },
    
    _solveQuadratic: function(a, b, c) {
        if (Math.abs(a) < 1e-10) {
            return b !== 0 ? [-c / b] : [];
        }
        
        const discriminant = b * b - 4 * a * c;
        if (discriminant < 0) return [];
        if (discriminant === 0) return [-b / (2 * a)];
        
        const sqrtD = Math.sqrt(discriminant);
        return [(-b + sqrtD) / (2 * a), (-b - sqrtD) / (2 * a)];
    },
    
    _median: function(arr) {
        const sorted = [...arr].sort((a, b) => a - b);
        const mid = Math.floor(sorted.length / 2);
        return sorted.length % 2 ? sorted[mid] : (sorted[mid - 1] + sorted[mid]) / 2;
    },
    
    _sample: function(n, k) {
        const indices = [];
        const available = [...Array(n).keys()];
        for (let i = 0; i < k && available.length > 0; i++) {
            const idx = Math.floor(Math.random() * available.length);
            indices.push(available.splice(idx, 1)[0]);
        }
        return indices;
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // MANUFACTURING-SPECIFIC TIME SERIES
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Predict tool wear progression
     */
    predictToolWear: function(wearHistory, targetLife = null) {
        const rul = this.predictRUL(wearHistory, targetLife || 0.3, { model: 'exponential' });
        
        // Generate wear curve prediction
        const currentTime = wearHistory.length - 1;
        const predictions = [];
        
        if (rul.modelParams && rul.modelParams.b > 0) {
            for (let t = 0; t <= (rul.rul || 50) + currentTime; t++) {
                predictions.push({
                    time: t,
                    wear: rul.modelParams.a * Math.exp(rul.modelParams.b * t),
                    actual: t < wearHistory.length ? wearHistory[t] : null
                });
            }
        }
        
        return {
            ...rul,
            wearCurve: predictions,
            recommendations: this._getToolWearRecommendations(rul)
        };
    },
    
    _getToolWearRecommendations: function(rul) {
        const recommendations = [];
        
        if (rul.rul !== null) {
            if (rul.rul < 10) {
                recommendations.push({
                    priority: 'critical',
                    message: 'Tool replacement imminent - schedule change within next 10 cycles'
                });
            } else if (rul.rul < 30) {
                recommendations.push({
                    priority: 'warning',
                    message: 'Plan tool replacement - approximately ' + rul.rul + ' cycles remaining'
                });
            }
            
            if (rul.confidence < 0.7) {
                recommendations.push({
                    priority: 'info',
                    message: 'Low prediction confidence - consider more frequent inspection'
                });
            }
        }
        
        return recommendations;
    },
    
    /**
     * Analyze machine health from sensor time series
     */
    analyzeMachineHealth: function(sensorData, baseline = null) {
        const analysis = {
            timestamp: Date.now(),
            sensors: {}
        };
        
        for (const [sensorName, data] of Object.entries(sensorData)) {
            const anomalies = this.detectAnomalies(data, { method: 'zscore', threshold: 3 });
            const trend = this._fitLinear([...Array(data.length).keys()], data);
            
            analysis.sensors[sensorName] = {
                current: data[data.length - 1],
                mean: data.reduce((a, b) => a + b, 0) / data.length,
                std: Math.sqrt(data.reduce((s, x, i, arr) => s + Math.pow(x - arr.reduce((a, b) => a + b, 0) / arr.length, 2), 0) / data.length),
                trend: trend.slope > 0 ? 'increasing' : trend.slope < 0 ? 'decreasing' : 'stable',
                trendMagnitude: Math.abs(trend.slope),
                anomalyCount: anomalies.anomalies.length,
                recentAnomalies: anomalies.anomalies.filter(a => a.index > data.length - 10)
            };
        }
        
        // Overall health score
        let healthScore = 100;
        for (const sensor of Object.values(analysis.sensors)) {
            healthScore -= sensor.anomalyCount * 2;
            healthScore -= sensor.trendMagnitude * 10;
        }
        analysis.healthScore = Math.max(0, Math.min(100, healthScore));
        
        return analysis;
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 2: PRISM_GNN_COMPLETE
// Graph Neural Networks for manufacturing graphs
// Source: Stanford CS224W, MIT 6.867
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_GNN_COMPLETE = {
    name: 'PRISM Graph Neural Networks Complete',
    version: '1.0.0',
    
    // ─────────────────────────────────────────────────────────────────────────
    // GRAPH CONVOLUTIONAL NETWORK (GCN)
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Create GCN layer
     * H^(l+1) = σ(D^(-1/2) * A_hat * D^(-1/2) * H^(l) * W^(l))
     */
    createGCNLayer: function(inputDim, outputDim) {
        const initWeight = () => (Math.random() - 0.5) * Math.sqrt(2 / (inputDim + outputDim));
        
        return {
            inputDim,
            outputDim,
            weights: Array(outputDim).fill(null).map(() => 
                Array(inputDim).fill(null).map(initWeight)
            ),
            bias: Array(outputDim).fill(0),
            
            forward: function(nodeFeatures, adjacency) {
                const numNodes = nodeFeatures.length;
                
                // Add self-loops: A_hat = A + I
                const adjHat = adjacency.map((row, i) => 
                    row.map((v, j) => i === j ? v + 1 : v)
                );
                
                // Compute degree matrix D
                const degree = adjHat.map(row => row.reduce((a, b) => a + b, 0));
                const degreeInvSqrt = degree.map(d => d > 0 ? 1 / Math.sqrt(d) : 0);
                
                // Normalized adjacency: D^(-1/2) * A_hat * D^(-1/2)
                const adjNorm = [];
                for (let i = 0; i < numNodes; i++) {
                    const row = [];
                    for (let j = 0; j < numNodes; j++) {
                        row.push(degreeInvSqrt[i] * adjHat[i][j] * degreeInvSqrt[j]);
                    }
                    adjNorm.push(row);
                }
                
                // Aggregate: A_norm * H
                const aggregated = this._matmul(adjNorm, nodeFeatures);
                
                // Transform: W * aggregated + b, then ReLU
                const output = [];
                for (let i = 0; i < numNodes; i++) {
                    const nodeOut = [];
                    for (let j = 0; j < this.outputDim; j++) {
                        let sum = this.bias[j];
                        for (let k = 0; k < this.inputDim; k++) {
                            sum += this.weights[j][k] * aggregated[i][k];
                        }
                        nodeOut.push(Math.max(0, sum)); // ReLU
                    }
                    output.push(nodeOut);
                }
                
                return output;
            },
            
            _matmul: function(A, B) {
                return A.map(row => {
                    const result = new Array(B[0].length).fill(0);
                    for (let i = 0; i < row.length; i++) {
                        for (let j = 0; j < B[0].length; j++) {
                            result[j] += row[i] * B[i][j];
                        }
                    }
                    return result;
                });
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // GRAPH ATTENTION NETWORK (GAT)
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Create GAT layer with multi-head attention
     */
    createGATLayer: function(inputDim, outputDim, numHeads = 4) {
        const headDim = Math.floor(outputDim / numHeads);
        const initWeight = () => (Math.random() - 0.5) * Math.sqrt(2 / inputDim);
        
        return {
            inputDim,
            outputDim,
            numHeads,
            headDim,
            
            // Per-head weights
            W: Array(numHeads).fill(null).map(() => 
                Array(headDim).fill(null).map(() => 
                    Array(inputDim).fill(null).map(initWeight)
                )
            ),
            
            // Attention weights [a_source, a_target]
            attention: Array(numHeads).fill(null).map(() => ({
                source: Array(headDim).fill(null).map(initWeight),
                target: Array(headDim).fill(null).map(initWeight)
            })),
            
            forward: function(nodeFeatures, adjacency) {
                const numNodes = nodeFeatures.length;
                const headOutputs = [];
                
                for (let h = 0; h < this.numHeads; h++) {
                    // Transform features: W * h
                    const transformed = nodeFeatures.map(features => {
                        const out = [];
                        for (let i = 0; i < this.headDim; i++) {
                            let sum = 0;
                            for (let j = 0; j < this.inputDim; j++) {
                                sum += this.W[h][i][j] * features[j];
                            }
                            out.push(sum);
                        }
                        return out;
                    });
                    
                    // Compute attention scores
                    const attentionScores = [];
                    for (let i = 0; i < numNodes; i++) {
                        const row = [];
                        for (let j = 0; j < numNodes; j++) {
                            if (adjacency[i][j] > 0 || i === j) {
                                // e_ij = LeakyReLU(a^T [Wh_i || Wh_j])
                                let score = 0;
                                for (let k = 0; k < this.headDim; k++) {
                                    score += this.attention[h].source[k] * transformed[i][k];
                                    score += this.attention[h].target[k] * transformed[j][k];
                                }
                                // LeakyReLU with negative slope 0.2
                                score = score > 0 ? score : 0.2 * score;
                                row.push(score);
                            } else {
                                row.push(-1e9); // Masked
                            }
                        }
                        attentionScores.push(row);
                    }
                    
                    // Softmax attention weights
                    const attentionWeights = attentionScores.map(row => {
                        const maxScore = Math.max(...row.filter(s => s > -1e8));
                        const exps = row.map(s => s > -1e8 ? Math.exp(s - maxScore) : 0);
                        const sum = exps.reduce((a, b) => a + b, 0);
                        return exps.map(e => e / (sum + 1e-10));
                    });
                    
                    // Aggregate: weighted sum of transformed neighbors
                    const headOut = [];
                    for (let i = 0; i < numNodes; i++) {
                        const nodeOut = new Array(this.headDim).fill(0);
                        for (let j = 0; j < numNodes; j++) {
                            for (let k = 0; k < this.headDim; k++) {
                                nodeOut[k] += attentionWeights[i][j] * transformed[j][k];
                            }
                        }
                        headOut.push(nodeOut);
                    }
                    
                    headOutputs.push(headOut);
                }
                
                // Concatenate heads
                return nodeFeatures.map((_, i) => 
                    headOutputs.flatMap(head => head[i])
                );
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // MESSAGE PASSING NEURAL NETWORK (MPNN)
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Create MPNN layer with custom message and update functions
     */
    createMPNNLayer: function(nodeInputDim, edgeInputDim, hiddenDim) {
        const initWeight = () => (Math.random() - 0.5) * 0.1;
        
        return {
            nodeInputDim,
            edgeInputDim,
            hiddenDim,
            
            // Message function weights
            messageWeights: Array(hiddenDim).fill(null).map(() => 
                Array(nodeInputDim * 2 + edgeInputDim).fill(null).map(initWeight)
            ),
            messageBias: Array(hiddenDim).fill(0),
            
            // Update function weights (GRU-style)
            updateWeights: Array(hiddenDim).fill(null).map(() => 
                Array(nodeInputDim + hiddenDim).fill(null).map(initWeight)
            ),
            updateBias: Array(hiddenDim).fill(0),
            
            forward: function(nodeFeatures, edges, edgeFeatures = null) {
                const numNodes = nodeFeatures.length;
                
                // Initialize messages
                const messages = Array(numNodes).fill(null).map(() => 
                    Array(this.hiddenDim).fill(0)
                );
                
                // Compute and aggregate messages
                for (let e = 0; e < edges.length; e++) {
                    const [src, dst] = edges[e];
                    const edgeFeat = edgeFeatures ? edgeFeatures[e] : [];
                    
                    // Message: MLP([h_src, h_dst, e_ij])
                    const input = [...nodeFeatures[src], ...nodeFeatures[dst], ...edgeFeat];
                    const message = this._mlp(input, this.messageWeights, this.messageBias);
                    
                    // Aggregate at destination (sum)
                    for (let i = 0; i < this.hiddenDim; i++) {
                        messages[dst][i] += message[i];
                    }
                }
                
                // Update node features
                const updated = [];
                for (let i = 0; i < numNodes; i++) {
                    const input = [...nodeFeatures[i], ...messages[i]];
                    const newFeatures = this._mlp(input, this.updateWeights, this.updateBias);
                    updated.push(newFeatures);
                }
                
                return updated;
            },
            
            _mlp: function(input, weights, bias) {
                const output = [];
                for (let i = 0; i < weights.length; i++) {
                    let sum = bias[i];
                    for (let j = 0; j < Math.min(input.length, weights[i].length); j++) {
                        sum += weights[i][j] * input[j];
                    }
                    output.push(Math.max(0, sum)); // ReLU
                }
                return output;
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // GRAPH POOLING
    // ─────────────────────────────────────────────────────────────────────────
    
    pooling: {
        /**
         * Global mean pooling
         */
        mean: function(nodeFeatures) {
            const dim = nodeFeatures[0].length;
            const result = new Array(dim).fill(0);
            
            for (const features of nodeFeatures) {
                for (let i = 0; i < dim; i++) {
                    result[i] += features[i];
                }
            }
            
            return result.map(v => v / nodeFeatures.length);
        },
        
        /**
         * Global max pooling
         */
        max: function(nodeFeatures) {
            const dim = nodeFeatures[0].length;
            const result = new Array(dim).fill(-Infinity);
            
            for (const features of nodeFeatures) {
                for (let i = 0; i < dim; i++) {
                    result[i] = Math.max(result[i], features[i]);
                }
            }
            
            return result;
        },
        
        /**
         * Global sum pooling
         */
        sum: function(nodeFeatures) {
            const dim = nodeFeatures[0].length;
            const result = new Array(dim).fill(0);
            
            for (const features of nodeFeatures) {
                for (let i = 0; i < dim; i++) {
                    result[i] += features[i];
                }
            }
            
            return result;
        },
        
        /**
         * Attention-weighted pooling (Set2Set)
         */
        attention: function(nodeFeatures, numSteps = 3) {
            const dim = nodeFeatures[0].length;
            let query = new Array(dim).fill(0);
            
            for (let step = 0; step < numSteps; step++) {
                // Compute attention scores
                const scores = nodeFeatures.map(f => 
                    f.reduce((sum, v, i) => sum + v * query[i], 0)
                );
                
                // Softmax
                const maxScore = Math.max(...scores);
                const exps = scores.map(s => Math.exp(s - maxScore));
                const sumExp = exps.reduce((a, b) => a + b, 0);
                const attention = exps.map(e => e / sumExp);
                
                // Weighted sum
                query = new Array(dim).fill(0);
                for (let i = 0; i < nodeFeatures.length; i++) {
                    for (let j = 0; j < dim; j++) {
                        query[j] += attention[i] * nodeFeatures[i][j];
                    }
                }
            }
            
            return query;
        }
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // MANUFACTURING GRAPH CONSTRUCTION
    // ─────────────────────────────────────────────────────────────────────────
    
    /**
     * Create part graph from manufacturing features
     */
    createPartGraph: function(features, relations = null) {
        const nodes = features.map((f, i) => ({
            id: i,
            features: f.features || f,
            type: f.type || 'feature'
        }));
        
        const edges = [];
        const edgeFeatures = [];
        
        if (relations) {
            // Use provided relations
            for (const rel of relations) {
                edges.push([rel.source, rel.target]);
                edgeFeatures.push(rel.features || [1]);
            }
        } else {
            // Create fully connected graph
            for (let i = 0; i < features.length; i++) {
                for (let j = i + 1; j < features.length; j++) {
                    edges.push([i, j]);
                    edges.push([j, i]);
                    edgeFeatures.push([1]);
                    edgeFeatures.push([1]);
                }
            }
        }
        
        // Create adjacency matrix
        const adjacency = Array(nodes.length).fill(null).map(() => 
            Array(nodes.length).fill(0)
        );
        for (const [src, dst] of edges) {
            adjacency[src][dst] = 1;
        }
        
        return { nodes, edges, edgeFeatures, adjacency };
    },
    
    /**
     * Create operation sequence graph
     */
    createOperationGraph: function(operations) {
        const nodes = operations.map((op, i) => ({
            id: i,
            features: [
                op.depth || 0,
                op.width || 0,
                op.length || 0,
                op.toolDiameter || 0,
                op.operationType ? this._encodeOperationType(op.operationType) : 0
            ],
            type: 'operation'
        }));
        
        // Create edges based on dependencies and proximity
        const edges = [];
        const edgeFeatures = [];
        
        for (let i = 0; i < operations.length; i++) {
            for (let j = i + 1; j < operations.length; j++) {
                // Temporal order
                edges.push([i, j]);
                edgeFeatures.push([1, j - i]); // [edge_type, distance]
                
                // Same tool grouping
                if (operations[i].tool === operations[j].tool) {
                    edges.push([j, i]);
                    edgeFeatures.push([2, 0]); // Same tool edge
                }
            }
        }
        
        const adjacency = Array(nodes.length).fill(null).map(() => 
            Array(nodes.length).fill(0)
        );
        for (const [src, dst] of edges) {
            adjacency[src][dst] = 1;
        }
        
        return { nodes, edges, edgeFeatures, adjacency };
    },
    
    _encodeOperationType: function(type) {
        const types = { roughing: 1, finishing: 2, drilling: 3, tapping: 4, facing: 5 };
        return types[type.toLowerCase()] || 0;
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 3: PRISM_ONLINE_LEARNING_COMPLETE
// Online and continual learning for adaptive systems
// Source: MIT 6.867, 15.773
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_ONLINE_LEARNING_COMPLETE = {
    name: 'PRISM Online Learning Complete',
    version: '1.0.0',
    
    // ─────────────────────────────────────────────────────────────────────────
    // EXPERIENCE REPLAY BUFFER
    // ─────────────────────────────────────────────────────────────────────────
    
    createExperienceBuffer: function(maxSize = 10000) {
        return {
            buffer: [],
            maxSize,
            priorities: [],
            
            add: function(experience) {
                this.buffer.push({
                    ...experience,
                    timestamp: Date.now()
                });
                this.priorities.push(1.0); // Initial priority
                
                // Remove oldest if over capacity
                if (this.buffer.length > this.maxSize) {
                    this.buffer.shift();
                    this.priorities.shift();
                }
            },
            
            sampleUniform: function(batchSize) {
                const samples = [];
                const indices = [];
                
                for (let i = 0; i < Math.min(batchSize, this.buffer.length); i++) {
                    let idx;
                    do {
                        idx = Math.floor(Math.random() * this.buffer.length);
                    } while (indices.includes(idx));
                    
                    indices.push(idx);
                    samples.push(this.buffer[idx]);
                }
                
                return { samples, indices };
            },
            
            samplePrioritized: function(batchSize, alpha = 0.6) {
                const priorities = this.priorities.map(p => Math.pow(p, alpha));
                const total = priorities.reduce((a, b) => a + b, 0);
                const probs = priorities.map(p => p / total);
                
                const samples = [];
                const indices = [];
                const weights = [];
                
                for (let i = 0; i < Math.min(batchSize, this.buffer.length); i++) {
                    let rand = Math.random();
                    let cumSum = 0;
                    let idx = 0;
                    
                    for (let j = 0; j < this.buffer.length; j++) {
                        cumSum += probs[j];
                        if (rand <= cumSum) {
                            idx = j;
                            break;
                        }
                    }
                    
                    indices.push(idx);
                    samples.push(this.buffer[idx]);
                    weights.push(Math.pow(this.buffer.length * probs[idx], -1));
                }
                
                // Normalize weights
                const maxWeight = Math.max(...weights);
                const normalizedWeights = weights.map(w => w / maxWeight);
                
                return { samples, indices, weights: normalizedWeights };
            },
            
            updatePriorities: function(indices, tdErrors) {
                const epsilon = 1e-6;
                for (let i = 0; i < indices.length; i++) {
                    this.priorities[indices[i]] = Math.abs(tdErrors[i]) + epsilon;
                }
            },
            
            size: function() {
                return this.buffer.length;
            },
            
            clear: function() {
                this.buffer = [];
                this.priorities = [];
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // CONCEPT DRIFT DETECTION
    // ─────────────────────────────────────────────────────────────────────────
    
    createDriftDetector: function(options = {}) {
        const {
            windowSize = 100,
            threshold = 2.0,
            minSamples = 30
        } = options;
        
        return {
            windowSize,
            threshold,
            minSamples,
            recentErrors: [],
            historicalMean: null,
            historicalStd: null,
            driftCount: 0,
            
            add: function(error) {
                this.recentErrors.push(error);
                
                // Keep window size
                if (this.recentErrors.length > this.windowSize * 2) {
                    // Update historical stats before removing
                    if (this.recentErrors.length === this.windowSize * 2) {
                        const historical = this.recentErrors.slice(0, this.windowSize);
                        this.historicalMean = historical.reduce((a, b) => a + b, 0) / historical.length;
                        this.historicalStd = Math.sqrt(
                            historical.reduce((s, x) => s + Math.pow(x - this.historicalMean, 2), 0) / historical.length
                        );
                    }
                    this.recentErrors.shift();
                }
            },
            
            detect: function() {
                if (this.recentErrors.length < this.minSamples) {
                    return { drift: false, confidence: 0, message: 'Insufficient data' };
                }
                
                const recent = this.recentErrors.slice(-this.windowSize);
                const recentMean = recent.reduce((a, b) => a + b, 0) / recent.length;
                const recentStd = Math.sqrt(
                    recent.reduce((s, x) => s + Math.pow(x - recentMean, 2), 0) / recent.length
                );
                
                if (this.historicalMean === null) {
                    // First window - set baseline
                    this.historicalMean = recentMean;
                    this.historicalStd = recentStd;
                    return { drift: false, confidence: 0, message: 'Baseline established' };
                }
                
                // ADWIN-style drift detection using statistical test
                const zscore = this.historicalStd > 0 ? 
                    Math.abs(recentMean - this.historicalMean) / this.historicalStd : 0;
                
                const drift = zscore > this.threshold;
                
                if (drift) {
                    this.driftCount++;
                    // Reset baseline
                    this.historicalMean = recentMean;
                    this.historicalStd = recentStd;
                }
                
                return {
                    drift,
                    confidence: Math.min(1, zscore / (this.threshold * 2)),
                    zscore,
                    historicalMean: this.historicalMean,
                    recentMean,
                    trend: recentMean > this.historicalMean ? 'increasing' : 'decreasing',
                    driftCount: this.driftCount
                };
            },
            
            reset: function() {
                this.recentErrors = [];
                this.historicalMean = null;
                this.historicalStd = null;
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // ELASTIC WEIGHT CONSOLIDATION (EWC)
    // ─────────────────────────────────────────────────────────────────────────
    
    createEWC: function(lambda = 1000) {
        return {
            lambda,
            fisherDiagonals: [],
            optimalWeights: [],
            taskCount: 0,
            
            /**
             * Compute Fisher Information diagonal
             * F_ii ≈ E[∂L/∂θ_i]²
             */
            computeFisher: function(model, data, numSamples = 100) {
                const params = model.getParams ? model.getParams() : model.weights;
                const fisher = params.map(p => 
                    Array.isArray(p) ? p.map(() => 0) : 0
                );
                
                for (let s = 0; s < Math.min(numSamples, data.length); s++) {
                    const sample = data[s];
                    
                    // Compute gradients (model must provide this)
                    const gradients = model.computeGradients ? 
                        model.computeGradients(sample.input, sample.target) :
                        this._approximateGradients(model, sample);
                    
                    // Add squared gradients to Fisher
                    for (let i = 0; i < gradients.length; i++) {
                        if (Array.isArray(gradients[i])) {
                            for (let j = 0; j < gradients[i].length; j++) {
                                fisher[i][j] += gradients[i][j] * gradients[i][j];
                            }
                        } else {
                            fisher[i] += gradients[i] * gradients[i];
                        }
                    }
                }
                
                // Average
                for (let i = 0; i < fisher.length; i++) {
                    if (Array.isArray(fisher[i])) {
                        for (let j = 0; j < fisher[i].length; j++) {
                            fisher[i][j] /= numSamples;
                        }
                    } else {
                        fisher[i] /= numSamples;
                    }
                }
                
                return fisher;
            },
            
            /**
             * Register completed task
             */
            registerTask: function(model, data) {
                const fisher = this.computeFisher(model, data);
                const params = model.getParams ? model.getParams() : model.weights;
                
                this.fisherDiagonals.push(fisher);
                this.optimalWeights.push(JSON.parse(JSON.stringify(params)));
                this.taskCount++;
                
                return { taskId: this.taskCount - 1, fisherComputed: true };
            },
            
            /**
             * Compute EWC penalty term
             * L_EWC = Σ_i (λ/2) * F_i * (θ_i - θ*_i)²
             */
            computePenalty: function(currentWeights) {
                let penalty = 0;
                
                for (let t = 0; t < this.taskCount; t++) {
                    const fisher = this.fisherDiagonals[t];
                    const optimal = this.optimalWeights[t];
                    
                    for (let i = 0; i < currentWeights.length; i++) {
                        if (Array.isArray(currentWeights[i])) {
                            for (let j = 0; j < currentWeights[i].length; j++) {
                                const diff = currentWeights[i][j] - optimal[i][j];
                                penalty += fisher[i][j] * diff * diff;
                            }
                        } else {
                            const diff = currentWeights[i] - optimal[i];
                            penalty += fisher[i] * diff * diff;
                        }
                    }
                }
                
                return (this.lambda / 2) * penalty;
            },
            
            /**
             * Compute EWC gradient contribution
             */
            computePenaltyGradient: function(currentWeights) {
                const gradient = currentWeights.map(w => 
                    Array.isArray(w) ? w.map(() => 0) : 0
                );
                
                for (let t = 0; t < this.taskCount; t++) {
                    const fisher = this.fisherDiagonals[t];
                    const optimal = this.optimalWeights[t];
                    
                    for (let i = 0; i < currentWeights.length; i++) {
                        if (Array.isArray(currentWeights[i])) {
                            for (let j = 0; j < currentWeights[i].length; j++) {
                                const diff = currentWeights[i][j] - optimal[i][j];
                                gradient[i][j] += this.lambda * fisher[i][j] * diff;
                            }
                        } else {
                            const diff = currentWeights[i] - optimal[i];
                            gradient[i] += this.lambda * fisher[i] * diff;
                        }
                    }
                }
                
                return gradient;
            },
            
            _approximateGradients: function(model, sample, epsilon = 1e-5) {
                const params = model.getParams ? model.getParams() : model.weights;
                const gradients = [];
                
                const baseLoss = model.computeLoss ? 
                    model.computeLoss(sample.input, sample.target) :
                    Math.pow(model.forward(sample.input)[0] - sample.target, 2);
                
                for (let i = 0; i < params.length; i++) {
                    if (Array.isArray(params[i])) {
                        const layerGrad = [];
                        for (let j = 0; j < params[i].length; j++) {
                            params[i][j] += epsilon;
                            const newLoss = model.computeLoss ? 
                                model.computeLoss(sample.input, sample.target) :
                                Math.pow(model.forward(sample.input)[0] - sample.target, 2);
                            params[i][j] -= epsilon;
                            layerGrad.push((newLoss - baseLoss) / epsilon);
                        }
                        gradients.push(layerGrad);
                    } else {
                        params[i] += epsilon;
                        const newLoss = model.computeLoss ? 
                            model.computeLoss(sample.input, sample.target) :
                            Math.pow(model.forward(sample.input)[0] - sample.target, 2);
                        params[i] -= epsilon;
                        gradients.push((newLoss - baseLoss) / epsilon);
                    }
                }
                
                return gradients;
            }
        };
    },
    
    // ─────────────────────────────────────────────────────────────────────────
    // MULTI-ARMED BANDIT FOR EXPLORATION
    // ─────────────────────────────────────────────────────────────────────────
    
    createBandit: function(numArms) {
        return {
            numArms,
            counts: new Array(numArms).fill(0),
            values: new Array(numArms).fill(0),
            sumRewards: new Array(numArms).fill(0),
            sumSquaredRewards: new Array(numArms).fill(0),
            
            /**
             * Select arm using UCB1
             */
            selectUCB: function(c = 2) {
                const totalPulls = this.counts.reduce((a, b) => a + b, 0);
                
                // Pull each arm at least once
                for (let i = 0; i < this.numArms; i++) {
                    if (this.counts[i] === 0) return i;
                }
                
                let bestArm = 0;
                let bestUCB = -Infinity;
                
                for (let i = 0; i < this.numArms; i++) {
                    const exploitation = this.values[i];
                    const exploration = c * Math.sqrt(Math.log(totalPulls) / this.counts[i]);
                    const ucb = exploitation + exploration;
                    
                    if (ucb > bestUCB) {
                        bestUCB = ucb;
                        bestArm = i;
                    }
                }
                
                return bestArm;
            },
            
            /**
             * Select arm using Thompson Sampling (Beta-Bernoulli)
             */
            selectThompson: function() {
                let bestArm = 0;
                let bestSample = -Infinity;
                
                for (let i = 0; i < this.numArms; i++) {
                    // Sample from Beta distribution
                    const alpha = this.sumRewards[i] + 1;
                    const beta = this.counts[i] - this.sumRewards[i] + 1;
                    const sample = this._sampleBeta(alpha, beta);
                    
                    if (sample > bestSample) {
                        bestSample = sample;
                        bestArm = i;
                    }
                }
                
                return bestArm;
            },
            
            /**
             * Select arm using epsilon-greedy
             */
            selectEpsilonGreedy: function(epsilon = 0.1) {
                if (Math.random() < epsilon) {
                    return Math.floor(Math.random() * this.numArms);
                }
                
                let bestArm = 0;
                let bestValue = this.values[0];
                
                for (let i = 1; i < this.numArms; i++) {
                    if (this.values[i] > bestValue) {
                        bestValue = this.values[i];
                        bestArm = i;
                    }
                }
                
                return bestArm;
            },
            
            /**
             * Update arm statistics
             */
            update: function(arm, reward) {
                this.counts[arm]++;
                this.sumRewards[arm] += reward;
                this.sumSquaredRewards[arm] += reward * reward;
                
                // Incremental mean update
                const n = this.counts[arm];
                this.values[arm] += (reward - this.values[arm]) / n;
            },
            
            /**
             * Get arm statistics
             */
            getStats: function() {
                return {
                    counts: [...this.counts],
                    values: [...this.values],
                    bestArm: this.values.indexOf(Math.max(...this.values)),
                    totalPulls: this.counts.reduce((a, b) => a + b, 0)
                };
            },
            
            _sampleBeta: function(alpha, beta) {
                // Approximation using normal distribution
                const mean = alpha / (alpha + beta);
                const variance = (alpha * beta) / (Math.pow(alpha + beta, 2) * (alpha + beta + 1));
                return mean + Math.sqrt(variance) * (Math.random() + Math.random() + Math.random() - 1.5) * 1.22;
            }
        };
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 4: PRISM_HYPEROPT_COMPLETE
// Hyperparameter optimization
// Source: MIT 6.867
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_HYPEROPT_COMPLETE = {
    name: 'PRISM Hyperparameter Optimization Complete',
    version: '1.0.0',
    
    // Search space definitions
    searchSpace: {
        uniform: (low, high) => ({ type: 'uniform', low, high }),
        logUniform: (low, high) => ({ type: 'logUniform', low, high }),
        choice: (options) => ({ type: 'choice', options }),
        intUniform: (low, high) => ({ type: 'intUniform', low, high }),
        qUniform: (low, high, q) => ({ type: 'qUniform', low, high, q })
    },
    
    /**
     * Sample from search space
     */
    sampleSpace: function(space) {
        const sample = {};
        for (const [name, config] of Object.entries(space)) {
            sample[name] = this._sampleParam(config);
        }
        return sample;
    },
    
    _sampleParam: function(config) {
        switch (config.type) {
            case 'uniform':
                return config.low + Math.random() * (config.high - config.low);
            case 'logUniform':
                const logLow = Math.log(config.low);
                const logHigh = Math.log(config.high);
                return Math.exp(logLow + Math.random() * (logHigh - logLow));
            case 'choice':
                return config.options[Math.floor(Math.random() * config.options.length)];
            case 'intUniform':
                return Math.floor(config.low + Math.random() * (config.high - config.low + 1));
            case 'qUniform':
                const val = config.low + Math.random() * (config.high - config.low);
                return Math.round(val / config.q) * config.q;
            default:
                return null;
        }
    },
    
    /**
     * Grid Search
     */
    gridSearch: function(space, objective, options = {}) {
        const { maxTrials = 1000 } = options;
        
        const grid = this._generateGrid(space);
        const results = [];
        
        for (let i = 0; i < Math.min(grid.length, maxTrials); i++) {
            const params = grid[i];
            const score = objective(params);
            results.push({ params, score, trial: i });
        }
        
        results.sort((a, b) => a.score - b.score);
        
        return {
            bestParams: results[0].params,
            bestScore: results[0].score,
            allResults: results,
            numTrials: results.length
        };
    },
    
    _generateGrid: function(space, gridPoints = 5) {
        const params = Object.entries(space);
        let grid = [{}];
        
        for (const [name, config] of params) {
            const values = this._getGridValues(config, gridPoints);
            const newGrid = [];
            
            for (const point of grid) {
                for (const value of values) {
                    newGrid.push({ ...point, [name]: value });
                }
            }
            
            grid = newGrid;
        }
        
        return grid;
    },
    
    _getGridValues: function(config, numPoints) {
        switch (config.type) {
            case 'uniform':
            case 'qUniform':
                const values = [];
                for (let i = 0; i < numPoints; i++) {
                    values.push(config.low + i * (config.high - config.low) / (numPoints - 1));
                }
                return values;
            case 'logUniform':
                const logValues = [];
                const logLow = Math.log(config.low);
                const logHigh = Math.log(config.high);
                for (let i = 0; i < numPoints; i++) {
                    logValues.push(Math.exp(logLow + i * (logHigh - logLow) / (numPoints - 1)));
                }
                return logValues;
            case 'choice':
                return config.options;
            case 'intUniform':
                const intValues = [];
                const step = Math.max(1, Math.floor((config.high - config.low) / (numPoints - 1)));
                for (let v = config.low; v <= config.high; v += step) {
                    intValues.push(v);
                }
                return intValues;
            default:
                return [null];
        }
    },
    
    /**
     * Random Search
     */
    randomSearch: function(space, objective, options = {}) {
        const { maxTrials = 100 } = options;
        
        const results = [];
        
        for (let i = 0; i < maxTrials; i++) {
            const params = this.sampleSpace(space);
            const score = objective(params);
            results.push({ params, score, trial: i });
        }
        
        results.sort((a, b) => a.score - b.score);
        
        return {
            bestParams: results[0].params,
            bestScore: results[0].score,
            allResults: results,
            numTrials: maxTrials
        };
    },
    
    /**
     * Bayesian Optimization using Gaussian Process
     */
    bayesianOptimization: function(space, objective, options = {}) {
        const {
            maxTrials = 50,
            initPoints = 5,
            acquisitionFunction = 'ei', // 'ei', 'ucb', 'poi'
            xi = 0.01,
            kappa = 2.0
        } = options;
        
        const paramNames = Object.keys(space);
        const results = [];
        
        // Initial random points
        for (let i = 0; i < initPoints; i++) {
            const params = this.sampleSpace(space);
            const score = objective(params);
            results.push({ params, score, trial: i });
        }
        
        // Bayesian optimization loop
        for (let i = initPoints; i < maxTrials; i++) {
            // Fit GP to current observations
            const X = results.map(r => this._paramsToVector(r.params, space));
            const y = results.map(r => r.score);
            
            // Find next point by optimizing acquisition function
            const nextParams = this._optimizeAcquisition(
                space, X, y, acquisitionFunction, { xi, kappa }
            );
            
            const score = objective(nextParams);
            results.push({ params: nextParams, score, trial: i });
        }
        
        results.sort((a, b) => a.score - b.score);
        
        return {
            bestParams: results[0].params,
            bestScore: results[0].score,
            allResults: results,
            numTrials: maxTrials
        };
    },
    
    _paramsToVector: function(params, space) {
        const vector = [];
        for (const [name, config] of Object.entries(space)) {
            const value = params[name];
            switch (config.type) {
                case 'uniform':
                case 'qUniform':
                    vector.push((value - config.low) / (config.high - config.low));
                    break;
                case 'logUniform':
                    const logLow = Math.log(config.low);
                    const logHigh = Math.log(config.high);
                    vector.push((Math.log(value) - logLow) / (logHigh - logLow));
                    break;
                case 'intUniform':
                    vector.push((value - config.low) / (config.high - config.low));
                    break;
                case 'choice':
                    vector.push(config.options.indexOf(value) / (config.options.length - 1));
                    break;
            }
        }
        return vector;
    },
    
    _vectorToParams: function(vector, space) {
        const params = {};
        let idx = 0;
        for (const [name, config] of Object.entries(space)) {
            const v = Math.max(0, Math.min(1, vector[idx++]));
            switch (config.type) {
                case 'uniform':
                    params[name] = config.low + v * (config.high - config.low);
                    break;
                case 'qUniform':
                    const raw = config.low + v * (config.high - config.low);
                    params[name] = Math.round(raw / config.q) * config.q;
                    break;
                case 'logUniform':
                    const logLow = Math.log(config.low);
                    const logHigh = Math.log(config.high);
                    params[name] = Math.exp(logLow + v * (logHigh - logLow));
                    break;
                case 'intUniform':
                    params[name] = Math.round(config.low + v * (config.high - config.low));
                    break;
                case 'choice':
                    params[name] = config.options[Math.round(v * (config.options.length - 1))];
                    break;
            }
        }
        return params;
    },
    
    _optimizeAcquisition: function(space, X, y, acqFunc, opts) {
        // Simple random search for acquisition optimization
        const numCandidates = 100;
        let bestCandidate = null;
        let bestAcq = -Infinity;
        
        const yMin = Math.min(...y);
        const yMean = y.reduce((a, b) => a + b, 0) / y.length;
        const yStd = Math.sqrt(y.reduce((s, v) => s + Math.pow(v - yMean, 2), 0) / y.length);
        
        for (let c = 0; c < numCandidates; c++) {
            const candidate = this.sampleSpace(space);
            const candidateVec = this._paramsToVector(candidate, space);
            
            // Simple GP prediction (using kernel average)
            const { mean, std } = this._gpPredict(candidateVec, X, y);
            
            // Compute acquisition
            let acq;
            switch (acqFunc) {
                case 'ei': // Expected Improvement
                    const z = (yMin - mean - opts.xi) / (std + 1e-10);
                    acq = (yMin - mean - opts.xi) * this._normalCDF(z) + std * this._normalPDF(z);
                    break;
                case 'ucb': // Upper Confidence Bound (negated for minimization)
                    acq = -mean - opts.kappa * std;
                    break;
                case 'poi': // Probability of Improvement
                    acq = this._normalCDF((yMin - mean - opts.xi) / (std + 1e-10));
                    break;
            }
            
            if (acq > bestAcq) {
                bestAcq = acq;
                bestCandidate = candidate;
            }
        }
        
        return bestCandidate;
    },
    
    _gpPredict: function(x, X, y) {
        // Simplified GP: weighted average based on RBF kernel
        const lengthScale = 0.5;
        let weightSum = 0;
        let mean = 0;
        
        for (let i = 0; i < X.length; i++) {
            const dist = Math.sqrt(x.reduce((s, v, j) => s + Math.pow(v - X[i][j], 2), 0));
            const weight = Math.exp(-0.5 * Math.pow(dist / lengthScale, 2));
            mean += weight * y[i];
            weightSum += weight;
        }
        
        mean = weightSum > 0 ? mean / weightSum : 0;
        
        // Estimate variance from distances to observations
        const minDist = Math.min(...X.map(xi => 
            Math.sqrt(x.reduce((s, v, j) => s + Math.pow(v - xi[j], 2), 0))
        ));
        const std = Math.max(0.01, minDist * 0.5);
        
        return { mean, std };
    },
    
    _normalCDF: function(x) {
        const a1 = 0.254829592, a2 = -0.284496736, a3 = 1.421413741;
        const a4 = -1.453152027, a5 = 1.061405429, p = 0.3275911;
        
        const sign = x < 0 ? -1 : 1;
        x = Math.abs(x) / Math.sqrt(2);
        
        const t = 1 / (1 + p * x);
        const y = 1 - (((((a5 * t + a4) * t) + a3) * t + a2) * t + a1) * t * Math.exp(-x * x);
        
        return 0.5 * (1 + sign * y);
    },
    
    _normalPDF: function(x) {
        return Math.exp(-0.5 * x * x) / Math.sqrt(2 * Math.PI);
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 5: PRISM_LR_SCHEDULER_COMPLETE
// Learning rate schedulers
// Source: MIT 6.867
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_LR_SCHEDULER_COMPLETE = {
    name: 'PRISM Learning Rate Scheduler Complete',
    version: '1.0.0',
    
    /**
     * Step decay
     */
    stepDecay: function(baseLR, step, decayRate = 0.1, decaySteps = 1000) {
        return baseLR * Math.pow(decayRate, Math.floor(step / decaySteps));
    },
    
    /**
     * Exponential decay
     */
    exponentialDecay: function(baseLR, step, decayRate = 0.96, decaySteps = 1000) {
        return baseLR * Math.pow(decayRate, step / decaySteps);
    },
    
    /**
     * Cosine annealing
     */
    cosineAnnealing: function(baseLR, step, totalSteps, minLR = 0) {
        return minLR + 0.5 * (baseLR - minLR) * (1 + Math.cos(Math.PI * step / totalSteps));
    },
    
    /**
     * Cosine annealing with warm restarts
     */
    cosineAnnealingWarmRestarts: function(baseLR, step, T0 = 1000, Tmult = 2, minLR = 0) {
        let T = T0;
        let stepInCycle = step;
        
        while (stepInCycle >= T) {
            stepInCycle -= T;
            T = Math.floor(T * Tmult);
        }
        
        return minLR + 0.5 * (baseLR - minLR) * (1 + Math.cos(Math.PI * stepInCycle / T));
    },
    
    /**
     * Linear warmup
     */
    linearWarmup: function(baseLR, step, warmupSteps) {
        if (step < warmupSteps) {
            return baseLR * step / warmupSteps;
        }
        return baseLR;
    },
    
    /**
     * Linear warmup + cosine decay (Transformer standard)
     */
    warmupCosineDecay: function(baseLR, step, warmupSteps, totalSteps, minLR = 0) {
        if (step < warmupSteps) {
            return baseLR * step / warmupSteps;
        }
        
        const decayStep = step - warmupSteps;
        const decaySteps = totalSteps - warmupSteps;
        return minLR + 0.5 * (baseLR - minLR) * (1 + Math.cos(Math.PI * decayStep / decaySteps));
    },
    
    /**
     * One-cycle policy (super-convergence)
     */
    oneCycle: function(baseLR, step, totalSteps, maxLR = null, divFactor = 25, finalDivFactor = 1e4) {
        maxLR = maxLR || baseLR * 10;
        const initialLR = maxLR / divFactor;
        const minLR = initialLR / finalDivFactor;
        
        const pctStart = 0.3;
        const warmupSteps = Math.floor(totalSteps * pctStart);
        
        if (step < warmupSteps) {
            return initialLR + (maxLR - initialLR) * step / warmupSteps;
        } else {
            const decayStep = step - warmupSteps;
            const decaySteps = totalSteps - warmupSteps;
            return minLR + 0.5 * (maxLR - minLR) * (1 + Math.cos(Math.PI * decayStep / decaySteps));
        }
    },
    
    /**
     * Cyclic LR (triangular)
     */
    cyclicLR: function(baseLR, step, maxLR, stepSize = 2000, mode = 'triangular') {
        const cycle = Math.floor(1 + step / (2 * stepSize));
        const x = Math.abs(step / stepSize - 2 * cycle + 1);
        
        switch (mode) {
            case 'triangular':
                return baseLR + (maxLR - baseLR) * Math.max(0, 1 - x);
            case 'triangular2':
                return baseLR + (maxLR - baseLR) * Math.max(0, 1 - x) / Math.pow(2, cycle - 1);
            case 'exp_range':
                return baseLR + (maxLR - baseLR) * Math.max(0, 1 - x) * Math.pow(0.99994, step);
            default:
                return baseLR;
        }
    },
    
    /**
     * Polynomial decay
     */
    polynomialDecay: function(baseLR, step, totalSteps, endLR = 0.0001, power = 1.0) {
        const clippedStep = Math.min(step, totalSteps);
        return (baseLR - endLR) * Math.pow(1 - clippedStep / totalSteps, power) + endLR;
    },
    
    /**
     * Reduce on plateau (adaptive)
     */
    createReduceOnPlateau: function(options = {}) {
        const {
            factor = 0.1,
            patience = 10,
            minLR = 1e-6,
            threshold = 1e-4,
            mode = 'min'
        } = options;
        
        return {
            factor,
            patience,
            minLR,
            threshold,
            mode,
            bestMetric: mode === 'min' ? Infinity : -Infinity,
            badEpochs: 0,
            currentLR: null,
            
            step: function(metric, currentLR) {
                this.currentLR = currentLR;
                
                const improved = this.mode === 'min'
                    ? metric < this.bestMetric - this.threshold
                    : metric > this.bestMetric + this.threshold;
                
                if (improved) {
                    this.bestMetric = metric;
                    this.badEpochs = 0;
                } else {
                    this.badEpochs++;
                }
                
                if (this.badEpochs >= this.patience) {
                    const newLR = Math.max(currentLR * this.factor, this.minLR);
                    this.badEpochs = 0;
                    this.currentLR = newLR;
                    return newLR;
                }
                
                return currentLR;
            }
        };
    },
    
    /**
     * Create scheduler with configuration
     */
    createScheduler: function(config) {
        const {
            type = 'warmup_cosine',
            baseLR = 0.001,
            warmupSteps = 0,
            totalSteps = 10000,
            minLR = 0,
            ...extra
        } = config;
        
        const self = this;
        
        return {
            config,
            step: 0,
            
            getLR: function() {
                const s = this.step;
                
                switch (type) {
                    case 'step':
                        return self.stepDecay(baseLR, s, extra.decayRate, extra.decaySteps);
                    case 'exponential':
                        return self.exponentialDecay(baseLR, s, extra.decayRate, extra.decaySteps);
                    case 'cosine':
                        return self.cosineAnnealing(baseLR, s, totalSteps, minLR);
                    case 'warmup_cosine':
                        return self.warmupCosineDecay(baseLR, s, warmupSteps, totalSteps, minLR);
                    case 'one_cycle':
                        return self.oneCycle(baseLR, s, totalSteps, extra.maxLR);
                    case 'cyclic':
                        return self.cyclicLR(baseLR, s, extra.maxLR, extra.stepSize, extra.mode);
                    case 'polynomial':
                        return self.polynomialDecay(baseLR, s, totalSteps, minLR, extra.power);
                    default:
                        return baseLR;
                }
            },
            
            next: function() {
                this.step++;
                return this.getLR();
            },
            
            reset: function() {
                this.step = 0;
            }
        };
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 6: PRISM_ACTIVE_LEARNING_COMPLETE
// Active learning query strategies
// Source: MIT 6.867
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_ACTIVE_LEARNING_COMPLETE = {
    name: 'PRISM Active Learning Complete',
    version: '1.0.0',
    
    // Data pools
    labeledData: [],
    unlabeledPool: [],
    
    // Query strategies
    strategies: {
        /**
         * Uncertainty sampling - select least confident predictions
         */
        uncertainty: function(predictions) {
            return predictions.map((p, i) => ({
                index: i,
                score: 1 - (p.confidence || Math.max(...(p.probabilities || [0.5])))
            })).sort((a, b) => b.score - a.score);
        },
        
        /**
         * Margin sampling - select smallest margin between top two classes
         */
        margin: function(predictions) {
            return predictions.map((p, i) => {
                const probs = p.probabilities || [p.confidence || 0.5, 1 - (p.confidence || 0.5)];
                const sorted = [...probs].sort((a, b) => b - a);
                const margin = sorted[0] - (sorted[1] || 0);
                return { index: i, score: 1 - margin };
            }).sort((a, b) => b.score - a.score);
        },
        
        /**
         * Entropy sampling - select highest entropy predictions
         */
        entropy: function(predictions) {
            return predictions.map((p, i) => {
                const probs = p.probabilities || [p.confidence || 0.5, 1 - (p.confidence || 0.5)];
                const entropy = -probs.reduce((sum, prob) => {
                    return prob > 0 ? sum + prob * Math.log2(prob) : sum;
                }, 0);
                return { index: i, score: entropy };
            }).sort((a, b) => b.score - a.score);
        },
        
        /**
         * Query-by-committee - select where ensemble disagrees
         */
        committee: function(predictions) {
            return predictions.map((p, i) => {
                const votes = p.committeeVotes || [];
                if (votes.length === 0) return { index: i, score: 0 };
                
                const counts = {};
                votes.forEach(v => { counts[v] = (counts[v] || 0) + 1; });
                const maxAgree = Math.max(...Object.values(counts));
                const disagreement = 1 - (maxAgree / votes.length);
                
                return { index: i, score: disagreement };
            }).sort((a, b) => b.score - a.score);
        },
        
        /**
         * Expected model change
         */
        expectedChange: function(predictions) {
            return predictions.map((p, i) => ({
                index: i,
                score: p.gradientNorm || Math.abs(1 - (p.confidence || 0.5))
            })).sort((a, b) => b.score - a.score);
        },
        
        /**
         * Diversity-based (representative sampling)
         */
        diversity: function(predictions, features) {
            if (!features) return predictions.map((_, i) => ({ index: i, score: Math.random() }));
            
            const selected = [];
            const remaining = predictions.map((p, i) => ({ index: i, features: features[i] }));
            
            // Greedy diversity selection
            while (selected.length < predictions.length && remaining.length > 0) {
                let bestIdx = 0;
                let bestMinDist = -Infinity;
                
                for (let i = 0; i < remaining.length; i++) {
                    let minDist = selected.length === 0 ? Infinity : Infinity;
                    
                    for (const s of selected) {
                        const dist = PRISM_ACTIVE_LEARNING_COMPLETE._distance(remaining[i].features, s.features);
                        minDist = Math.min(minDist, dist);
                    }
                    
                    if (selected.length === 0 || minDist > bestMinDist) {
                        bestMinDist = minDist;
                        bestIdx = i;
                    }
                }
                
                selected.push(remaining.splice(bestIdx, 1)[0]);
            }
            
            return selected.map((s, rank) => ({ index: s.index, score: 1 - rank / selected.length }));
        }
    },
    
    _distance: function(a, b) {
        if (!a || !b) return Infinity;
        let sum = 0;
        for (let i = 0; i < Math.min(a.length, b.length); i++) {
            sum += Math.pow(a[i] - b[i], 2);
        }
        return Math.sqrt(sum);
    },
    
    /**
     * Select samples to query
     */
    selectQueries: function(model, unlabeled, options = {}) {
        const {
            strategy = 'uncertainty',
            batchSize = 10,
            diversityWeight = 0.3,
            features = null
        } = options;
        
        // Get predictions
        const predictions = unlabeled.map(sample => {
            const pred = model.predict ? model.predict(sample.features) : { confidence: 0.5 };
            return { ...pred, sample };
        });
        
        // Apply strategy
        const strategyFn = this.strategies[strategy];
        if (!strategyFn) {
            console.warn(`Unknown strategy: ${strategy}`);
            return [];
        }
        
        let ranked = strategyFn(predictions, features);
        
        // Apply diversity if weight > 0
        if (diversityWeight > 0 && strategy !== 'diversity' && features) {
            const diverseRanked = this.strategies.diversity(predictions, features);
            
            ranked = ranked.map(r => {
                const diverseRank = diverseRanked.findIndex(d => d.index === r.index);
                const diverseScore = diverseRank >= 0 ? diverseRanked[diverseRank].score : 0;
                return {
                    ...r,
                    score: (1 - diversityWeight) * r.score + diversityWeight * diverseScore
                };
            }).sort((a, b) => b.score - a.score);
        }
        
        return ranked.slice(0, batchSize).map(r => ({
            sample: unlabeled[r.index],
            score: r.score,
            index: r.index
        }));
    },
    
    /**
     * Add labeled sample
     */
    addLabeledSample: function(sample, label) {
        this.labeledData.push({
            sample,
            label,
            timestamp: Date.now()
        });
    },
    
    /**
     * Add to unlabeled pool
     */
    addUnlabeledSamples: function(samples) {
        this.unlabeledPool.push(...samples.map(s => ({
            ...s,
            addedAt: Date.now()
        })));
    },
    
    /**
     * Remove from unlabeled pool
     */
    removeFromPool: function(indices) {
        const indexSet = new Set(indices);
        this.unlabeledPool = this.unlabeledPool.filter((_, i) => !indexSet.has(i));
    },
    
    /**
     * Get statistics
     */
    getStatistics: function() {
        return {
            labeledCount: this.labeledData.length,
            unlabeledCount: this.unlabeledPool.length,
            recentLabels: this.labeledData.slice(-10).map(d => ({
                label: d.label,
                timestamp: d.timestamp
            }))
        };
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 7: PRISM_UNCERTAINTY_COMPLETE
// Uncertainty quantification
// Source: MIT 6.867
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_UNCERTAINTY_COMPLETE = {
    name: 'PRISM Uncertainty Quantification Complete',
    version: '1.0.0',
    
    /**
     * Monte Carlo Dropout for uncertainty estimation
     */
    mcDropout: function(model, input, options = {}) {
        const {
            numSamples = 100,
            dropoutRate = 0.5
        } = options;
        
        const predictions = [];
        
        for (let i = 0; i < numSamples; i++) {
            // Apply dropout during inference
            const pred = model.forward ? 
                model.forward(input, true) : // training=true to apply dropout
                model.predict(input);
            predictions.push(Array.isArray(pred) ? pred : [pred]);
        }
        
        // Compute statistics
        const mean = this._arrayMean(predictions);
        const std = this._arrayStd(predictions, mean);
        
        return {
            mean,
            std,
            confidence: this._calculateConfidence(std),
            samples: predictions.length,
            epistemic: std // Epistemic uncertainty from dropout variability
        };
    },
    
    /**
     * Deep Ensemble for uncertainty
     */
    deepEnsemble: function(models, input) {
        const predictions = models.map(model => {
            const pred = model.forward ? model.forward(input) : model.predict(input);
            return Array.isArray(pred) ? pred : [pred];
        });
        
        const mean = this._arrayMean(predictions);
        const std = this._arrayStd(predictions, mean);
        
        // Decompose uncertainty
        const aleatoric = this._computeAleatoric(predictions);
        const epistemic = std;
        
        return {
            mean,
            std,
            confidence: this._calculateConfidence(std),
            aleatoric,
            epistemic,
            ensembleSize: models.length
        };
    },
    
    /**
     * Temperature scaling for calibration
     */
    temperatureScaling: {
        temperature: 1.0,
        
        fit: function(logits, labels, options = {}) {
            const { maxIter = 100, lr = 0.01 } = options;
            
            let T = 1.0;
            
            for (let iter = 0; iter < maxIter; iter++) {
                let gradSum = 0;
                
                for (let i = 0; i < logits.length; i++) {
                    const scaledLogits = logits[i].map(l => l / T);
                    const probs = this._softmax(scaledLogits);
                    
                    // Gradient of NLL w.r.t. temperature
                    const y = labels[i];
                    for (let c = 0; c < probs.length; c++) {
                        const indicator = c === y ? 1 : 0;
                        gradSum += (probs[c] - indicator) * (-logits[i][c] / (T * T));
                    }
                }
                
                T -= lr * gradSum / logits.length;
                T = Math.max(0.1, Math.min(10, T)); // Clamp
            }
            
            this.temperature = T;
            return T;
        },
        
        calibrate: function(logits) {
            return logits.map(l => l / this.temperature);
        },
        
        _softmax: function(logits) {
            const max = Math.max(...logits);
            const exps = logits.map(l => Math.exp(l - max));
            const sum = exps.reduce((a, b) => a + b, 0);
            return exps.map(e => e / sum);
        }
    },
    
    /**
     * Expected Calibration Error (ECE)
     */
    computeECE: function(predictions, labels, numBins = 10) {
        const bins = Array(numBins).fill(null).map(() => ({
            count: 0,
            accuracy: 0,
            confidence: 0
        }));
        
        for (let i = 0; i < predictions.length; i++) {
            const probs = predictions[i].probabilities || [predictions[i].confidence];
            const confidence = Math.max(...probs);
            const predicted = probs.indexOf(confidence);
            const correct = predicted === labels[i] ? 1 : 0;
            
            const binIdx = Math.min(numBins - 1, Math.floor(confidence * numBins));
            bins[binIdx].count++;
            bins[binIdx].accuracy += correct;
            bins[binIdx].confidence += confidence;
        }
        
        let ece = 0;
        const n = predictions.length;
        
        for (const bin of bins) {
            if (bin.count > 0) {
                const avgAccuracy = bin.accuracy / bin.count;
                const avgConfidence = bin.confidence / bin.count;
                ece += (bin.count / n) * Math.abs(avgAccuracy - avgConfidence);
            }
        }
        
        return {
            ece,
            bins: bins.map((b, i) => ({
                range: [i / numBins, (i + 1) / numBins],
                count: b.count,
                avgAccuracy: b.count > 0 ? b.accuracy / b.count : 0,
                avgConfidence: b.count > 0 ? b.confidence / b.count : 0
            }))
        };
    },
    
    /**
     * Predictive entropy (total uncertainty)
     */
    predictiveEntropy: function(probs) {
        let entropy = 0;
        for (const p of probs) {
            if (p > 0) {
                entropy -= p * Math.log2(p);
            }
        }
        return entropy;
    },
    
    /**
     * Mutual information (epistemic uncertainty from ensemble/MC)
     */
    mutualInformation: function(allPredictions) {
        const meanPred = this._arrayMean(allPredictions);
        const totalEntropy = this.predictiveEntropy(meanPred);
        
        let expectedEntropy = 0;
        for (const pred of allPredictions) {
            expectedEntropy += this.predictiveEntropy(pred);
        }
        expectedEntropy /= allPredictions.length;
        
        return totalEntropy - expectedEntropy;
    },
    
    _arrayMean: function(arrays) {
        const n = arrays.length;
        const len = arrays[0].length;
        const mean = new Array(len).fill(0);
        
        for (const arr of arrays) {
            for (let i = 0; i < len; i++) {
                mean[i] += arr[i];
            }
        }
        
        return mean.map(m => m / n);
    },
    
    _arrayStd: function(arrays, mean) {
        const n = arrays.length;
        const len = arrays[0].length;
        const variance = new Array(len).fill(0);
        
        for (const arr of arrays) {
            for (let i = 0; i < len; i++) {
                variance[i] += Math.pow(arr[i] - mean[i], 2);
            }
        }
        
        return variance.map(v => Math.sqrt(v / n));
    },
    
    _computeAleatoric: function(predictions) {
        // Approximate aleatoric uncertainty from prediction variance
        if (predictions.length === 0) return [0];
        
        const mean = this._arrayMean(predictions);
        return mean.map(m => Math.sqrt(m * (1 - m)));
    },
    
    _calculateConfidence: function(std) {
        const avgStd = std.reduce((a, b) => a + b, 0) / std.length;
        return Math.exp(-avgStd);
    }
};

