const PRISM_NORMALIZATION_COMPLETE = {
    name: 'PRISM Normalization Complete',
    version: '1.0.0',
    
    InstanceNorm: {
        create: function(numFeatures, epsilon = 1e-5, affine = true) {
            return { numFeatures, epsilon, affine, gamma: affine ? Array(numFeatures).fill(1) : null, beta: affine ? Array(numFeatures).fill(0) : null };
        },
        forward: function(params, x) {
            return { output: x.map(sample => {
                const mean = sample.reduce((a, v) => a + v, 0) / sample.length;
                const variance = sample.reduce((a, v) => a + (v - mean) ** 2, 0) / sample.length;
                return sample.map((v, i) => {
                    const norm = (v - mean) / Math.sqrt(variance + params.epsilon);
                    return params.affine ? params.gamma[i % params.numFeatures] * norm + params.beta[i % params.numFeatures] : norm;
                });
            }), cache: { x } };
        }
    },
    
    GroupNorm: {
        create: function(numGroups, numChannels, epsilon = 1e-5) {
            if (numChannels % numGroups !== 0) throw new Error('numChannels must be divisible by numGroups');
            return { numGroups, numChannels, channelsPerGroup: numChannels / numGroups, epsilon, gamma: Array(numChannels).fill(1), beta: Array(numChannels).fill(0) };
        },
        forward: function(params, x) {
            return { output: x.map(sample => {
                const normalized = Array(params.numChannels).fill(0);
                for (let g = 0; g < params.numGroups; g++) {
                    const startIdx = g * params.channelsPerGroup;
                    const endIdx = startIdx + params.channelsPerGroup;
                    const groupValues = sample.slice(startIdx, endIdx);
                    const mean = groupValues.reduce((a, v) => a + v, 0) / params.channelsPerGroup;
                    const variance = groupValues.reduce((a, v) => a + (v - mean) ** 2, 0) / params.channelsPerGroup;
                    for (let c = startIdx; c < endIdx; c++) {
                        const norm = (sample[c] - mean) / Math.sqrt(variance + params.epsilon);
                        normalized[c] = params.gamma[c] * norm + params.beta[c];
                    }
                }
                return normalized;
            }), cache: { x } };
        }
    },
    
    RMSNorm: {
        create: function(dim, epsilon = 1e-6) { return { dim, epsilon, gamma: Array(dim).fill(1) }; },
        forward: function(params, x) {
            return { output: x.map(sample => {
                const rms = Math.sqrt(sample.reduce((a, v) => a + v * v, 0) / sample.length + params.epsilon);
                return sample.map((v, i) => (v / rms) * params.gamma[i]);
            }), cache: { x } };
        }
    },
    
    WeightStandardization: {
        standardize: function(W, epsilon = 1e-5) {
            return W.map(row => {
                const mean = row.reduce((a, v) => a + v, 0) / row.length;
                const variance = row.reduce((a, v) => a + (v - mean) ** 2, 0) / row.length;
                return row.map(v => (v - mean) / Math.sqrt(variance + epsilon));
            });
        }
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 3: PRISM_OPTIMIZER_ADVANCED
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_OPTIMIZER_ADVANCED = {
    name: 'PRISM Optimizer Advanced',
    version: '1.0.0',
    
    Nadam: {
        create: function(params, config = {}) {
            const { lr = 0.001, beta1 = 0.9, beta2 = 0.999, epsilon = 1e-8, scheduleDecay = 0.004 } = config;
            const state = { lr, beta1, beta2, epsilon, scheduleDecay, t: 0, m: {}, v: {}, muProduct: 1 };
            for (const [name, param] of Object.entries(params)) {
                if (Array.isArray(param)) {
                    state.m[name] = Array.isArray(param[0]) ? param.map(row => row.map(() => 0)) : param.map(() => 0);
                    state.v[name] = Array.isArray(param[0]) ? param.map(row => row.map(() => 0)) : param.map(() => 0);
                }
            }
            return state;
        },
        step: function(state, params, grads) {
            state.t += 1;
            const t = state.t;
            const mu_t = state.beta1 * (1 - 0.5 * Math.pow(0.96, t * state.scheduleDecay));
            const mu_t1 = state.beta1 * (1 - 0.5 * Math.pow(0.96, (t + 1) * state.scheduleDecay));
            state.muProduct *= mu_t;
            const muProductNext = state.muProduct * mu_t1;
            
            for (const [name, grad] of Object.entries(grads)) {
                if (!state.m[name]) continue;
                const update = (m, v, g, p) => {
                    const newM = state.beta1 * m + (1 - state.beta1) * g;
                    const newV = state.beta2 * v + (1 - state.beta2) * g * g;
                    const mHat = (mu_t1 * newM + (1 - mu_t) * g) / (1 - muProductNext);
                    const vHat = newV / (1 - Math.pow(state.beta2, t));
                    return { newM, newV, newP: p - state.lr * mHat / (Math.sqrt(vHat) + state.epsilon) };
                };
                if (Array.isArray(grad[0])) {
                    for (let i = 0; i < grad.length; i++) {
                        for (let j = 0; j < grad[i].length; j++) {
                            const { newM, newV, newP } = update(state.m[name][i][j], state.v[name][i][j], grad[i][j], params[name][i][j]);
                            state.m[name][i][j] = newM; state.v[name][i][j] = newV; params[name][i][j] = newP;
                        }
                    }
                } else {
                    for (let i = 0; i < grad.length; i++) {
                        const { newM, newV, newP } = update(state.m[name][i], state.v[name][i], grad[i], params[name][i]);
                        state.m[name][i] = newM; state.v[name][i] = newV; params[name][i] = newP;
                    }
                }
            }
            return params;
        }
    },
    
    Adadelta: {
        create: function(params, config = {}) {
            const { rho = 0.95, epsilon = 1e-6 } = config;
            const state = { rho, epsilon, avgSqGrad: {}, avgSqDelta: {} };
            for (const [name, param] of Object.entries(params)) {
                if (Array.isArray(param)) {
                    state.avgSqGrad[name] = Array.isArray(param[0]) ? param.map(row => row.map(() => 0)) : param.map(() => 0);
                    state.avgSqDelta[name] = Array.isArray(param[0]) ? param.map(row => row.map(() => 0)) : param.map(() => 0);
                }
            }
            return state;
        },
        step: function(state, params, grads) {
            for (const [name, grad] of Object.entries(grads)) {
                if (!state.avgSqGrad[name]) continue;
                const update = (avgG, avgD, g, p) => {
                    const newAvgG = state.rho * avgG + (1 - state.rho) * g * g;
                    const rmsGrad = Math.sqrt(newAvgG + state.epsilon);
                    const rmsDelta = Math.sqrt(avgD + state.epsilon);
                    const delta = -(rmsDelta / rmsGrad) * g;
                    const newAvgD = state.rho * avgD + (1 - state.rho) * delta * delta;
                    return { newAvgG, newAvgD, newP: p + delta };
                };
                if (Array.isArray(grad[0])) {
                    for (let i = 0; i < grad.length; i++) {
                        for (let j = 0; j < grad[i].length; j++) {
                            const { newAvgG, newAvgD, newP } = update(state.avgSqGrad[name][i][j], state.avgSqDelta[name][i][j], grad[i][j], params[name][i][j]);
                            state.avgSqGrad[name][i][j] = newAvgG; state.avgSqDelta[name][i][j] = newAvgD; params[name][i][j] = newP;
                        }
                    }
                } else {
                    for (let i = 0; i < grad.length; i++) {
                        const { newAvgG, newAvgD, newP } = update(state.avgSqGrad[name][i], state.avgSqDelta[name][i], grad[i], params[name][i]);
                        state.avgSqGrad[name][i] = newAvgG; state.avgSqDelta[name][i] = newAvgD; params[name][i] = newP;
                    }
                }
            }
            return params;
        }
    },
    
    RAdam: {
        create: function(params, config = {}) {
            const { lr = 0.001, beta1 = 0.9, beta2 = 0.999, epsilon = 1e-8 } = config;
            const state = { lr, beta1, beta2, epsilon, t: 0, rhoInf: 2 / (1 - beta2) - 1, m: {}, v: {} };
            for (const [name, param] of Object.entries(params)) {
                if (Array.isArray(param)) {
                    state.m[name] = Array.isArray(param[0]) ? param.map(row => row.map(() => 0)) : param.map(() => 0);
                    state.v[name] = Array.isArray(param[0]) ? param.map(row => row.map(() => 0)) : param.map(() => 0);
                }
            }
            return state;
        },
        step: function(state, params, grads) {
            state.t += 1;
            const t = state.t;
            const rho_t = state.rhoInf - 2 * t * Math.pow(state.beta2, t) / (1 - Math.pow(state.beta2, t));
            for (const [name, grad] of Object.entries(grads)) {
                if (!state.m[name]) continue;
                const update = (m, v, g, p) => {
                    const newM = state.beta1 * m + (1 - state.beta1) * g;
                    const newV = state.beta2 * v + (1 - state.beta2) * g * g;
                    const mHat = newM / (1 - Math.pow(state.beta1, t));
                    let upd;
                    if (rho_t > 5) {
                        const vHat = newV / (1 - Math.pow(state.beta2, t));
                        const rect = Math.sqrt(((rho_t-4)*(rho_t-2)*state.rhoInf)/((state.rhoInf-4)*(state.rhoInf-2)*rho_t));
                        upd = state.lr * rect * mHat / (Math.sqrt(vHat) + state.epsilon);
                    } else { upd = state.lr * mHat; }
                    return { newM, newV, newP: p - upd };
                };
                if (Array.isArray(grad[0])) {
                    for (let i = 0; i < grad.length; i++) {
                        for (let j = 0; j < grad[i].length; j++) {
                            const { newM, newV, newP } = update(state.m[name][i][j], state.v[name][i][j], grad[i][j], params[name][i][j]);
                            state.m[name][i][j] = newM; state.v[name][i][j] = newV; params[name][i][j] = newP;
                        }
                    }
                } else {
                    for (let i = 0; i < grad.length; i++) {
                        const { newM, newV, newP } = update(state.m[name][i], state.v[name][i], grad[i], params[name][i]);
                        state.m[name][i] = newM; state.v[name][i] = newV; params[name][i] = newP;
                    }
                }
            }
            return params;
        }
    },
    
    Lookahead: {
        create: function(baseOptimizer, params, config = {}) {
            const { k = 5, alpha = 0.5 } = config;
            const slowWeights = {};
            for (const [name, param] of Object.entries(params)) {
                if (Array.isArray(param)) slowWeights[name] = Array.isArray(param[0]) ? param.map(row => [...row]) : [...param];
            }
            return { baseOptimizer, k, alpha, slowWeights, stepCount: 0 };
        },
        step: function(state, params, grads) {
            state.baseOptimizer.step(state.baseOptimizer, params, grads);
            state.stepCount++;
            if (state.stepCount % state.k === 0) {
                for (const [name, param] of Object.entries(params)) {
                    if (!state.slowWeights[name]) continue;
                    if (Array.isArray(param[0])) {
                        for (let i = 0; i < param.length; i++) {
                            for (let j = 0; j < param[i].length; j++) {
                                state.slowWeights[name][i][j] += state.alpha * (params[name][i][j] - state.slowWeights[name][i][j]);
                                params[name][i][j] = state.slowWeights[name][i][j];
                            }
                        }
                    } else {
                        for (let i = 0; i < param.length; i++) {
                            state.slowWeights[name][i] += state.alpha * (params[name][i] - state.slowWeights[name][i]);
                            params[name][i] = state.slowWeights[name][i];
                        }
                    }
                }
            }
            return params;
        }
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 4: PRISM_UMAP - Uniform Manifold Approximation
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_UMAP = {
    name: 'PRISM UMAP',
    version: '1.0.0',
    
    create: function(config = {}) {
        const { nComponents = 2, nNeighbors = 15, minDist = 0.1, spread = 1.0, nEpochs = 200, learningRate = 1.0 } = config;
        return { nComponents, nNeighbors, minDist, spread, nEpochs, learningRate, a: 1.0, b: Math.log(2) / (spread - minDist) };
    },
    
    computeDistances: function(X, metric = 'euclidean') {
        const n = X.length;
        const distances = Array(n).fill(null).map(() => Array(n).fill(0));
        for (let i = 0; i < n; i++) {
            for (let j = i + 1; j < n; j++) {
                const dist = metric === 'euclidean' 
                    ? Math.sqrt(X[i].reduce((sum, v, k) => sum + (v - X[j][k]) ** 2, 0))
                    : X[i].reduce((sum, v, k) => sum + Math.abs(v - X[j][k]), 0);
                distances[i][j] = dist; distances[j][i] = dist;
            }
        }
        return distances;
    },
    
    findKNN: function(distances, k) {
        const n = distances.length;
        const knnIndices = [], knnDistances = [];
        for (let i = 0; i < n; i++) {
            const indexed = distances[i].map((d, j) => ({ idx: j, dist: d })).sort((a, b) => a.dist - b.dist);
            const neighbors = indexed.slice(1, k + 1);
            knnIndices.push(neighbors.map(n => n.idx));
            knnDistances.push(neighbors.map(n => n.dist));
        }
        return { knnIndices, knnDistances };
    },
    
    computeFuzzyGraph: function(knnIndices, knnDistances, nNeighbors) {
        const n = knnIndices.length;
        const graph = Array(n).fill(null).map(() => ({}));
        for (let i = 0; i < n; i++) {
            const rho = knnDistances[i][0];
            let sigma = 1.0;
            for (let iter = 0; iter < 64; iter++) {
                let sum = knnDistances[i].reduce((a, d) => a + Math.exp(-Math.max(0, d - rho) / sigma), 0);
                if (Math.abs(sum - nNeighbors) < 1e-5) break;
                sigma = sum < nNeighbors ? sigma * 2 : sigma / 2;
            }
            for (let j = 0; j < knnIndices[i].length; j++) {
                graph[i][knnIndices[i][j]] = Math.exp(-Math.max(0, knnDistances[i][j] - rho) / sigma);
            }
        }
        const symmetricGraph = Array(n).fill(null).map(() => ({}));
        for (let i = 0; i < n; i++) {
            for (const [j, wij] of Object.entries(graph[i])) {
                const jInt = parseInt(j);
                const wji = graph[jInt][i] || 0;
                const combined = wij + wji - wij * wji;
                symmetricGraph[i][jInt] = combined;
                symmetricGraph[jInt][i] = combined;
            }
        }
        return symmetricGraph;
    },
    
    fitTransform: function(params, X) {
        const n = X.length;
        const distances = this.computeDistances(X);
        const { knnIndices, knnDistances } = this.findKNN(distances, params.nNeighbors);
        const graph = this.computeFuzzyGraph(knnIndices, knnDistances, params.nNeighbors);
        
        let embedding = Array(n).fill(null).map(() => Array(params.nComponents).fill(0).map(() => (Math.random() - 0.5) * 20));
        
        for (let epoch = 0; epoch < params.nEpochs; epoch++) {
            const alpha = params.learningRate * (1 - epoch / params.nEpochs);
            for (let i = 0; i < n; i++) {
                for (const [jStr, weight] of Object.entries(graph[i])) {
                    const j = parseInt(jStr);
                    if (weight < 0.01) continue;
                    const distSq = embedding[i].reduce((sum, v, d) => sum + (v - embedding[j][d]) ** 2, 0);
                    const gradCoeff = -2 * params.a * params.b * Math.pow(distSq, params.b - 1) / (1 + params.a * Math.pow(distSq, params.b));
                    for (let d = 0; d < params.nComponents; d++) {
                        embedding[i][d] -= alpha * gradCoeff * (embedding[i][d] - embedding[j][d]) * weight;
                    }
                    const k = Math.floor(Math.random() * n);
                    if (k !== i && !graph[i][k]) {
                        const negDistSq = embedding[i].reduce((sum, v, d) => sum + (v - embedding[k][d]) ** 2, 0);
                        const repGradCoeff = 2 * params.b / ((0.001 + negDistSq) * (1 + params.a * Math.pow(negDistSq, params.b)));
                        for (let d = 0; d < params.nComponents; d++) {
                            embedding[i][d] += alpha * Math.max(-4, Math.min(4, repGradCoeff * (embedding[i][d] - embedding[k][d])));
                        }
                    }
                }
            }
        }
        return embedding;
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 5: PRISM_TRANSFORMER_DECODER
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_TRANSFORMER_DECODER = {
    name: 'PRISM Transformer Decoder',
    version: '1.0.0',
    
    createDecoderLayer: function(dModel, nHeads, dFF, dropout = 0.1) {
        const dK = Math.floor(dModel / nHeads);
        const xavier = (fanIn, fanOut) => Math.sqrt(6 / (fanIn + fanOut));
        const initWeights = () => Array(dModel).fill(0).map(() => Array(dModel).fill(0).map(() => (Math.random()-0.5)*2*xavier(dModel,dModel)));
        return {
            dModel, nHeads, dK, dFF, dropout,
            selfAttn: { WQ: initWeights(), WK: initWeights(), WV: initWeights(), WO: initWeights() },
            crossAttn: { WQ: initWeights(), WK: initWeights(), WV: initWeights(), WO: initWeights() },
            W1: Array(dModel).fill(0).map(() => Array(dFF).fill(0).map(() => (Math.random()-0.5)*2*xavier(dModel,dFF))),
            b1: Array(dFF).fill(0),
            W2: Array(dFF).fill(0).map(() => Array(dModel).fill(0).map(() => (Math.random()-0.5)*2*xavier(dFF,dModel))),
            b2: Array(dModel).fill(0),
            ln1Gamma: Array(dModel).fill(1), ln1Beta: Array(dModel).fill(0),
            ln2Gamma: Array(dModel).fill(1), ln2Beta: Array(dModel).fill(0),
            ln3Gamma: Array(dModel).fill(1), ln3Beta: Array(dModel).fill(0)
        };
    },
    
    _project: function(x, W) {
        return x.map(row => W[0].map((_, j) => row.reduce((sum, v, i) => sum + v * W[i][j], 0)));
    },
    
    _splitHeads: function(x, nHeads, dK) {
        return Array(nHeads).fill(null).map((_, h) => x.map(row => row.slice(h * dK, (h + 1) * dK)));
    },
    
    _layerNorm: function(x, gamma, beta, epsilon = 1e-6) {
        return x.map(row => {
            const mean = row.reduce((a, v) => a + v, 0) / row.length;
            const variance = row.reduce((a, v) => a + (v - mean) ** 2, 0) / row.length;
            return row.map((v, i) => gamma[i] * (v - mean) / Math.sqrt(variance + epsilon) + beta[i]);
        });
    },
    
    maskedSelfAttention: function(layer, x) {
        const seqLen = x.length;
        const { nHeads, dK } = layer;
        const Q = this._project(x, layer.selfAttn.WQ);
        const K = this._project(x, layer.selfAttn.WK);
        const V = this._project(x, layer.selfAttn.WV);
        const Qheads = this._splitHeads(Q, nHeads, dK);
        const Kheads = this._splitHeads(K, nHeads, dK);
        const Vheads = this._splitHeads(V, nHeads, dK);
        
        const headOutputs = [];
        for (let h = 0; h < nHeads; h++) {
            const scores = Array(seqLen).fill(null).map((_, i) => Array(seqLen).fill(0).map((_, j) => {
                if (j > i) return -1e9;
                return Qheads[h][i].reduce((sum, v, k) => sum + v * Kheads[h][j][k], 0) / Math.sqrt(dK);
            }));
            const attnWeights = scores.map(row => {
                const maxVal = Math.max(...row);
                const exp = row.map(v => Math.exp(v - maxVal));
                const sum = exp.reduce((a, b) => a + b, 0);
                return exp.map(v => v / sum);
            });
            headOutputs.push(Array(seqLen).fill(null).map((_, i) => Array(dK).fill(0).map((_, k) => 
                attnWeights[i].reduce((sum, w, j) => sum + w * Vheads[h][j][k], 0)
            )));
        }
        return this._project(Array(seqLen).fill(null).map((_, i) => headOutputs.flatMap(head => head[i])), layer.selfAttn.WO);
    },
    
    crossAttention: function(layer, x, encoderOutput) {
        const decoderLen = x.length, encoderLen = encoderOutput.length;
        const { nHeads, dK } = layer;
        const Q = this._project(x, layer.crossAttn.WQ);
        const K = this._project(encoderOutput, layer.crossAttn.WK);
        const V = this._project(encoderOutput, layer.crossAttn.WV);
        const Qheads = this._splitHeads(Q, nHeads, dK);
        const Kheads = this._splitHeads(K, nHeads, dK);
        const Vheads = this._splitHeads(V, nHeads, dK);
        
        const headOutputs = [];
        for (let h = 0; h < nHeads; h++) {
            const scores = Array(decoderLen).fill(null).map((_, i) => Array(encoderLen).fill(0).map((_, j) => 
                Qheads[h][i].reduce((sum, v, k) => sum + v * Kheads[h][j][k], 0) / Math.sqrt(dK)
            ));
            const attnWeights = scores.map(row => {
                const maxVal = Math.max(...row);
                const exp = row.map(v => Math.exp(v - maxVal));
                const sum = exp.reduce((a, b) => a + b, 0);
                return exp.map(v => v / sum);
            });
            headOutputs.push(Array(decoderLen).fill(null).map((_, i) => Array(dK).fill(0).map((_, k) => 
                attnWeights[i].reduce((sum, w, j) => sum + w * Vheads[h][j][k], 0)
            )));
        }
        return this._project(Array(decoderLen).fill(null).map((_, i) => headOutputs.flatMap(head => head[i])), layer.crossAttn.WO);
    },
    
    forward: function(layer, x, encoderOutput) {
        const selfAttnOut = this.maskedSelfAttention(layer, x);
        let residual = x.map((row, i) => row.map((v, j) => v + selfAttnOut[i][j]));
        let normalized = this._layerNorm(residual, layer.ln1Gamma, layer.ln1Beta);
        
        const crossAttnOut = this.crossAttention(layer, normalized, encoderOutput);
        residual = normalized.map((row, i) => row.map((v, j) => v + crossAttnOut[i][j]));
        normalized = this._layerNorm(residual, layer.ln2Gamma, layer.ln2Beta);
        
        const ffnOut = normalized.map(row => {
            const hidden = layer.b1.map((b, j) => {
                let sum = b;
                for (let i = 0; i < row.length; i++) sum += row[i] * layer.W1[i][j];
                return sum * 0.5 * (1 + Math.tanh(Math.sqrt(2 / Math.PI) * (sum + 0.044715 * sum ** 3)));
            });
            return layer.b2.map((b, j) => {
                let sum = b;
                for (let i = 0; i < hidden.length; i++) sum += hidden[i] * layer.W2[i][j];
                return sum;
            });
        });
        residual = normalized.map((row, i) => row.map((v, j) => v + ffnOut[i][j]));
        return this._layerNorm(residual, layer.ln3Gamma, layer.ln3Beta);
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 6: PRISM_ATTENTION_VARIANTS - Linear, Local, Axial
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_ATTENTION_VARIANTS = {
    name: 'PRISM Attention Variants',
    version: '1.0.0',
    
    LinearAttention: {
        featureMap: function(x) { return x.map(row => row.map(v => (v > 0 ? v : Math.exp(v) - 1) + 1)); },
        
        forward: function(Q, K, V) {
            const seqLen = Q.length, dK = Q[0].length, dV = V[0].length;
            const phiQ = this.featureMap(Q), phiK = this.featureMap(K);
            
            const KTV = Array(dK).fill(null).map(() => Array(dV).fill(0));
            const KTone = Array(dK).fill(0);
            for (let i = 0; i < dK; i++) {
                for (let n = 0; n < seqLen; n++) {
                    KTone[i] += phiK[n][i];
                    for (let j = 0; j < dV; j++) KTV[i][j] += phiK[n][i] * V[n][j];
                }
            }
            
            return Array(seqLen).fill(null).map((_, n) => {
                const out = Array(dV).fill(0);
                let denom = 0;
                for (let i = 0; i < dK; i++) {
                    denom += phiQ[n][i] * KTone[i];
                    for (let j = 0; j < dV; j++) out[j] += phiQ[n][i] * KTV[i][j];
                }
                return out.map(v => v / (denom + 1e-6));
            });
        },
        
        causalForward: function(Q, K, V) {
            const seqLen = Q.length, dK = Q[0].length, dV = V[0].length;
            const phiQ = this.featureMap(Q), phiK = this.featureMap(K);
            const output = Array(seqLen).fill(null).map(() => Array(dV).fill(0));
            const runningKTV = Array(dK).fill(null).map(() => Array(dV).fill(0));
            const runningKTone = Array(dK).fill(0);
            
            for (let n = 0; n < seqLen; n++) {
                for (let i = 0; i < dK; i++) {
                    runningKTone[i] += phiK[n][i];
                    for (let j = 0; j < dV; j++) runningKTV[i][j] += phiK[n][i] * V[n][j];
                }
                let denom = 0;
                for (let i = 0; i < dK; i++) {
                    denom += phiQ[n][i] * runningKTone[i];
                    for (let j = 0; j < dV; j++) output[n][j] += phiQ[n][i] * runningKTV[i][j];
                }
                for (let j = 0; j < dV; j++) output[n][j] /= (denom + 1e-6);
            }
            return output;
        }
    },
    
    LocalAttention: {
        forward: function(Q, K, V, windowSize = 64) {
            const seqLen = Q.length, dK = Q[0].length, dV = V[0].length;
            return Array(seqLen).fill(null).map((_, i) => {
                const startJ = Math.max(0, i - windowSize), endJ = Math.min(seqLen, i + windowSize + 1);
                const scores = [];
                for (let j = startJ; j < endJ; j++) {
                    scores.push(Q[i].reduce((sum, v, k) => sum + v * K[j][k], 0) / Math.sqrt(dK));
                }
                const maxScore = Math.max(...scores);
                const expScores = scores.map(s => Math.exp(s - maxScore));
                const sumExp = expScores.reduce((a, b) => a + b, 0);
                const weights = expScores.map(e => e / sumExp);
                
                const out = Array(dV).fill(0);
                for (let j = startJ; j < endJ; j++) {
                    const w = weights[j - startJ];
                    for (let k = 0; k < dV; k++) out[k] += w * V[j][k];
                }
                return out;
            });
        }
    }
};

// ═══════════════════════════════════════════════════════════════════════════════
// COMPONENT 7: PRISM_SEQUENCE_MODELS - BiLSTM, BiGRU, AttentionLSTM
// ═══════════════════════════════════════════════════════════════════════════════

const PRISM_SEQUENCE_MODELS = {
    name: 'PRISM Sequence Models',
    version: '1.0.0',
    
    BiLSTM: {
        create: function(inputDim, hiddenDim) {
            const xavier = (fanIn, fanOut) => Math.sqrt(6 / (fanIn + fanOut));
            const createWeights = () => ({
                Wi: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Ui: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                bi: Array(hiddenDim).fill(0),
                Wf: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Uf: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                bf: Array(hiddenDim).fill(1),
                Wc: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Uc: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                bc: Array(hiddenDim).fill(0),
                Wo: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Uo: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                bo: Array(hiddenDim).fill(0)
            });
            return { inputDim, hiddenDim, forward: createWeights(), backward: createWeights() };
        },
        
        lstmCell: function(weights, x, hPrev, cPrev) {
            const hiddenDim = weights.bi.length;
            const sigmoid = v => 1 / (1 + Math.exp(-Math.max(-500, Math.min(500, v))));
            const tanh = v => Math.tanh(v);
            
            const computeGate = (W, U, b, activation) => b.map((bias, j) => {
                let sum = bias;
                for (let k = 0; k < x.length; k++) sum += x[k] * W[k][j];
                for (let k = 0; k < hiddenDim; k++) sum += hPrev[k] * U[k][j];
                return activation(sum);
            });
            
            const i = computeGate(weights.Wi, weights.Ui, weights.bi, sigmoid);
            const f = computeGate(weights.Wf, weights.Uf, weights.bf, sigmoid);
            const cCandidate = computeGate(weights.Wc, weights.Uc, weights.bc, tanh);
            const o = computeGate(weights.Wo, weights.Uo, weights.bo, sigmoid);
            
            const c = cPrev.map((cp, j) => f[j] * cp + i[j] * cCandidate[j]);
            const h = c.map((cj, j) => o[j] * tanh(cj));
            return { h, c };
        },
        
        forward: function(model, sequence) {
            const seqLen = sequence.length, hiddenDim = model.hiddenDim;
            let hF = Array(hiddenDim).fill(0), cF = Array(hiddenDim).fill(0);
            let hB = Array(hiddenDim).fill(0), cB = Array(hiddenDim).fill(0);
            const fwdOut = [], bwdOut = [];
            
            for (let t = 0; t < seqLen; t++) {
                const res = this.lstmCell(model.forward, sequence[t], hF, cF);
                hF = res.h; cF = res.c;
                fwdOut.push([...hF]);
            }
            for (let t = seqLen - 1; t >= 0; t--) {
                const res = this.lstmCell(model.backward, sequence[t], hB, cB);
                hB = res.h; cB = res.c;
                bwdOut.unshift([...hB]);
            }
            return { outputs: fwdOut.map((f, t) => [...f, ...bwdOut[t]]), finalForward: hF, finalBackward: hB };
        }
    },
    
    BiGRU: {
        create: function(inputDim, hiddenDim) {
            const xavier = (fanIn, fanOut) => Math.sqrt(6 / (fanIn + fanOut));
            const createWeights = () => ({
                Wr: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Ur: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                br: Array(hiddenDim).fill(0),
                Wz: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Uz: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                bz: Array(hiddenDim).fill(0),
                Wh: Array(inputDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(inputDim,hiddenDim))),
                Uh: Array(hiddenDim).fill(0).map(() => Array(hiddenDim).fill(0).map(() => (Math.random()-0.5)*2*xavier(hiddenDim,hiddenDim))),
                bh: Array(hiddenDim).fill(0)
            });
            return { inputDim, hiddenDim, forward: createWeights(), backward: createWeights() };
        },
        
        gruCell: function(weights, x, hPrev) {
            const hiddenDim = weights.br.length;
            const sigmoid = v => 1 / (1 + Math.exp(-Math.max(-500, Math.min(500, v))));
            const tanh = v => Math.tanh(v);
            
            const r = weights.br.map((b, j) => {
                let sum = b;
                for (let k = 0; k < x.length; k++) sum += x[k] * weights.Wr[k][j];
                for (let k = 0; k < hiddenDim; k++) sum += hPrev[k] * weights.Ur[k][j];
                return sigmoid(sum);
            });
            const z = weights.bz.map((b, j) => {
                let sum = b;
                for (let k = 0; k < x.length; k++) sum += x[k] * weights.Wz[k][j];
                for (let k = 0; k < hiddenDim; k++) sum += hPrev[k] * weights.Uz[k][j];
                return sigmoid(sum);
            });
            const hCandidate = weights.bh.map((b, j) => {
                let sum = b;
                for (let k = 0; k < x.length; k++) sum += x[k] * weights.Wh[k][j];
                for (let k = 0; k < hiddenDim; k++) sum += (r[k] * hPrev[k]) * weights.Uh[k][j];
                return tanh(sum);
            });
            return hPrev.map((hp, j) => (1 - z[j]) * hp + z[j] * hCandidate[j]);
        },
        
        forward: function(model, sequence) {
            const seqLen = sequence.length, hiddenDim = model.hiddenDim;
            let hF = Array(hiddenDim).fill(0), hB = Array(hiddenDim).fill(0);
            const fwdOut = [], bwdOut = [];
            
            for (let t = 0; t < seqLen; t++) {
                hF = this.gruCell(model.forward, sequence[t], hF);
                fwdOut.push([...hF]);
            }
            for (let t = seqLen - 1; t >= 0; t--) {
                hB = this.gruCell(model.backward, sequence[t], hB);
                bwdOut.unshift([...hB]);
            }
            return { outputs: fwdOut.map((f, t) => [...f, ...bwdOut[t]]), finalForward: hF, finalBackward: hB };
        }
    }
};

